12	<h1>Contact</h1><p>Stichting PCPO "De Vier\r\nWindstreken"</span></p><p></span>Heuvellaan 22803 DM Gouda</p><p>T 0182 526719E info@d4w.nl</p>
5	<h1>Personeelsbeleid</h1>\r\n<br />\r\n<p><strong>Inleiding</strong></p>\r\n<br />\r\n<p>De stichting P.C.P.O. 'De Vier Windstreken' wil voor haar 380 personeelsleden een goed werkgever zijn. Dit vraagt om een actief personeelsbeleid. Natuurlijk zijn allerlei aspecten van personeelsbeleid in een I.P.B. (Integraal Personeels Beleidsplan)vastgelegd. Op elke school ligt dit I.P.B. ter inzage.</p>\r\n<br />\r\n\r\n<p><strong>Startende leerkracht</strong></p>\r\n<br />\r\n<p>Als je&#160;op een nieuwe school&#160;begint, hebben we binnen onze stichting uiteraard op elke school een inwerkplan voor nieuwe leerkrachten. Ook wordt een zittende leerkracht aangewezen als begeleider. Voorts hebben we afgesproken dat een nieuwe leerkracht in het kader van taakbeleid het eerste schooljaar geen extra taken hoeft te doen naast de reguliere lesgevende taken. Uiteraard zal een ervaren leerkracht, die van een andere school komt, al na kortere tijd gevraagd kunnen worden taken in het kader van het taakbeleid op zich te nemen. Maar als je aan je onderwijsloopbaan begint, ligt dat toch wat anders. We realiseren ons dat er in het eerste jaar van je onderwijsloopbaan veel gevraagd wordt en dat er heel veel nieuwe zaken op je afkomen. Ondanks alle goede begeleiding binnen de eigen school vinden we het van belang dat je ook samen met andere 'starters in het onderwijs' binnen de stichting extra begeleiding dient te krijgen, o.a.in de vorm van intervisie momenten. Het is goed om ervaringen van anderen te horen over hun eerste periode in het onderwijs. We hebben daarvoor binnen de stichting voor deze groep startende leerkrachten een aantal begeleidings-, en intervisiemomenten in hun eerste schooljaar ingepland, die verplicht zijn. Als het goed is, is dat ook bij het sollicitatiegesprek aan de orde geweest. Deze meer specifieke begeleiding wordt op professionele wijze ingevuld op enkele woensdagmiddagen en/of avonden.</p>\r\n<br />\r\n<p><span><strong>BAPO</strong></span></p>\r\n<br />\r\n<p>\r\nZoals ongetwijfeld bekend is bij velen, bestaat op 52 jarige leeftijd recht op BAPO voor maximaal 104 lesgevende uren,&#160;en op 56 jarige leeftijd het recht op BAPO voor maximaal&#160;208 lesgevende uren.<br />Over het BAPO verlof wordt een eigen bijdrage betaald (vanaf schaal 9: 35%).<br />Daarnaast kennen we flexibele BAPO. Dit houdt in dat u BAPO verlof kunt sparen en later kan opnemen. Wanneer u de&#160;gespaarde uren opneemt, kan dat in principe alleen wanneer u per week 50% blijft werken.Alleen werknemers die vòòr 31-12-2005,&#160;zesenvijfig (56)&#160;jaar waren, geldt de overgangsregeling: zij kunnen 50% verlof opnemen per jaar en hebben nog recht op de bonusuren.<br />U moet het bestuur van de stichting melden dat u uw BAPO-uren wilt opsparen voor later en hoeveel uren u in het eerste jaar van opname wilt gebruiken (zie ook CNV brochure 'ADV, spaarverlof en BAPO in het primair onderwijs', pagina 10). Dat betekent dat u&#160;<strong>vooraf</strong>&#160;moet melden gebruik te willen maken van flexibele BAPO en dat dit niet met terugwerkende kracht kan. Deze verplichting geldt al lang, maar er werd vanwege de mogelijkheid om toch te kunnen declareren&#160;bij de overheid nog al eens soepel mee omgegaan. Bij de invoering van de lumpsum financiering is dat voorbij en kan&#160;<strong>alleen</strong>&#160;flexibele BAPO worden opgenomen wanneer dat&#160;<strong>vooraf</strong>&#160;is aangegeven, daar de gelden hiervoor niet meer gedeclareerd kunnen worden, maar uit de lumpsum betaald moeten worden. Voor eventuele flexibele BAPO met terugwerkende kracht zijn dan geen middelen gespaard. Binnen onze stichting hebben we ons altijd gehouden aan deze meldingsverplichting en zullen dat ook blijven doen.&#160;<strong>Herintreders</strong>Herintreders worden in principe ingeschaald op basis van het laatst genoten inkomen. Dit betekent dat iemand die een aantal jaren in het onderwijs heeft gewerkt, vervolgens een aantal jaren gestopt is met werken en dan weer begint geen periodieken wat betreft salariëring ontvangt over de niet gewerkte jaren.<br />In de CAO is nu het volgende vastgelegd:<br />Wanneer een herintreder op basis van een beoordeling en na twee jaar weer werkzaam geweest te zijn in het onderwijs binnen 6 maanden na ingang van het derde jaar herintreden bij het bevoegd gezag een aanvraag indient (de actie ligt dus expliciet bij de herintreder zelf!) om vast te stellen of er sprake is van een door loopbaanonderbreking ontstane salarisachterstand, zal de werkgever dit nagaan en zo nodig aan de leidinggevende om een beoordeling van de herintreder vragen.<br />Bij een salarisachterstand van 1 - 5 periodieken kan één extra periodiek worden toegekend en bij een salarisachterstand van 5 of meer periodieken kunnen twee extra periodieken worden toegekend.</p>
25	<h1>Personeelsbeleid</h1>\r\n<br />\r\n<p><strong>Inleiding</strong></p>\r\n<br />\r\n<p>De stichting P.C.P.O. 'De Vier Windstreken' wil voor haar 380 personeelsleden een goed werkgever zijn. Dit vraagt om een actief personeelsbeleid. Natuurlijk zijn allerlei aspecten van personeelsbeleid in een I.P.B. (Integraal Personeels Beleidsplan)vastgelegd. Op elke school ligt dit I.P.B. ter inzage.</p>\r\n<br />\r\n\r\n<p><strong>Startende leerkracht</strong></p>\r\n<br />\r\n<p>Als je&#160;op een nieuwe school&#160;begint, hebben we binnen onze stichting uiteraard op elke school een inwerkplan voor nieuwe leerkrachten. Ook wordt een zittende leerkracht aangewezen als begeleider. Voorts hebben we afgesproken dat een nieuwe leerkracht in het kader van taakbeleid het eerste schooljaar geen extra taken hoeft te doen naast de reguliere lesgevende taken. Uiteraard zal een ervaren leerkracht, die van een andere school komt, al na kortere tijd gevraagd kunnen worden taken in het kader van het taakbeleid op zich te nemen. Maar als je aan je onderwijsloopbaan begint, ligt dat toch wat anders. We realiseren ons dat er in het eerste jaar van je onderwijsloopbaan veel gevraagd wordt en dat er heel veel nieuwe zaken op je afkomen. Ondanks alle goede begeleiding binnen de eigen school vinden we het van belang dat je ook samen met andere 'starters in het onderwijs' binnen de stichting extra begeleiding dient te krijgen, o.a.in de vorm van intervisie momenten. Het is goed om ervaringen van anderen te horen over hun eerste periode in het onderwijs. We hebben daarvoor binnen de stichting voor deze groep startende leerkrachten een aantal begeleidings-, en intervisiemomenten in hun eerste schooljaar ingepland, die verplicht zijn. Als het goed is, is dat ook bij het sollicitatiegesprek aan de orde geweest. Deze meer specifieke begeleiding wordt op professionele wijze ingevuld op enkele woensdagmiddagen en/of avonden.</p>\r\n<br />\r\n<p><span><strong>BAPO</strong></span></p>\r\n<br />\r\n<p>\r\nZoals ongetwijfeld bekend is bij velen, bestaat op 52 jarige leeftijd recht op BAPO voor maximaal 104 lesgevende uren,&#160;en op 56 jarige leeftijd het recht op BAPO voor maximaal&#160;208 lesgevende uren.<br />Over het BAPO verlof wordt een eigen bijdrage betaald (vanaf schaal 9: 35%).<br />Daarnaast kennen we flexibele BAPO. Dit houdt in dat u BAPO verlof kunt sparen en later kan opnemen. Wanneer u de&#160;gespaarde uren opneemt, kan dat in principe alleen wanneer u per week 50% blijft werken.Alleen werknemers die vòòr 31-12-2005,&#160;zesenvijfig (56)&#160;jaar waren, geldt de overgangsregeling: zij kunnen 50% verlof opnemen per jaar en hebben nog recht op de bonusuren.<br />U moet het bestuur van de stichting melden dat u uw BAPO-uren wilt opsparen voor later en hoeveel uren u in het eerste jaar van opname wilt gebruiken (zie ook CNV brochure 'ADV, spaarverlof en BAPO in het primair onderwijs', pagina 10). Dat betekent dat u&#160;<strong>vooraf</strong>&#160;moet melden gebruik te willen maken van flexibele BAPO en dat dit niet met terugwerkende kracht kan. Deze verplichting geldt al lang, maar er werd vanwege de mogelijkheid om toch te kunnen declareren&#160;bij de overheid nog al eens soepel mee omgegaan. Bij de invoering van de lumpsum financiering is dat voorbij en kan&#160;<strong>alleen</strong>&#160;flexibele BAPO worden opgenomen wanneer dat&#160;<strong>vooraf</strong>&#160;is aangegeven, daar de gelden hiervoor niet meer gedeclareerd kunnen worden, maar uit de lumpsum betaald moeten worden. Voor eventuele flexibele BAPO met terugwerkende kracht zijn dan geen middelen gespaard. Binnen onze stichting hebben we ons altijd gehouden aan deze meldingsverplichting en zullen dat ook blijven doen.&#160;<strong>Herintreders</strong>Herintreders worden in principe ingeschaald op basis van het laatst genoten inkomen. Dit betekent dat iemand die een aantal jaren in het onderwijs heeft gewerkt, vervolgens een aantal jaren gestopt is met werken en dan weer begint geen periodieken wat betreft salariëring ontvangt over de niet gewerkte jaren.<br />In de CAO is nu het volgende vastgelegd:<br />Wanneer een herintreder op basis van een beoordeling en na twee jaar weer werkzaam geweest te zijn in het onderwijs binnen 6 maanden na ingang van het derde jaar herintreden bij het bevoegd gezag een aanvraag indient (de actie ligt dus expliciet bij de herintreder zelf!) om vast te stellen of er sprake is van een door loopbaanonderbreking ontstane salarisachterstand, zal de werkgever dit nagaan en zo nodig aan de leidinggevende om een beoordeling van de herintreder vragen.<br />Bij een salarisachterstand van 1 - 5 periodieken kan één extra periodiek worden toegekend en bij een salarisachterstand van 5 of meer periodieken kunnen twee extra periodieken worden toegekend.</p>
28	<h1><strong>C.N.S. De Regenboog</strong></h1><p><strong>C.N.S. De&#160;Regenboog</strong><br />Wij hebben onze school "De Regenboog" genoemd als een teken van hoop en als symbool van de veelkleurigheid van onze school. Wij willen een werk- en leefgemeenschap zijn waarin de Bijbel als Gods Woord norm en uitgangspunt is voor ons denken en handelen. Tevens heeft de school de taak om de wereld van onze kinderen groter te maken en hen voor te bereiden op een plaats in onze voortdurend veranderende samenleving</p><p><strong>Samen sterk</strong><br />Wij werken en leren op een respectvolle, integere en harmonieuze manier met elkaar samen. Wij bieden een veilige omgeving waarin kinderen zich optimaal kunnen ontwikkelen.</p><p><strong>Kwaliteit</strong><br />Wij vinden het belangrijk dat elk kind kwalitatief goed onderwijs krijgt dat:</p><ul><li>de mogelijkheid geeft om zijn eigen gaven en talenten te ontdekken, te ontwikkelen en te gebruiken</li><li>een uitdagende leeromgeving biedt waarin kinderen ontdekkend en samenwerkend kunnen leren</li><li>voldoet aan de eisen van de huidige maatschappij</li><li>gericht is op de toekomst</li><li>een goede voorbereiding geeft op het vervolgonderwijs</li></ul><p><strong>MISSIE</strong><br />Onze school is een moderne, open protestants christelijke basisschool. Wij leven en werken vanuit ons geloof in God en Zijn Zoon Jezus Christus. Iedereen die zich thuis voelt bij onze manier van leven en werken is welkom op onze school.<br />Vanuit ons geloof willen wij liefde en vertrouwen uitstralen door op een respectvolle, eerlijke en open manier met elkaar samen te werken en te leven. Op deze manier zijn wij er voor elkaar. Wij bieden een veilige omgeving waarin de kinderen zich optimaal kunnen ontwikkelen.<br />Wij gaan uit van het feit dat elk kind uniek is. Daarom bieden wij kwalitatief goed onderwijs dat:</p><ul><li>de mogelijkheid geeft om zijn eigen gaven en talenten te ontdekken, te ontwikkelen en te gebruiken</li><li>een uitdagende leeromgeving biedt waarin kinderen ontdekkend en samenwerkend kunnen leren</li><li>voldoet aan de eisen van de huidige maatschappij</li><li>gericht is op de toekomst</li><li>een goede voorbereiding geeft op het vervolgonderwijs</li></ul><p><strong>VISIE</strong><br /><br /><strong>Samen sterk voor kwaliteit</strong><br />Ons motto hebben wij uitgewerkt in onze levensbeschouwelijke identiteit, onze pedagogische uitgangspunten, de manier waarop ons onderwijs vorm krijgt en in de relatie met de ouders en de omgeving. Wij noemen dit de brede identiteit van onze school. Binnen deze identiteit staan de kinderen centraal.</p><p><strong>Levensbeschouwelijke identiteit</strong><br />Als school zien wij de Bijbel,het Woord van God, als basis voor ons handelen. Wij willen de kinderen vertrouwd maken met en begeleiden in het christelijk geloof en hen leren wat dit betekent voor ons dagelijks doen en laten. Als school willen wij dat ook duidelijk laten zien door de manier waarop wij met elkaar omgaan, waarbij wij nadrukkelijk rekening houden met de achtergronden van de kinderen. Wij vinden het belangrijk dat de kinderen oog hebben voor de wereld om ons heen. Daarom willen wij de kinderen kennis laten nemen van en respect bijbrengen voor verschillende geloofs- en levensovertuigingen. Onze school staat dan ook open voor ouders en kinderen die de grondslag en de levensbeschouwelijke aspecten van de school respecteren.</p><p><strong>Pedagogische uitgangspunten</strong><br />Op onze school staan kinderen centraal. Wij willen dat de kinderen elke dag met plezier naar school gaan. Een veilige omgeving vinden wij een voorwaarde van waaruit kinderen zich kunnen ontwikkelen, een ieder op zijn eigen niveau. Een kind moet veel succeservaringen op kunnen doen zodat het een positief zelfbeeld krijgt. Tevens vinden wij een goed besef van waarden en normen essentieel, zodat kinderen zich verder kunnen ontwikkelen in de omgang met elkaar. Door veel samen te werken kunnen kinderen zich ontwikkelen in allerlei sociale vaardigheden.</p><p><strong>Onderwijskundige visie</strong><br />Wij vinden het belangrijk om rekening te houden met de verschillen tussen en achtergronden van kinderen. Dit heeft gevolgen voor de inrichting van ons onderwijs. Wij staan voor adaptief onderwijs aan kinderen. Dat wil zeggen dat wij zoveel mogelijk rekening houden met de verschillen in ontwikkeling van kinderen. Wij vinden hierin voldoende mogelijkheden binnen ons leerstofjaarklassensysteem. Deze mogelijkheden ontstaan door onze manier van lesgeven. Ons klassenmanagement is gericht op het zelfstandig werken van kinderen. Wij zorgen voor een organisatie waarbij wij mogelijkheden krijgen om op deze verschillen in de klassensituatie in te spelen. Kinderen kunnen, indien nodig, extra instructie krijgen en nieuwe leerstofinhouden kunnen gezamenlijk worden ingeoefend. Een kind moet zelfstandig kennis en informatie kunnen opdoen. Deze ervaringen zijn een belangrijke bijdrage aan de persoonlijkheidsontwikkeling van kinderen. Daarnaast zorgen wij voor een zo effectief mogelijke instructie, waarbij kinderen tijdens de inoefening van hun nieuwe vaardigheden een goede begeleiding krijgen,(directe instructiemodel) De computer gaat integraal deel uitmaken van ons onderwijs.<br />Binnen onze kwaliteitszorg besteden wij speciale aandacht aan zorgleerlingen en begaafde leerlingen.<br />Tevens willen wij kinderen een uitdagende leeromgeving bieden waarin ze ontdekkend en samenwerkend kunnen leren.</p><p><strong>Omgang met de samenleving</strong><br />Een van onze belangrijke doelstellingen is het bevorderen van de identiteitsontwikkeling van kinderen door leren van en aan elkaar opdat kinderen later een goede plaats in onze voortdurend veranderende samenleving kunnen innemen. Als school hebben wij de taak de wereld van kinderen te vergroten. Dit betekent dat wij kinderen ook in aanraking brengen met andere culturele en levensbeschouwelijke achtergronden. Samen met de Ouderraad,de Medezeggenschapsraad en het lokaal bestuur willen wij de betrokkenheid van ouders stimuleren.<br />De samenwerking met de andere basisscholen, de peuterspeelzaal, de school voor Speciaal Basisonderwijs, het voortgezet onderwijs en de kerk willen wij intensiveren en de contacten met externe hulpverleners en zorginstanties verder uitbreiden. Op deze manier willen wij de school een eigen plek in de gemeenschap geven, zodat de school optimaal kan functioneren en maximale zorg aan onze kinderen kan bieden.</p>
