1135	<p><strong>Missie van de Morgenster</strong></p>\n<p>Christelijke basisschool De Morgenster: voor de sterren van nu en morgen!</p>
107	<p>De Vier Windstreken heeft met twee PABO's een overeenkomst gesloten wat betreft 'Opleiden in de school', namelijk de Chr. Hogeschool Ede (CHE) en de Marnixacademie in Utrecht.</p><p>Met 'Opleiden in de school' willen we meer en directer bijdragen aan de ontwikkeling van de studenten die binnen onze scholen stage lopen. Scholen die nu reeds werken aan'Opleiden in de school' hebben een op de academie opgeleide ICO (interne coach opleiden), die zorg draagt voor de begeleiding van de mentoren en de studenten en daarmee de taak van de docenten van de PABO overneemt.</p><p>Op deze wijze dragen we als scholen binnen de stichting bij aan de ontwikkeling en opleiding van studenten, die na afronding van hun studie onze toekomstige collega's kunnenworden.</p><p>Ieder jaar wordt het aantal scholen binnen de stichting dat meedraait in het zelf bijdragen aan de ontwikkeling en opleiding van de studenten uitgebreid.In het integraal personelsbeleid (IPB) is dit als stichtingsbeleid opgenomen.</p><p>In het schooljaar 2004-2005 hebben drie van onze scholen meegedraaid aan een pilot project 'Opleiden in de school'. In een 'Handboek opleiden in de school'zijn de ervaringen en resultaten van dit project neergelegd. Dit 'Handboek opleiden in de school' is te downloaden: klik hier. Het bijlagenboek bij dit handboek is teven te downloaden.<img src="/layout/cms/images/plugins/link.png" alt="Link - Bijlagenboek bij handboek" title="Link - Bijlagenboek bij handboek" id="plugin_obj_109" /></p>
