1140	<p><strong>Welkom</strong></p>\n<p>Iedereen die zich herkent in onze identiteit en manier van werken, is welkom op onze school.</p>\n<p>Wij verwachten dat ouders en kinderen die onze school bezoeken respect hebben voor onze overtuiging en manier van samenleven.</p>\n<p>Wij geven uiting aan onze identiteit door dagelijks bijbellessen te geven, te praten met elkaar over de bijbel en te zingen. Iedere dag beginnen we met gebed of een lied. We gebruiken de methode "Kind op maandag" welke uitgegeven wordt door de Nederlandse zondagsschool vereniging.</p>\n<p>Daarnaast zijn we er ons van bewust dat we niet alleen zorg dragen voor onszelf, maar ook voor anderen. </p>\n<p>Zo sparen we wekelijks geld voor een goed doel dat jaarlijks vastgesteld wordt.</p>\n<p>Dit jaren sparen we voor scholenbouw in Ghana.</p>\n<p>De christelijke feestdagen vieren we met elkaar in de klas of in de kerk. </p>
456	<h2>Uit de ouderenquête</h2><p>Op een schaal van 1 t/m 4 krijgen de leerkrachten van De Regenboog een 3,69 op de stelling: <br><em>“Het team van leerkrachten is enthousiast en komt positief over.”</em></p><p>Dat de onderlinge sfeer binnen het team bijzonder goed is, blijkt wel uit het ziekteverzuimcijfer. In 2010 was het landelijke verzuim 6%, op D4W-niveau 5,9% en op De Regenboog 1,3%. In 2011 is dit cijfer zelfs nog gedaald tot 0,7%.</p>
218	<h1>Welkom bij "De Vier Windstreken"</h1><h2>Werkgebied</h2><p>Het bestuur van de Stichting PCPO "De Vier Windstreken" is verantwoordelijk voor het onderwijs op 16 basisscholen en 1 school voor speciaal basisonderwijs in het Groene Hart van Holland. In de scholen zijn ca. 400 personeelsleden werkzaam, die met elkaar de zorg hebben voor 3800 leerlingen.\r\nDe scholen van de stichting staan in:\r\nBodegraven, Driebruggen, Haastrecht, Gouda, Moordrecht, Oudewater, Reeuwijk, Waarder en Zevenhuizen. Onder 'Scholen' kunt u doorlinken naar de sites (in voortdurende ontwikkeling) van de scholen.&#160;\r\n</p><h2>Algemeen Bestuur</h2><p>De stichting heeft een Algemeen Bestuur, die het bevoegd gezag is van alle scholen. De algemeen directeur heeft de dagelijks leiding binnen de stichting. De scholen werken gezamenlijk aan kwalitatief goed onderwijs. De zorg voor de individuele leerling staat centraal. Naast moderne methoden en materialen (o.a. computernetwerken en digitale borden op de scholen) wordt veel aandacht besteed aan een verdere professionalisering van de scholen.&#160;\r\n</p><h2>Ouderbetrokkenheid</h2><p>Ouderbetrokkenheid is van groot belang; elke school heeft dan ook een schoolraad met gekozen ouders. Speciale aandacht is er voor het management van de scholen. Directeur zijn, zien we als een aparte job. Directeuren zijn zo veel mogelijk vrijgesteld van lesgevende taken en sturen veelal twee scholen aan (meerschoolse directeuren). Een stafbureau zorgt voor ondersteuning van bestuur en schoolmanagement.</p>
211	<h1>De Stichting</h1><div><h2>Wat?</h2><p>Het bestuur van de Stichting PCPO "De Vier Windstreken" is verantwoordelijk voor het onderwijs op 16 basisscholen en 1 school voor speciaal basisonderwijs in het Groene Hart van Holland. In de scholen zijn ca. 400 personeelsleden werkzaam, die met elkaar de zorg hebben voor 3800 leerlingen&#160;</p><h2>Waar?&#160;</h2><p>De scholen van de stichting staan in:\r\n\r\nBodegraven, Driebruggen, Haastrecht, Gouda, Moordrecht, Oudewater, Reeuwijk, Waarder en Zevenhuizen. Op de pagina scholenkunt u doorlinken naar de sites (in voortdurende ontwikkeling) van de scholen.&#160;</p><h2>Hoe?</h2><p>De stichting heeft een Algemeen Bestuur, die het bevoegd gezag is van alle scholen. De algemeen directeur heeft de dagelijks leiding binnen de stichting. De scholen werken gezamenlijk aan kwalitatief goed onderwijs. De zorg voor de individuele leerling staat centraal. Naast moderne methoden en materialen (o.a. computernetwerken en digitale borden op de scholen) wordt veel aandachtbesteed aan een verdere professionalisering van de scholen. \r\nOuderbetrokkenheid is van groot belang; elke school heeft dan ook een schoolraad met gekozen ouders. Speciale aandacht is er voor het management van de scholen. Directeur zijn, zien we als een aparte job. Directeuren zijn zo veel mogelijk vrijgesteld van lesgevende taken en sturen veelal twee scholen aan (meerschoolse directeuren). Een stafbureau zorgt voor ondersteuning van bestuur en schoolmanagement.</p></div>
