268	<h1>Grondslag van de Prins Willem Alexanderschool</h1><p>Wij zijn een Protestants Christelijke school en willen dat ook uitdragen.\r\nOns uitgangspunt is om te werken en leren als mensen die de Bijbel aanvaarden als Gods Woord. In\r\nde vorming en begeleiding van het kind stellen we daarom centraal: God\r\nliefhebben boven alles en de naaste als jezelf.</p>\r\n\r\n<p>Wij geven dat in de school vorm door aan de kinderen de\r\nBijbelverhalen te vertellen, samen met hen te praten over de waarde van deze\r\nverhalen voor ons dagelijks leven, samen te bidden en psalmen en liederen te\r\nzingen.</p>\r\n\r\n<p>Daarnaast hebben wij zeven maal per jaar een schoolopening\r\nen vieren wij de christelijke feestdagen met elkaar of in de klas.</p>\r\n\r\n<p>Verder besteden wij veel aandacht aan de individuele zorg,\r\nhet omzien naar en het tonen van belangstelling voor elkaar, het dragen van\r\nverantwoordelijkheid, respect hebben voor anderen en het gebruik maken van\r\nieders kwaliteiten.</p>\r\n\r\n<p>Van ouders en leerlingen verwachten wij dat ze mee zullen\r\ndoen aan alle activiteiten van de school die voortvloeien uit onze identiteit.</p>\r\n\r\n
266	<h1>Over de Prins Willem Alexanderschool</h1><p>Onze school ligt in Waarder, een mooi dorp in Zuid-Holland\r\nen tegen de grens van de provincie Utrecht. Het gebied waaruit wij onze\r\nleerlingen betrekken bevat naast de wijk waarin de school ligt, ook andere\r\ngebieden, zoals Driebruggen, Nieuwerbrug en Oudewater. De school is makkelijk\r\nte bereiken vanaf de A12. In het schoolgebouw is een peuterspeelzaal en\r\nbuitenschoolse opvang aanwezig.</p><p>Eén van de bijzonderheden van onze school is wel dat de heer Verheul, destijds meester op onze school, de bedenker was van de verkoop van de Kinderpostzegels langs\r\nde boerderijen. Een feit dat we als school nog herdacht hebben in 2008 toen\r\nonze school de eerste kinderpostzegels mocht aanbieden aan Hare\r\nMajesteit Koningin Beatrix.</p>
279	\r\n\r\n<p>Onze school ligt in Waarder, een mooi dorp in Zuid-Holland\r\nen tegen de grens van de provincie Utrecht. Het gebied waaruit wij onze\r\nleerlingen betrekken bevat naast de wijk waarin de school ligt, ook andere\r\ngebieden, zoals Driebruggen, Nieuwerbrug en Oudewater. De school is makkelijk\r\nte bereiken vanaf de A12. In het schoolgebouw is een peuterspeelzaal en\r\nbuitenschoolse opvang aanwezig.</p>\r\n\r\n
155	<h1>Onze visie</h1><h2>De Prins Willem-Alexanderschool is </h2><ul><li>een school die als grondslag van haar identiteit het christelijk geloof en de Bijbel als Gods Woord heeft.Als school met de Bijbel is het duidelijk waar de grondslag voor onze visie ligt.</li><li>een school waar we vanuit onze identiteit respect tonen voor elkaar en elkaars geloofsovertuiging.</li><li>een school waar veiligheid en geborgenheid belangrijke waarden zijn.</li></ul><h2>De Prins Willem-Alexanderschool is </h2><ul><li>een school waar kinderen in een veilige, gezellige omgeving, samen spelen, samen werken en samen leren.</li><li>een school waar kinderen leren hun eigen keuzes te maken.</li><li>een school waar kinderen worden aangesproken op hun eigen niveau.</li><li>een school waar kinderen de eigen talenten kunnen ontwikkelen.</li><li>een school waar kinderen   informatie en kennis verzamelen.</li></ul><h2>De Prins Willem-Alexanderschool is </h2><ul><li>een school waar leraren werken die vertrouwen hebben in elkaar.</li><li>een school waar leraren samen werken aan doorgaande lijnen in het onderwijs.</li><li>een school waar leraren kindgericht en adaptief onderwijs geven.</li><li>een school waar leraren aandacht geven aan zorgleerlingen.</li><li>een school waar leraren een rijk schoolklimaat creëren.</li></ul><h2>De Prins Willem-Alexanderschool is </h2><ul><li>een school waar onderwijs gericht is op samenwerken, zelfstandigheid en eigen verantwoordelijkheid.</li><li>een school waar onderwijs gericht is op kennis, informatie en ontwikkeling.</li><li>een school waar onderwijs op maat wordt gegeven.</li><li>een school waar onderwijs wordt gegeven in een leerrijke omgeving.</li><li>een school waar onderwijs getoetst wordt op kwaliteit.</li></ul><h2>De Prins Willem-Alexanderschool is </h2><ul><li>een school waar ouders en leerkrachten samenwerken.</li><li>een school waar ouders serieus worden genomen.</li><li>een school waar ouders en leraren elkaar respecteren.&#160;</li><li>een school waar ouders goed worden geïnformeerd.</li></ul>
