89	<span><strong>Management structuur</strong></span>Binnen onze stichting hebben we er voor gekozen directeuren van scholen niet te belasten met lesgevende taken. Afhankelijk van de schoolgrootte houdt dit in dat er in een aantal gevallen - afhankelijk van de schoolgrootte - een directeur is die twee scholen aanstuurt. Uiteraard is deze organisatie van het management van de scholen afhankelijk van het aanstellen van een adjunct directeur op elke (ook kleine) school&#160;met voldoende ambulante tijd, omdat de directeur niet alle dagen op de school aanwezig kan zijn. Zeer grote scholen behouden een eigen directeur, echter in de functieomschrijving binnen de stichting wordt bij elke directeur gesproken van 'meerschools directeur' (het eerste jaar zonder ervaring als directeur als 'meerschools directeur in opleiding' en gedurende die periode aan één school)&#160;&#160;</span></span> 
27	<h1>De Stichting</h1>\r\n<br />\r\n<h4>Wat?</h4>\r\n\r\n\r\n<br />\r\n<p>Het bestuur van de Stichting PCPO "De\r\nVier Windstreken" is verantwoordelijk voor het onderwijs op 16\r\nbasisscholen en 1 school voor speciaal basisonderwijs in het Groene Hart van\r\nHolland. In de scholen zijn ca. 400 personeelsleden werkzaam, die met elkaar de\r\nzorg hebben voor 3800 leerlingen</p>\r\n\r\n<br />\r\n\r\n<h4>Waar?</h4>\r\n\r\n<br />\r\n\r\n<p>De scholen van de stichting staan in:</p>\r\n\r\n<p>Bodegraven, Driebruggen, Haastrecht, Gouda,\r\nMoordrecht, Oudewater, Reeuwijk, Waarder en Zevenhuizen. Op de pagina\r\nscholenkunt u doorlinken naar de sites (in voortdurende ontwikkeling) van de\r\nscholen.</p>\r\n\r\n<br />\r\n\r\n<h4>Hoe?</h4>\r\n\r\n<br />\r\n\r\n<p>De stichting heeft een Algemeen Bestuur,\r\ndie het bevoegd gezag is van alle scholen. De algemeen directeur heeft de\r\ndagelijks leiding binnen de stichting. De scholen werken gezamenlijk aan\r\nkwalitatief goed onderwijs. De zorg voor de individuele leerling staat\r\ncentraal. Naast moderne methoden en materialen (o.a. computernetwerken en\r\ndigitale borden op de scholen) wordt veel aandachtbesteed aan een verdere\r\nprofessionalisering van de scholen. \r\n<br />\r\nOuderbetrokkenheid is van groot belang;\r\nelke school heeft dan ook een schoolraad met gekozen ouders. Speciale aandacht\r\nis er voor het management van de scholen. Directeur zijn, zien we als een\r\naparte job. Directeuren zijn zo veel mogelijk vrijgesteld van lesgevende taken\r\nen sturen veelal twee scholen aan (meerschoolse directeuren). Een stafbureau\r\nzorgt voor ondersteuning van bestuur en schoolmanagement.</p>\r\n
