77	<h1>Welkom bij "De Vier Windstreken"</h1><p style="text-align: justify;"></p>\r\n<br />\r\n<p>Het bestuur van de Stichting PCPO "De Vier Windstreken" is verantwoordelijk voor het onderwijs op 16 basisscholen en 1 school voor speciaal basisonderwijs in het Groene Hart van Holland. In de scholen zijn ca. 400 personeelsleden werkzaam, die met elkaar de zorg hebben voor 3800 leerlingen.</p>\r\n<br />\r\n<p>De scholen van de stichting staan in:</p>\r\n<br />\r\n<p>Bodegraven, Driebruggen, Haastrecht, Gouda, Moordrecht, Oudewater, Reeuwijk, Waarder en Zevenhuizen. Hiernaast kunt u doorlinken naar de sites (in voortdurende ontwikkeling) van de scholen.</p>\r\n<br />\r\n<p>De stichting heeft een Algemeen Bestuur, die het bevoegd gezag is van alle scholen. De algemeen directeur heeft de dagelijks leiding binnen de stichting. De scholen werken gezamenlijk aan kwalitatief goed onderwijs. De zorg voor de individuele leerling staat centraal. Naast moderne methoden en materialen (o.a. computernetwerken en digitale borden op de scholen) wordt veel aandacht besteed aan een verdere professionalisering van de scholen.</p>\r\n<br />\r\n<p>Ouderbetrokkenheid is van groot belang; elke school heeft dan ook een schoolraad met gekozen ouders. Speciale aandacht is er voor het management van de scholen. Directeur zijn, zien we als een aparte job. Directeuren zijn zo veel mogelijk vrijgesteld van lesgevende taken en sturen veelal twee scholen aan (meerschoolse directeuren). Een stafbureau zorgt voor ondersteuning van bestuur en schoolmanagement.</p>
