83	<h1>De Stichting</h1><div><h2>Wat?</h2><p>Het bestuur van de Stichting PCPO "De Vier Windstreken" is verantwoordelijk voor het onderwijs op 16 basisscholen en 1 school voor speciaal basisonderwijs in het Groene Hart van Holland. In de scholen zijn ca. 400 personeelsleden werkzaam, die met elkaar de zorg hebben voor 3800 leerlingen&#160;</p><h2>Waar?&#160;</h2><p>De scholen van de stichting staan in:\r\n\r\nBodegraven, Driebruggen, Haastrecht, Gouda, Moordrecht, Oudewater, Reeuwijk, Waarder en Zevenhuizen. Op de pagina scholenkunt u doorlinken naar de sites (in voortdurende ontwikkeling) van de scholen.&#160;</p><h2>Hoe?</h2><p>De stichting heeft een Algemeen Bestuur, die het bevoegd gezag is van alle scholen. De algemeen directeur heeft de dagelijks leiding binnen de stichting. De scholen werken gezamenlijk aan kwalitatief goed onderwijs. De zorg voor de individuele leerling staat centraal. Naast moderne methoden en materialen (o.a. computernetwerken en digitale borden op de scholen) wordt veel aandachtbesteed aan een verdere professionalisering van de scholen. \r\nOuderbetrokkenheid is van groot belang; elke school heeft dan ook een schoolraad met gekozen ouders. Speciale aandacht is er voor het management van de scholen. Directeur zijn, zien we als een aparte job. Directeuren zijn zo veel mogelijk vrijgesteld van lesgevende taken en sturen veelal twee scholen aan (meerschoolse directeuren). Een stafbureau zorgt voor ondersteuning van bestuur en schoolmanagement.</p></div>
106	<h1>BAPO</h1><p>Zoals ongetwijfeld bekend is bij velen, bestaat op 52 jarige leeftijd recht op BAPO voor maximaal 104 lesgevende uren, en op 56 jarige leeftijd het recht op BAPO voor maximaal 208 lesgevende uren.<br />Over het BAPO verlof wordt een eigen bijdrage betaald (vanaf schaal 9: 35%).<br />Daarnaast kennen we flexibele BAPO. Dit houdt in dat u BAPO verlof kunt sparen en later kan opnemen. Wanneer u de gespaarde uren opneemt, kan dat in principe alleen wanneer u per week 50% blijft werken.<br />Alleen werknemers die vòòr 31-12-2005, zesenvijfig (56) jaar waren, geldt de overgangsregeling: zij kunnen 50% verlof opnemen per jaar en hebben nog recht op de bonusuren.<br />U moet het bestuur van de stichting melden dat u uw BAPO-uren wilt opsparen voor later en hoeveel uren u in het eerste jaar van opname wilt gebruiken (zie ook CNV brochure 'ADV, spaarverlof en BAPO in het primair onderwijs', pagina 10). Dat betekent dat u vooraf moet melden gebruik te willen maken van flexibele BAPO en dat dit niet met terugwerkende kracht kan. Deze verplichting geldt al lang, maar er werd vanwege de mogelijkheid om toch te kunnen declareren bij de overheid nog al eens soepel mee omgegaan. Bij de invoering van de lumpsum financiering is dat voorbij en kan alleen flexibele BAPO worden opgenomen wanneer dat vooraf is aangegeven, daar de gelden hiervoor niet meer gedeclareerd kunnen worden, maar uit de lumpsum betaald moeten worden. Voor eventuele flexibele BAPO met terugwerkende kracht zijn dan geen middelen gespaard. Binnen onze stichting hebben we ons altijd gehouden aan deze meldingsverplichting en zullen dat ook blijven doen. </p><h1>Herintreders</h1><p>Herintreders worden in principe ingeschaald op basis van het laatst genoten inkomen. Dit betekent dat iemand die een aantal jaren in het onderwijs heeft gewerkt, vervolgens een aantal jaren gestopt is met werken en dan weer begint geen periodieken wat betreft salariëring ontvangt over de niet gewerkte jaren.<br />In de CAO is nu het volgende vastgelegd:<br />Wanneer een herintreder op basis van een beoordeling en na twee jaar weer werkzaam geweest te zijn in het onderwijs binnen 6 maanden na ingang van het derde jaar herintreden bij het bevoegd gezag een aanvraag indient (de actie ligt dus expliciet bij de herintreder zelf!) om vast te stellen of er sprake is van een door loopbaanonderbreking ontstane salarisachterstand, zal de werkgever dit nagaan en zo nodig aan de leidinggevende om een beoordeling van de herintreder vragen.<br />Bij een salarisachterstand van 1 - 5 periodieken kan één extra periodiek worden toegekend en bij een salarisachterstand van 5 of meer periodieken kunnen twee extra periodieken worden toegekend.</p>
104	<h1>Informatie betreffende aspecten van onze stichting</h1><h2>(Gemeenschappelijke) medezeggenschapsraad</h2><p>Elke school binnen de stichting heeft een medezeggenschapsraad. Een aantal aspecten van medezeggenschap zijn gedelegeerd aan de G.M.R. Elke medezeggenschapsraad vaardigt volgens een afgesproken verdeling een teamlid of een ouder af naar de G.M.R. </p><h2>Management structuur</h2><p>Binnen onze stichting hebben we er voor gekozen directeuren van scholen niet te belasten met lesgevende taken. Afhankelijk van de schoolgrootte houdt dit in dat er in een aantal gevallen - afhankelijk van de schoolgrootte - een directeur is die twee scholen aanstuurt. Uiteraard is deze organisatie van het management van de scholen afhankelijk van het aanstellen van een adjunct directeur op elke (ook kleine) school met voldoende ambulante tijd, omdat de directeur niet alle dagen op de school aanwezig kan zijn. Zeer grote scholen behouden een eigen directeur, echter in de functieomschrijving binnen de stichting wordt bij elke directeur gesproken van 'meerschools directeur' (het eerste jaar zonder ervaring als directeur als 'meerschools directeur in opleiding' en gedurende die periode aan één school)  </p>
87	<h1><strong>De grondslag van 'De Vier Windstreken'</strong></h1><p><em>"De stichting heeft voor haar handelen en voor het in haar scholen te geven onderwijs de Bijbel als Gods Woord tot grondslag, waarbij de verlossing door Jezus Christus - naar reformatorisch belijden, zoals onder andere verwoord in de &#160;Apostolische geloofsbelijdenis - centraal staat".</em> \r\n            </p> \r\n            <h2><strong>Opmerking</strong></h2><p>Er is gekozen voor het begrip "reformatorisch" als verwijzing naar de reformatie: "reformatorisch" dient gelezen te worden als alleen "overeenkomstig de leer van de reformatie".<br /><br /> \r\n              De scholen staan open voor ouders en kinderen, die de grondslag van de stichting onderschrijven of vanuit een andere traditie en overtuiging onze grondslag en de levensbeschouwelijke elementen in onze scholen respecteren.<br /> \r\n              De scholen streven er naar de kinderen te leren zelfstandig te leven in de maatschappij, met verantwoordelijkheid en respect voorde gehele&#160;schepping en voor de&#160;christelijke waarden en normen die ontwikkeld zijn in onze cultuur. \r\n            </p>
