1468	<p><strong>Verlof in geval van ‘Andere gewichtige omstandigheden’</strong></p>\n<p>Hieronder vindt u het formulier "Verlof in geval van ‘Andere gewichtige omstandigheden’"</p>\n<p>Onder ‘andere gewichtige omstandigheden’ vallen situaties die buiten de wil van de ouders en/of leerling liggen. Voor bepaalde omstandigheden kan vrij worden gevraagd. Hierbij moet gedacht worden aan:<br/>- een verhuizing van het gezin;<br/>- het bijwonen van een huwelijk van bloed-of aanverwanten;<br/>- ernstige ziekte van bloed-en aanverwanten (het aantal verlofdagen wordt bepaald in overleg met de directeur en/of leerplichtambtenaar);<br/>- overlijden van bloed-en aanverwanten;<br/>- viering van een 25-,40- of 50-jarig ambtsjubileum van ouders of grootouders en het 121/2-, 25-,40-,50-of 60-jarig huwelijksjubileum van ouders of grootouders.</p>
