90	<h2><span><strong>Inleiding</strong></span></h2><p>De stichting P.C.P.O. 'De Vier Windstreken' wil voor haar 380 personeelsleden een goed werkgever zijn. Dit vraagt om een actief personeelsbeleid. Natuurlijk zijn allerlei aspecten van personeelsbeleid in een I.P.B. (Integraal Personeels Beleidsplan)vastgelegd. Op elke school ligt dit I.P.B. ter inzage.<br /> \r\n            </p> \r\n            <h2><strong>Startende leerkracht</strong></h2><p><span>Als je&#160;op een nieuwe school&#160;begint, hebben we binnen onze stichting uiteraard op elke school een inwerkplan voor nieuwe leerkrachten. Ook wordt een zittende leerkracht aangewezen als begeleider. Voorts hebben we afgesproken dat een nieuwe leerkracht in het kader van taakbeleid het eerste schooljaar geen extra taken hoeft te doen naast de reguliere lesgevende taken. Uiteraard zal een ervaren leerkracht, die van een andere school komt, al na kortere tijd gevraagd kunnen worden taken in het kader van het taakbeleid op zich te nemen. Maar als je aan je onderwijsloopbaan begint, ligt dat toch wat anders. We realiseren ons dat er in het eerste jaar van je onderwijsloopbaan veel gevraagd wordt en dat er heel veel nieuwe zaken op je afkomen. Ondanks alle goede begeleiding binnen de eigen school vinden we het van belang dat je ook samen met andere 'starters in het onderwijs' binnen de stichting extra begeleiding dient te krijgen, o.a.in de vorm van intervisie momenten. Het is goed om ervaringen van anderen te horen over hun eerste periode in het onderwijs. We hebben daarvoor binnen de stichting voor deze groep startende leerkrachten een aantal begeleidings-, en intervisiemomenten in hun eerste schooljaar ingepland, die verplicht zijn. Als het goed is, is dat ook bij het sollicitatiegesprek aan de orde geweest. Deze meer specifieke begeleiding wordt op professionele wijze ingevuld op enkele woensdagmiddagen en/of avonden.</span></p>
110	<h1>Missie</h1><p>De stichting 'De Vier Windstreken' wil een professionele organisatie zijn voor (speciaal) basisonderwijs, waarin kwaliteit, solidariteit, liefde, openheid, plezier en sociale bewogenheid in woord en daad herkenbaar zijn.</p><h2>Scholen met een missie en visie </h2><p>Samen werken aan kwalitatief goed onderwijs, 'up to date' en gericht op capaciteiten van kinderen. Samen leren en samen leven met respect voor elkaar en de schepping, in een sfeer van vertrouwen en openheid. Samen sterker worden en met plezier werken op een christelijke school.</p><h2>Scholen voor kinderen</h2><p>De scholen zijn kindvriendelijk: ieder kind moet zich veilig, geborgen en thuis kunnen voelen. Daarom neemt de individuele en sociale begeleiding van de kinderen een belangrijke plaats in en hebben de scholen een eigen karakter met een eigen schoolklimaat.</p><h2>Scholen met kwaliteit</h2><p>De scholen streven er naar onderwijs te bieden dat kwalitatief op een hoog peil staat en dat past bij de capaciteiten van de kinderen, zodat de kinderen zich optimaal kunnen ontwikkelen. Dit komt tot uitdrukking in goede resultaten en plezier in de eigen ontwikkeling, waarmee een basis wordt gelegd voor een succesvol functioneren in het vervolgonderwijs en de maatschappij.</p><h2>Scholen waar "samen" de basis is</h2><p>Scholen met intenties als hierboven beschreven, kunnen dit alleen bereiken als alle betrokkenen, leerlingen, ouders, leerkrachten, overige medewerkers, directies en bestuur zich met elkaar verbonden voelen. Een klimaat van betrokkenheid , openheid, optimisme en vertrouwen in elkaar is daarbij een voorwaarde De scholen van "De Vier Windstreken":  scholen met zorg voor personeelDe zorg voor het personeel is herkenbaar in het gevoerde personeelsbeleid. Dit beleid is vastgelegd in het integraal personeelsbeleidsplan van de stichting. Het is de man of vrouw op de 'werkvloer', die aan de kwaliteit van ons onderwijs in de dagelijkse praktijk inhoud geeft, hetgeen vraagt om zorg voor elkaar en goed personeels beleid.</p>
202	<h1>De Stichting</h1><div><h2>Wat?&#160;</h2><p>Het bestuur van de Stichting PCPO "De Vier Windstreken" is verantwoordelijk voor het onderwijs op 16 basisscholen en 1 school voor speciaal basisonderwijs in het Groene Hart van Holland. In de scholen zijn ca. 400 personeelsleden werkzaam, die met elkaar de zorg hebben voor 3800 leerlingen&#160;</p><h2>Waar?&#160;</h2><p>De scholen van de stichting staan in:\r\n\r\nBodegraven, Driebruggen, Haastrecht, Gouda, Moordrecht, Oudewater, Reeuwijk, Waarder en Zevenhuizen. Op de pagina scholenkunt u doorlinken naar de sites (in voortdurende ontwikkeling) van de scholen.&#160;</p><h2>Hoe?&#160;</h2><p>De stichting heeft een Algemeen Bestuur, die het bevoegd gezag is van alle scholen. De algemeen directeur heeft de dagelijks leiding binnen de stichting. De scholen werken gezamenlijk aan kwalitatief goed onderwijs. De zorg voor de individuele leerling staat centraal. Naast moderne methoden en materialen (o.a. computernetwerken en digitale borden op de scholen) wordt veel aandachtbesteed aan een verdere professionalisering van de scholen. \r\nOuderbetrokkenheid is van groot belang; elke school heeft dan ook een schoolraad met gekozen ouders. Speciale aandacht is er voor het management van de scholen. Directeur zijn, zien we als een aparte job. Directeuren zijn zo veel mogelijk vrijgesteld van lesgevende taken en sturen veelal twee scholen aan (meerschoolse directeuren). Een stafbureau zorgt voor ondersteuning van bestuur en schoolmanagement.</p></div>
230	<h1>Leerlingen</h1><p>De Prinses Beatrixschool is een school die voor alle leerlingen veilig is. Dit houdt in dat leerlingen mogen zijn zoals ze zijn, dat leerkrachten er zijn voor de kinderen en belangstelling tonen voor de leefwereld van het kind.</p><p>Een goed pedagogisch klimaat is belangrijk voor het welbevinden van het kind. Alleen een kind dat “lekker in zijn vel zit” komt tot goede prestaties.</p><p>Wij  stimuleren de leerlingen:</p><p>-         leergierig te zijn.</p><p>-         positief in het leven te staan</p><p>-         zelfstandig en geconcentreerd te werken.</p><p>-         zelf of samen met anderen oplossingen te zoeken.</p><p>-         hun gevoelens te uiten.</p><p>-         hun eigen leergedrag te kennen en eventueel te verbeteren.</p><p>-         goed met hun medeleerlingen om te gaan.</p><p>Wij begeleiden emoties: troosten bij verdriet, geven rust bij woede, delen in vreugde en blijdschap.</p><p>Wij zorgen dat de leeromgeving van de leerlingen opgeruimd en hygiënisch is.</p><p>In de pauze is er pleinwacht. Problemen worden opgelost en indien nodig doorgespeeld  naar de leerkracht van de betreffende leerling.</p><p>Onderwijs</p><p>De Prinses Beatrixschool is een school die wil bereiken dat ieder kind via een ononderbroken leer- en ontwikkelingsproces, die kennis en vaardigheden kan verwerven die het nodig heeft om een zelfstandig, sociaal en kritisch denkend mens te worden in een multiculturele samenleving.</p><p>Dit gaat het beste in een omgeving waar de leerlingen zich thuis voelen.</p><p>We zetten ons in voor het versterken en verbeteren van het klassen- en schoolklimaat.</p><p>De in gebruik zijnde en nog aan te schaffen onderwijsleerpakketten waarborgen het bovengenoemde leerproces en de wettelijke plicht om aan de kerndoelen te voldoen.</p><p>Wij zijn een school:</p><p>-         waar steeds meer projectmatig wordt gewerkt.</p><p>-         met een actueel onderwijsaanbod en waar gewerkt wordt aan adaptief onderwijs.</p><p>-         Waar leerlingen deelnemen aan de door school georganiseerde activiteiten.</p><p>We bieden gestructureerd onderwijs: we hebben duidelijke regels en afspraken, waarbij het leren omgaan met elkaar en het samenwerken belangrijk zijn. Leerkrachten in een duobaan hanteren dezelfde regels, er is overleg als duo’s wisselen. Er zijn regels, die in de hele school gelden.</p><p>We gebruiken een keuzebord, een programma op het bord , een agenda, dagritmekaarten en een werkwinkel, om te leren plannen. Naast de cognitieve overdracht vinden wij de sociaal-emotionele ontwikkeling erg belangrijk. Daarom besteden wij ruime aandacht aan de sociale vaardigheden, o.a. door gebruik van een methode.</p><p>Motto: De Prinses Beatrixschool : Een Bijzondere Basis!</p>
