336	<h2>Doel</h2><p>Stichting P.C.P.O. De Vier Windstreken stelt zich ten doel kwalitatief goed onderwijs te verzorgen, in de nabije woonomgeving van onze leerlingen. Zo is ons streven in elke wijk, of in elk dorp van ons voedingsgebied een protestant christelijke school in stand te houden. Onze scholen werken waar mogelijk samen met andere scholen en voorzieningen in de wijk, of het dorp, zodat onze leerlingen zich kunnen ontwikkelen tot evenwichtige en weldenkende leden van onze samenleving, gesteund en gevoed door een normbesef en waarden op basis van het protestant christelijke gedachtengoed. <br/><br/>Kernwaarden hierbij zijn:<br/>-\tAandacht voor het individuele kind<br/>-\tRespect voor elkaar en voor de omgeving<br/>-\tGoede leeropbrengsten, naar het optimale niveau van elk kind<br/>-\tModerne schoolgebouwen met een optimaal leef- en leerklimaat<br/>-\tAandacht voor ontwikkelingen in het onderwijs en de maatschappij<br/>-\tEen goede balans tussen cognitief presteren en sociaal-emotionele ontwikkeling</p>
