1660	<h1><strong>Tips voor ouders</strong></h1>\n<p><strong>Centrum voor Jeugd en Gezin Gouda</strong></p>\n<p>Het Centrum voor Jeugd en Gezin Gouda is dé vraagbaak voor ouders, opvoeders en kinderen en jongeren van 0 tot 23 jaar. Er is nu ook een digitaal CJG : www.cjggouda.nl </p>\n<p>Wat biedt www.cjggouda.nl? </p>\n<p>Deze site biedt een bron van informatie voor ouders en opvoeders. Ze kunnen er terecht voor informatie over de meest uiteenlopende onderwerpen. Daarnaast is er de laatste informatie te vinden over workshops en activiteiten die in het teken staan van opvoeden. </p>\n<p>Opvoeden begint hier. </p>\n<p>Ouders en kinderen maken veel met elkaar mee. In ieder gezin gebeuren immers dingen die je niet meteen kunt oplossen. Soms helpt het om die met een buitenstaander te bespreken. Of om informatie over het probleem op internet op te zoeken. Gewoon om met wat meer afstand en vanuit een andere invalshoek de zaken gemakkelijker op een rijtje te krijgen. </p>\n<p>Klik op onderstaande link voor meer informatie.</p>\n<p><img src="http://www.d4w.nl/static/cms/images/plugins/link.png" alt="Link - www.cjggouda.nl" id="plugin_obj_1667" title="Link - www.cjggouda.nl"/></p>
338	<h2>Visie</h2><p><br/>Onze missie is mede ingegeven door het besef dat het geven van protestant christelijk onderwijs alleen gedaan kan worden vanuit datgene wat geschreven staat in de Bijbel als Gods Woord. Dat is onze grondslag waarbij de verlossing door Jezus Christus – naar reformatorisch belijden*, zoals beschreven staat in de Apostolische geloofsbelijdenis -  centraal staat.<br/>Er is gekozen voor het begrip *Reformatorisch als verwijzing naar de reformatie: reformatorisch dient derhalve gelezen te worden als alleen “overeenkomstig de leer van de reformatie”.</p><p>Onze scholen staan open voor ouders en kinderen van alle gezindten en afkomst, mits zij de grondslag en de levensbeschouwelijke identiteit van onze scholen onderschrijven, of respecteren.<br/>Het onderwijs op onze scholen is gericht op het ontwikkelen van zelfstandigheid, verantwoordelijkheid en respect voor de gehele schepping en voor de christelijke waarden en normen die ontwikkeld zijn in onze cultuur.</p>
