1470	<p><strong>Op vakantie onder schooltijd :</strong></p>\n<p>Vakantie onder schooltijd mag niet, tenzij uw kind tijdens de schoolvakantie niet op vakantie kan gaan vanwege de specifieke aard van het beroep van (één van) de ouders. <br/>In dat geval mag de directeur eenmaal per schooljaar uw kind vrij geven, zodat er toch één gezinsvakantie kan plaatshebben.                 Let wel: roosterproblemen op het werk van (één van) de <br/>ouders is geen reden voor vakantie. </p>\n<p>Hieronder vindt u een formulier om vrij te vragen buiten de schoolvakantie.</p>
2073	<p>Stichting ‘De Vier Windstreken’<br/>Onze scholen zijn aangesloten bij Stichting P.C.P.O “De Vier Windstreken”. De afkorting<br/>P.C.P.O staat voor Protestants Christelijk Primair Onderwijs. Het bestuur van de<br/>stichting is verantwoordelijk voor het onderwijs op 16 basisscholen en 1 school voor<br/>speciaal onderwijs in een aantal plaatsen in het Groene Hart van Holland.<br/>Het Algemeen Bestuur van de stichting is het bevoegd gezag van de School.<br/>De Stichting heeft voor haar handelen en voor het in haar scholen te geven onderwijs de<br/>Bijbel als Gods Woord tot grondslag, waarbij de verlossing door Jezus Christus – naar<br/>het reformatorisch belijden, zoals onder andere verwoord in de Apostolische<br/>geloofsbelijdenis – centraal staat.”<br/>Er is gekozen voor het begrip “reformatorisch” als verwijzing naar de reformatie:<br/>“reformatorisch” dient gelezen te worden als alleen “overeenkomstig de leer van de<br/>reformatie”.<br/>Onze scholen staan open voor ouders en kinderen, die de grondslag onderschrijven of<br/>vanuit een andere traditie en overtuiging onze grondslag en de levensbeschouwelijke<br/>elementen in onze scholen respecteren.</p>
