344	De D4W-scholen verzorgen onderwijs vanuit een\nprotestants-christelijk levensbeschouwing. Ze voeren een daarop gericht\naannamebeleid voor leerkrachten. Dit betekent dat wij van onze leerkrachten\nverlangen dat zij bewust kiezen voor protestant christelijk onderwijs en dat\nzij dit willen uitdragen vanuit een eigen protestants-christelijke\nachtergrond.  Ook directieleden dienen\neen christelijke achtergrond te hebben. Van het niet onderwijsgevende personeel\nwordt verwacht dat ze het protestants-christelijke gedachtegoed kent en\nrespecteert. 
