343	<h2>Medezeggenschap</h2><p><br/>Elke D4W-school heeft een medezeggenschapsraad (MR) die bestaat uit ouders en leerkrachten. De functie van de MR is het meedenken en meebeslissen over onderwijsinhoudelijke onderwerpen, het financieel beleid en organisatorische zaken.<br/><br/>Voor onderwerpen die verder gaan dan alleen de school is er een Gemeenschappelijke Medezeggenschapsraad (GMR). In deze raad zitten vertegenwoordigers uit de MR’s van de scholen. De GMR bestaat uit 17 leden en vergadert over onderwerpen op bestuursniveau.</p><p>Het dagelijks bestuur van de GMR bestaat uit:</p><ul><li><em>Jerry van der Leur,</em> \n<em>Marja Overkamp</em> \tvoorzitter</li></ul><ul><li><em>Vacature,</em> \tsecretaris</li></ul>
1156	<p>Voor een goede gang van zaken is het noodzakelijk dat er een goed contact is tussen u als ouders en de leerkrachten van school. Van onze kant proberen we daar zoveel mogelijk aan te doen. U kunt echter ook zelf het initiatief nemen. Voor, maar liever na schooltijd, is er meestal wel even tijd. Bij dringende zaken kunt u altijd een afspraak maken. </p>\n<p>We onderscheiden: </p>\n<p>1.De kennismakings- en informatieavond. U maakt kennis met de groepsleerkracht van uw kind en u hoort welke leerstof uw kind het komende jaar aangeboden krijgt. Ook kunt u leermiddelen en methodes bekijken. En natuurlijk eventuele vragen stellen. </p>\n<p>2.De contactavonden. Omdat groep acht een vervolgschool gaat kiezen na de basisschool is er in november een info-avond. Ook volgen er in februari/maart schoolkeuzegesprekken met u waarbij ook de resultaten bij de CITO-eindtoets aan bod komen. </p>\n<p>3.Thema-ouderavond van OR, MR en schoolraad.</p>\n<p>4.Het huisbezoek. Indien gewenst maakt de leerkracht in de loop van het jaar een afspraak met u voor een huisbezoek. U kunt er ook naar vragen! </p>\n<p>5.Brieven aan de ouders, schoolkranten en het maandbrief. Dit laatste is een informatieblad, dat aan het begin van de maand aan de oudste leerling van ieder gezin wordt meegegeven. Er staan activiteiten, data en mededelingen in vermeld. </p>\n<p>6.Inloopochtendenvoor de groepen 3 t/m 8. Zo eens in de maand is er een inloopochtend. We kondigen ze aan op het maandrooster. U mag dan samen met uw kind(eren) van 8.25 - 8.45 uur, in de klas komen kijken naar en praten over hun werk. </p>\n<p><strong>Rapporten en onderwijskundige rapporten</strong></p>\n<p>Groep 3 t/m 8 krijgt drie maal per jaar een rapport met vorderingen mee naar huis.<br/>De kleuters in groep 2 ontvangen echter één rapport minder per jaar. </p>\n<p><em>Data mee naar huis en contactavond 2011/2012</em></p>\n<p>Kerstrapport (groep 3 t/m 8) 19 november mee naar huis, gesprekken 22 en 23 november</p>\n<p>Paasrapport (groep 2 t/m 8)  18 maart mee naar huis, gesprekken op 21 en 22 maart</p>\n<p>Zomerrapport (groep 2 t/m 8) 29 juni mee naar huis.</p>\n<p>Als uw kind naar een andere basisschool overstapt verstrekken wij altijd een onderwijskundig rapport. Modellen daarvan zijn bij ons op school ter inzage.</p>
1200	<p>De Immanuelschool is een protestants christelijke school. Belangrijke waarden worden aan de bijbel ontleend. Het is voor ons vanzelfsprekend dat wij de identiteit van de school in de praktijk tot uiting brengen. Wij komen aan het unieke van kinderen tegemoet. Respect, openheid en vertrouwen zijn belangrijke elementen van het pedagogisch klimaat op onze school. Wij vinden het belangrijk om een omgeving te scheppen waarin kinderen zich goed kunnen ontwikkelen. Hierbij vinden wij veiligheid, structuur en regelmaat voor ons belangrijk.<br/>Op de Immanuelschool vinden wij zowel de cognitieve ontwikkeling (het aanbieden van kennis, het leren) als de sociaal-emotionele ontwikkeling van de kinderen belangrijk. Wij leren kinderen verantwoordelijkheid te dragen en bevorderen de zelfstandigheid. Wij stimuleren hierbij de eigen inbreng van kinderen. Kinderen verschillen van elkaar en deze verschillen zijn uitgangspunt voor het pedagogisch en didactisch handelen. Naast het aanbieden van basiskennis voor alle kinderen, willen wij in onze manier van werken tegemoet komen aan en zorg hebben voor de individuele talenten van kinderen. </p>
1471	<p><strong>Leerplicht en verlof</strong></p>\n<p>In de Leerplichtwet staat dat uw kind de school moet bezoeken als er<br/>onderwijs wordt gegeven. Leerlingen mogen dus nooit zomaar van school wegblijven. In een aantal gevallen is echter een uitzondering op deze regel mogelijk. Als er een bijzondere reden is waarom u vindt dat uw kind niet naar school kan, moet u zich aan de regels voor zo’n uitzondering houden. De uitzonderingen en de daarbij behorende regels staan in onderstaande folder beschreven.</p>
