1572	<p><br/>Buitenschoolse opvang (BSO)<br/>In ons schoolgebouw is de BSO Speelkwartier van de Stichting Quadrant Kinderopvang gevestigd. http://www.quadrantkindercentra.nl. BSO Speelkwartier is open op maandag, dinsdag en donderdag van 15.00 tot 18.30 uur.<br/>Op andere dagen kan de Quadrant opvang verzorgen op een van hun andere locaties. Voor informatie kunt u bellen naar tel. 689896</p>
