488	<p><em>"Juffen- en meestersdag"</em></p><p>Als u eerst meer informatie over onze school wilt ontvangen, dan kunt u contact met ons opnemen (tel. 0182-394149 of per mail regenboog@d4w.nl). We sturen u een informatiepakket toe en we maken een afspraak met u voor een gesprek. U kunt dan tegelijkertijd de school bekijken en sfeer proeven.<br/><br/>Het is ook mogelijk om het aanmeldingsformulier te downloaden, zie de link hieronder.</p>
339	<h2>Missie</h2><p>Wij willen een professionele organisatie zijn voor (speciaal)basisonderwijs, waarin kwaliteit, solidariteit, liefde, openheid, plezier en sociale bewogenheid in woord en daad herkenbaar zijn.</p><p>Scholen met een missie en een visie:<br/>Samenwerken aan kwalitatief goed onderwijs, “up-to-date” en gericht op de capaciteiten van kinderen. Samen leren en samen leven met respect voor elkaar en de schepping, in een sfeer van vertrouwen en openheid. Samen sterker worden en met plezier werken op een christelijke school.</p><p>Scholen voor kinderen:<br/>Onze scholen zijn kindvriendelijk: ieder kind mag zich veilig, geboren en thuis voelen. Daarom neemt de individuele en sociale begeleiding van de kinderen een belangrijke plaats in en hebben de scholen allen een eigen karakter en een eigen schoolklimaat.</p><p>Scholen met kwaliteit:<br/>Onze scholen streven er naar onderwijs te bieden, dat op een kwalitatief hoog niveau staat en dat rekening houdt met de capaciteiten van de kinderen, zodat zij zich optimaal kunnen ontwikkelen. Dit vertaalt zich in goede resultaten en in plezier in de eigen ontwikkeling, waarmee een basis wordt gelegd voor een succesvol functioneren in het vervolgonderwijs en in de maatschappij.</p><p>Scholen waar SAMEN de basis is:<br/>Scholen met de bovenstaande intenties kunnen die alleen bereiken als alle betrokkenen zich met elkaar verbonden weten. Een klimaat van openheid, betrokkenheid, optimisme en vertrouwen in elkaar is daarbij een absolute voorwaarde. Daarom kenmerken D4W-scholen zich niet alleen door zorg voor de kinderen, maar ook door zorg voor het personeel en oog en oor voor de ouders van onze kinderen.</p><p>De zorg voor het personeel is beschreven in het personeelsbeleidsplan en kenmerkt zich door de mogelijkheid van leren van elkaar en ontwikkeling in het vak. Dit alles vanuit de overtuiging dat goede scholen zich ontwikkelen onder excellent leiderschap aan uitstekende leerkrachten. </p>
