1473	<p><strong>Samenvatting ouderenquête 2011 (Rapport uit WMK)</strong></p>\n<p>In onderstaand document leest u de belangrijkste uitkomsten van de ouderenquête zoals u die hebt ingevuld in februari 2011. Hartelijk dank aan alle respondenten. </p>\n<p>We beschouwen de uitkomst van die ‘dikke 7 ½ ‘ als een compliment en we gaan er aan werken om er ‘een grote 8’ van te maken.</p>\n<p>Wilt u de gehele ouderenquete lezen klikt u dan op onderstaand formulier.</p>
2061	<h1>Missie<br/>Onze missie is:<br/>‘Wij willen vanuit de inspiratie die we putten uit Gods Woord, de Bijbel, in een<br/>respectvolle en veilige sfeer de kinderen leren samen te werken, op een zelfstandige manier kennis op te doen en vaardigheden te ontwikkelen die nodig zijn om op te groeien tot een zelfverantwoordelijke volwassene’<br/></h1><p>Visie<br/>Op een gezamenlijke studiedag in 2009 hebben wij als 2 scholen nagedacht over<br/>kernwaarden voor onze fusieschool. Deze kernwaarden worden vertaald naar de<br/>dagelijkse praktijk in de school en hoe wij met kinderen omgaan in de school.<br/>De kernwaarden zijn:<br/>Wij geven goed onderwijs op basis van de PC-identiteit met ruimte voor<br/>levensbeschouwelijke diversiteit. Wij vertrouwen en respecteren elkaar.<br/>Wij sluiten aan bij de vragen en de ontwikkeling van het kind, waarbij de<br/>onderwijskundige ontwikkeling centraal staat. We zetten het kind centraal en proberen eruit te halen wat erin zit.</p>
