450	<h2><strong>Visie De Regenboog</strong></h2><p>Wij hebben onze school "De Regenboog" genoemd als een teken van hoop en als symbool van de veelkleurigheid van onze school. Wij willen een werk- en leefgemeenschap zijn waarin de Bijbel als Gods Woord norm en uitgangspunt is voor ons denken en handelen. Tevens heeft de school de taak om de wereld van onze kinderen groter te maken en hen voor te bereiden op een plaats in onze voortdurend veranderende samenleving.</p><h2>Samen sterk</h2><p>Wij werken en leren op een respectvolle, integere en harmonieuze manier met elkaar samen. Wij bieden een veilige omgeving waarin kinderen zich optimaal kunnen ontwikkelen.</p><h2>Kwaliteit</h2><p>Wij vinden het belangrijk dat elk kind kwalitatief goed onderwijs krijgt dat:</p><p></p><ul><li>De mogelijkheid geeft om zijn eigen gaven en talenten te ontdekken, te ontwikkelen en te gebruiken.</li><li>Een uitdagende leeromgeving biedt waarin kinderen ontdekkend en samenwerkend kunnen leren.</li><li>Voldoet aan de eisen van de huidige maatschappij.</li><li>Gericht is op de toekomst.</li><li>Een goede voorbereiding geeft op het vervolgonderwijs.</li></ul><p></p><h2><span style="background-color: rgb(255, 255, 255);">Samen sterk voor kwaliteit</span></h2><p>Ons motto hebben wij uitgewerkt in onze levensbeschouwelijke identiteit, onze pedagogische uitgangspunten, de manier waarop ons onderwijs vorm krijgt en in de relatie met de ouders en de omgeving. Wij noemen dit de brede identiteit van onze school. Binnen deze identiteit staan de kinderen centraal.</p>
1512	<p>Ieder kind is uniek en daarom staan we open voor de verschillen tussen onze leerlingen. Het scheppen van een fijne, veilige leeromgeving is daarom een belangrijke voorwaarde voor kwalitatief goed onderwijs. Elk kind moet zichzelf kunnen zijn en zich kunnen ontplooien. Wij hanteren duidelijke regels en afspraken, waar we ons aan proberen te houden. </p>\n<p>We vinden het belangrijk om een school te zijn waar kinderen kunnen samenwerken en opgroeien in een sfeer, waar eerlijkheid, respect en omzien naar elkaar centraal staan. Een veilige plek waar ieder kind met plezier naar toe gaat en zich thuis voelt. </p>
469	<p><em>"Maatjeslezen"</em></p><p>In ons schoolplan wordt over de periode van 4 jaar aangegeven wat de plannen zijn op het gebied van de beleidsterreinen: onderwijs, personeel, financiën, kwaliteit en identiteit. Doel van het schoolplan is de gewenste ontwikkeling van de school vast te leggen en uit te werken in concrete actiepunten.</p>
