1475	<p><strong>Leerling-enquete 2010</strong></p>\n<p>Hieronder vindt u de uitslag van de leerling-enquete van 2010 eerst een aantal sterke en minder sterkte punten. Wilt u de hele enquete lezen klik dan op onderstaande link.</p>\n<p><strong>Hoge scores</strong></p>\n<p>- Op mijn school gelden duidelijke regels (3.69)<br/>- Ik vind mijn school een goede school (3.65)<br/>- De juf of meester vind ik aardig (3.63)</p>\n<p><strong>Lage scores</strong></p>\n<p>- We besteden voldoende tijd aan het leren werken met de pc (2.46)<br/>- We hebben een leuke methode voor Aardrijkskunde (2.58)</p>
2195	<p>Identiteit</p>\n<p>Wij zijn een Protestant Christelijke school en willen dat ook uitdragen. Ons uitgangspunt is om te werken en leren als mensen die de Bijbel aanvaarden als Gods Woord. In de vorming en begeleiding van het kind stellen we daarom centraal: God liefhebben boven alles en de naaste als jezelf.</p>\n<p>Wij geven dat in de school vorm door aan de kinderen de bijbelverhalen te vertellen, samen met hen te praten over de waarde van deze verhalen voor ons dagelijks leven, samen te bidden en bijbelliederen te zingen.</p>\n<p>Daarnaast hebben wij zes maal per jaar weekopeningen en vieren wij de christelijke feestdagen in de kerk of op school.</p>\n<p>Verder besteden wij rondom de kinderen veel aandacht aan de individuele zorg, het omzien naar en het tonen van belangstelling voor elkaar, het dragen van verantwoordelijkheid, respect hebben voor anderen en het gebruik maken van ieders kwaliteiten.</p>\n\n<p>Het Team</p>\n<p>We zijn een enthousiast team, dat bewust heeft gekozen om te werken op een Protestant Christelijke School, dat met zorg en liefde kinderen wil begeleiden op weg naar volwassenheid.</p>\n<p>Als team blijven we werken aan een sfeer van veiligheid, openheid, professionaliteit en collegialiteit.</p>\n
1435	<p>De schoolbel gaat 5 minuten voor aanvang van de lessen, zodat we op tijd kunnen beginnen. We vragen u de kinderen maximaal een kwartier voor aanvang van de lessen op school te laten komen. Vanaf die tijd is er pleinwacht.</p>
