1540	<h1>Ouders in de school </h1>\n<p>De school presenteert zich als een 'tweede huis' voor kinderen. Een actieve vorm van ouderparticipatie is belangrijk om goede resultaten te bereiken voor de leerlingen. Een vanzelfsprekend gevolg hiervan is, dat zowel de school als de ouders zich samen verantwoordelijk voelen voor het wel en wee van de kinderen. De school stelt de belangstelling van de ouders voor het onderwijs in de basisschool zeer op prijs. Of beter gezegd: zij kan niet zonder hun betrokkenheid. </p>\n<p>Ouders kunnen actief bij de school betrokken zijn in verschillende rollen. Zo kunnen ouders meedoen in de Oudercommissie, de Medezeggenschapsraad of de Schoolraad. Verder wordt er gedurende het schooljaar voor diverse activiteiten binnen en buiten de school een beroep gedaan op behulpzame ouders. </p>\n<p>Voor meer informatie over MR, OC en SR kunt u hierboven op de betreffende link klikken. </p>
