540	<p>Onze school behoort tot het ‘bijzonder onderwijs’. Het is een open, protestants- christelijke school. De naam ‘Immanuël’ (wat betekent: ‘God met ons’) getuigt daar van. Het primaire doel van een basisschool is de kinderen, door hen voldoende kennis en vaardigheden bij te brengen, goed voor te bereiden op het vervolgonderwijs. Als christelijke school hebben wij echter nog een doelstelling; deze is erop gericht, dat de kinderen God en de bijbel leren kennen. Uitgangspunt in ons onderwijs is dat elk kind een uniek schepsel van God is. Onze school vormt een hecht georganiseerd verband; we werken in een sfeer waarin we elkaar (teamleden, leerlingen en ouders) respecteren.</p><p>De Oudewaterse gemeenschap is een veelkleurige gemeenschap, ook kerkelijk gezien. De Immanuëlschool is de enige protestants-christelijke school binnen deze gemeenschap. Binnen de school zijn verschillende kerk- en geloofsgemeenschappen vertegenwoordigd. Niet de dingen die ons scheiden krijgen de nadruk, maar de aspecten die ons binden. Dat is het geloof in Jezus Christus.</p>
1575	<p>Ouderbetrokkenheid<br/>Ouders en school zijn samen betrokken bij de opvoeding van de kinderen. Daarom vinden wij betrokkenheid van ouders belangrijk voor onze school.<br/>In het oudercouponnenboekje (dat aan het begin van ieder schooljaar wordt uitgereikt) kunt u invullen of en hoe u zich voor onze school wilt inzetten. Ouders worden uitgenodigd om deel te nemen aan diverse activiteiten, zoals bijvoorbeeld schoonmaakavonden, begeleiding van externe (sport)activiteiten en deelname aan de MR/OR.</p>\n<p>Eenmaal per jaar wordt er een algemene ouderavond georganiseerd waar huishoudelijke en thematische onderwerpen worden besproken. Daarnaast worden meerdere keren per jaar koffie-/theeochtenden georganiseerd waarbij u 45 minuten in de klas mag kijken tijdens de les van uw kind en aansluitend een korte presentatie wordt gegeven over schoolse activiteiten.</p>
