1514	<h2>Software</h2><p>Op Kon.\nWilhelminaschool zijn  de groepen 2 t/m 8\nvoorzien van nieuwe en stille computers. Hierop oefent uw kind regelmatig met\nde software die bij de leerstof past. </p>\n\n<p>Rekenen\nen taal wordt veel geoefend met de software van AmbraSoft. U kunt nu ook thuis\nextra met deze software oefenen met het Familiepakket van dit jaar. Kijk op <a href="http://www.ambrasoft.nl/">www.ambrasoft.nl</a>. Van harte aanbevolen</p>\n\n<p>Bij\nmeester Sjaak zijn de <strong>woordpakketten</strong>\ndie we op school gebruiken te krijgen, als u een usb stick inlevert.</p>\n\n<p>Wist u, dat u als ouder van een basisschoolkind\ngoedkoop Windows en Office software kan bestellen door uw kind aan te melden\nbij <a href="https://www.apsitdiensten.nl/web/extranet/clientda.nsf/aanvraag2?open&amp;leerling=1">surfspot.nl</a>? Wij krijgen dan een vraag of deze leerling bij ons op school zit, wij bevestigen dat en u kunt software bestellen. </p>\n\n
2007	<h2>Kwaliteit en zorg </h2>\n<p>Ons streven is de kinderen zo goed mogelijk toe te rusten, zowel voor de opleiding die volgt na de basisschool als voor hun plek in het leven. We werken dus niet alleen aan de schoolse vaardigheden die nodig zijn voor succes in het voortgezet onderwijs, maar zeer zeker ook aan de vorming als mens in het algemeen. Mede daarom zijn de kwaliteit en inhoud van ons onderwijs regelmatig terugkerende gespreksonderwerpen in de personeelsvergaderingen. Daarbij worden we, zo nodig, terzijde gestaan door deskundigen van bijvoorbeeld de schoolbegeleidingsdienst. De gewenste ontwikkelingen in ons onderwijs worden vastgelegd in een meerjarenplan. Vanaf het moment dat uw kind op school komt, houden wij een dossier over uw kind bij. Hierin staan de gegevens van het kind, notities van de leerkracht, toetsen, rapportagegegevens en verdere relevante informatie. Na iedere toetsperiode bespreken de leerkrachten met de interne begeleider de resultaten van de kinderen, zodat afspraken over eventuele extra zorg gemaakt kunnen worden. </p>\n<h2>Beleid leerlingenzorg</h2>\n<p>In het zorgplan van onze school staat beschreven hoe het team omgaat met de zorg voor de leerlingen die tijdelijk of langdurig op één of meer gebieden uitvallen. Een zorgleerling is voor ons een leerling die:<br>- opvalt als resultaat van de methode gebonden toetsen;<br>- opvalt door gedrag;<br>- op één of meer gebieden extra begeleiding nodig heeft;<br>- opvalt als resultaat van de toetsen van het Cito leerlingvolgsysteem (de D en E scores);<br>- opvalt door zeer hoge prestaties;<br>een combinatie van boven genoemde punten vertoont.</p>\n<p>De hulp aan de zorgleerlingen wordt in principe in de groep gegeven. Wij streven er als school naar om de hulp zoveel mogelijk binnen de groep te realiseren, omdat hulp buiten de groep de leerlingen in een uitzonderingspositie kan plaatsen. <br>Om de uitval van leerlingen te beperken bieden wij als team van de Da Costaschool onze leerlingen zoveel mogelijk instructie op maat aan. Dit betekent dat wij streven naar het geven van effectieve instructie. Voor de snelle leerling zal de instructie beknopt zijn, voor leerlingen die meer uitleg nodig hebben betekent dit langere instructie of meer momenten van uitleg.<br>Een goede organisatie van het klassenmanagement is een vereiste om de goede kwaliteit van de instructie te garanderen. De afgelopen jaren zijn we vooral bezig geweest met het realiseren van een doorgaande lijn voor zelfstandig werken. </p>\n<h2>Rapport</h2>\n<p>Via het rapport en in groep 1 en 2 bij gesprekken op de ouderavond houden wij u op de hoogte van de ontwikkeling van uw kind. Vanaf groep 3 krijgt uw kind drie keer per jaar een rapport mee naar huis. Na elk rapport is er een rapportenavond waar u met de leerkracht van gedachten kunt wisselen over het functioneren van uw kind. Bij de eerste twee rapporten worden alle ouders uitgenodigd en ingedeeld in een rooster. Wij verwachten dus dat een ieder komt! Kunt u onverhoopt niet op dat tijdstip, dan vragen wij u onderling te ruilen. Bij het derde rapport kunt u, indien nodig, een afspraak maken met de leerkracht om het rapport te bespreken. Bij groep 8 hanteren we een iets andere werkwijze. Zie hiervoor bij 'Voortgezet Onderwijs'.</p>\n<h2>Interne begeleiders (ib-ers)</h2>\n<p>De interne begeleiders zijn verantwoordelijk voor de coördinatie van de leerlingenzorg op school. Zij begeleiden de leerkrachten in het geven van extra zorg aan kinderen. Ook stellen zij het toets programma op en bereiden zij de leerling/toetsbesprekingen voor. Regelmatig is één van beiden aanwezig bij gesprekken met ouders. De interne begeleiders hebben regelmatig contact met externe hulpverleners, zoals de schoolbegeleidingsdienst, de pab-er (preventief ambulante begeleider), scholen voor speciaal basisonderwijs, de logopediste, de schoolarts, etc.</p>\n<h2>Het Leerlingvolgsysteem</h2>\n<p>Het is heel belangrijk om de ontwikkeling van de kinderen goed te volgen. <br>In de kleuterperiode worden de kinderen regelmatig geobserveerd en worden hun vorderingen genoteerd in het leerlingvolgsysteem ´OntwikkelingsVolgModel voor Jonge Kinderen`. Dit volgsysteem is ontwikkeld door het Seminarium voor Orthopedagogiek in Utrecht. Naar aanleiding van deze observaties wordt bepaald welke volgende stap in zijn/haar ontwikkeling kan worden genomen. Ook worden hiervoor in groep 1 en 2 CITO-toetsen afgenomen: taal en rekenen. Verder nemen wij in groep 2 de toets ´screening risicofactoren voor leren lezen/spellen´af bij kinderen waarbij een taal-leesachterstand vermoed wordt.<br>Vanaf groep 3 worden er methode-gebonden toetsen gebruikt. Dit zijn toetsen die horen bij de taal-, reken- of leesmethoden. Ook worden er meerdere keren per jaar methode-onafhankelijke cito-toetsen afgenomen. <br><br>Voorbeelden hiervan zijn:<br>- Het leerlingvolgsysteem voor de kleuters: het Ontwikkelings-Volg-Model voor Jonge Kinderen.<br>- Ook wordt de CITO-toets voor taal en ordenen jaarlijks afgenomen in groep 1 en 2.<br>- De AVI-toetsen en DMT-toetsen van het CITO waarmee we de vorderingen in het technisch lezen in de groepen 3 t/m 8 meten.<br>- De CITO-toets voor begrijpend lezen om deze vaardigheid te meten in groep 3 t/m 8.<br>- De CITO-spellingtoetsen in groep 3 t/m 8 om de spellingsvaardigheid van de kinderen te meten.<br>- De CITO-rekentoetsen in groep 3 t/m 8 om de rekenvaardigheden in de gaten te houden.<br>- De Entreetoets CITO in groep 7.<br>- De Eindtoets CITO in groep 8 speelt een rol bij de keuze van het type vervolgonderwijs.<br><br>Alle resultaten van deze toetsen worden geregistreerd en besproken. Al deze gegevens worden minimaal 5 jaar bewaard vanaf het moment dat het kind naar het voortgezet onderwijs gaat.</p>\n<h2>Dossiers</h2>\n<p>Van alle kinderen wordt op school een, deels digitaal, dossier bijgehouden. Hierin bewaren we tot vijf jaar na het verlaten van de school de volgende gegevens:<br>- inschrijfformulier, intakeformulier en entreeformulier<br>- verslagen van gesprekken met ouders<br>- toetsgegevens en toetsuitslagen<br>- observatieverslagen<br>- verslagen van leerlingbesprekingen<br>- handelingsplannen<br>- indien aanwezig: onderzoeksverslagen en gegevens van externen <br>De gegevens worden door leerkrachten zorgvuldig overgedragen bij de overgang naar de volgende groep. Ouders kunnen indien nodig het dossier van hun kind inzien. Hierbij handelen wij volgens de regels van Wet Bescherming Persoonsgegevens (WBP) Dat wil zeggen dat de ouders een verzoek doen om inzage. Vervolgens heeft de school de plicht om binnen vier weken een schriftelijk antwoord te geven op dit verzoek. Hoe dit antwoord eruit moet zien is beschreven in de brochure ‘Privacy op scholen en in multidisciplinaire zorgteams’</p>\n<h2>Speciale zorg</h2>\n<p>Als de ontwikkeling van uw kind anders verloopt dan verwacht, wordt daar extra aandacht aan besteed. De groepsleerkracht zal dan, samen met de interne begeleider, proberen duidelijk te krijgen:<br>- Waar zit het probleem?<br>- Hoe is het ontstaan?<br>- Welke maatregelen nemen we?<br>Die maatregelen kunnen divers zijn: er kan extra oefenstof gegeven worden en het tempo kan worden aangepast. </p>\n<p>Drie keer per jaar vindt het Meer Partijen Overleg plaats, kortweg het MPO. Aan dit overleg nemen deel: <br>- de schoolarts<br>- een vertegenwoordiger van bureau Jeugdzorg<br>- een orthopedagoog van de Schoolbegeleidingsdienst<br>- de ambulant begeleider van WSNS (zie het kopje ‘Weer samen naar school) <br>- één of beide intern begeleiders<br>Het overleg is voor de school een laagdrempelige mogelijkheid om advies te vragen aan externe deskundigen. Omdat er verschillende disciplines bij elkaar zitten, is er veel deskundigheid aanwezig. Soms zijn er meerdere instanties betrokken bij een kind en kan de hulpverlening gemakkelijker op elkaar afgestemd worden. <br>Als we uw kind willen bespreken in het MPO, vragen wij uw toestemming.</p>\n<p>De meeste extra zorg wordt binnen de schooltijden in de groep gegeven.<br>Regelmatig wordt de hulp van de schoolbegeleidingsdienst ingeschakeld om extra onderzoeken af te nemen. Deze dienst adviseert de school op het gebied van schoolzaken. De begeleiding heeft betrekking op het kind, de ouders en de leerkrachten.<br>Soms is het nodig om het leerproces van een kind aan te passen. Dit gebeurt door bijvoorbeeld extra leermiddelen aan te bieden of het kind op een ander niveau te laten werken. Ook voor kinderen met een bovengemiddelde intelligentie kan de stof worden aangepast.<br>Alle extra zorg zal de leerkracht met de ouders van de leerling bespreken.<br>Soms hebben kinderen moeite met leren, omdat sociale en/of emotionele problemen een rol spelen. We proberen die problematiek voor de kinderen hanteerbaar te maken. In voorkomende gevallen wordt er samengewerkt met de schoolarts, met een hulpverlenende instantie zoals de Riagg en/of particuliere hulpverleners. </p>\n<h2>Video opnamen op school (SVIB)</h2>\n<p>Af en toe kan er gefilmd worden in de klas. Dit kan bij voorbeeld nuttig zijn om de lessen van stagiaires goed te kunnen bespreken, om het handelen van een leerkracht ten opzichte van een of meer leerlingen te begeleiden en om leerlinggedrag te observeren. We noemen deze werkwijze SVIB (School Video Interactie Begeleiding) en het wordt op steeds meer scholen toegepast in situaties waarbij dit nuttig of nodig is. De opnamen zijn voor intern gebruik. Wanneer SVIB aan de orde is, worden de ouders middels een e-mail bericht of briefje op de hoogte gesteld. </p>\n<h2>Langdurige ziekte</h2>\n<p>Als blijkt dat uw kind door ziekte een langere periode niet naar school kan komen, is het van belang dat u dit, na maximaal drie weken, aan de leerkracht kenbaar maakt. De leerkracht kan dan, samen met u en de IB-er, bekijken hoe het onderwijs aan uw kind toch voortgezet kan worden. Hierbij kan gebruik gemaakt worden van de deskundigheid van onze schoolbegeleidingsdienst MHR. <br>Het is niet alleen onze wettelijke plicht om voor elke leerling, ook als hij/zij ziek is, te zorgen voor onderwijs, wij vinden het minstens zo belangrijk dat uw kind in die situatie contact heeft met de leerkracht en de klasgenoten. <br>Vanzelfsprekend is het continueren van onderwijs belangrijk omdat een zieke leerling dan actief blijft met wat bij het dagelijks leven hoort, namelijk onderwijs. Hierdoor wordt zoveel mogelijk voorkomen dat een leerling door ziekte achterop raakt, of in het uiterste geval zelfs doubleert. <br>Als u meer wilt weten over onderwijs aan zieke leerlingen, kunt u informatie vragen aan de leerkracht van uw kind. U kunt ook informatie vinden op de website van MHR, www.mhr.nl. Of op de site van Ziezon, het landelijk netwerk Ziek Zijn en Onderwijs: www.ziezon.nl. </p>\n<h2>Extra Taalondersteuning</h2>\n<p>Een aantal kinderen ontvangt extra taalondersteuning door een leerkracht. In deze ondersteuning is in een klein groepje veel aandacht voor het uitbouwen van de woordenschat (alle groepen), het stimuleren van de ontluikende geletterdheid (groep 1 en 2) en het technisch en begrijpend lezen (vanaf groep 3).</p>\n<h2>Handelingsplan</h2>\n<p>In een handelingsplan staan alle bijzondere activiteiten vermeld die met een bepaald kind ondernomen zullen worden ten aanzien van extra zorg. Deze activiteiten worden uitgevoerd in een afgesproken periode en zijn toegesneden op de zorgsituatie van dat kind. Er zijn groepsplannen en individuele handelingsplannen.</p>\n<h2>Plusgroep</h2>\n<p>Er is voor zowel de onder- als bovenbouw een protocol begaafdheid ontwikkeld. In navolging van het begaafdenprotocol hebben we een Plusgroep. De Plusgroep wordt gevormd door kinderen uit de groepen 3 t/m 8 die wat extra uitdaging nodig hebben m.b.t. de leerstof. Deze kinderen hoeven niet alle reguliere lessen te volgen. In plaats daarvan werken zij onder begeleiding van vrijwillige, maar kundige ouders, aan verschillende projecten. Zij krijgen bijvoorbeeld les over een ‘ander’ onderwerp of werken uit projectboeken aan een uitdagend thema. </p>\n<h2>Een jaar overdoen en aangepaste programma's</h2>\n<p>Het onderwijs op onze school is in principe een ononderbroken leerlijn. We gaan er van uit dat de leerlingen in 8 jaar de basisschool kunnen doorlopen. <br>Soms moeten we, de leerkracht en de IB-er, tot de conclusie komen dat alle extra hulp onvoldoende effect heeft. We nemen dan in overleg met de ouders het besluit een kind het leerjaar nog een keer te laten doen. Dit gebeurt als een leerling op een aantal gebieden achterblijft. De school neemt hierin de eindbeslissing. Het kan ook voorkomen dat een leerling een jaar versnelt. Dit gebeurt in overleg met de leerkracht, de IB-er en de ouders en door middel van doortoetsen o.a. met de Cito-toetsen van het LVS. Wij zijn echter zeer terughoudend in het laten doubleren of versnellen van een leerling. <br>Het sociaal-emotionele aspect geeft in alle gevallen de doorslag.</p>\n<h2>Kleuterperiode</h2>\n<p>U wilt het beste voor uw kind. Wij ook. Daarom volgen wij de ontwikkeling van uw kleuter nauwlettend. De kleuterperiode is ingedeeld in 3 fasen: instroom – groep 1 of middengroep – groep 2. Hierbij maakt het niet uit of het een enkele groep 1 of 2 of een combinatiegroep betreft. <br>Indien uw kind voor 1 oktober 4 jaar is geworden en dus op onze school instroomt, gaat hij/zij in principe in het daarop volgend schooljaar naar groep 2. Stroomt uw kind tussen 1 oktober en 1 januari in, dan komt hij/zij het volgend schooljaar in de ‘middengroep’. Dit schooljaar is dat een combinatiegroep met groep 2. In de loop van dat schooljaar wordt duidelijk welke kinderen uit de middengroep daarna naar groep 3 zullen gaan en welke naar groep 2. Voor de overgang van kinderen naar groep 2 en 3 hanteren wij een protocol, waarbij wij voor deze beslissing de gegevens gebruiken die we verzamelen in ons leerlingvolgsysteem. Wederom geeft het sociaal-emotionele aspect de doorslag. Natuurlijk wordt hierover overlegd met de ouders, maar de school neemt de eindbeslissing. Een wat langere kleuterperiode is geen verloren tijd. Wij bieden uw kind alle mogelijkheden om zich op eigen tempo te ontwikkelen. </p>\n<h2>Weer samen naar school (WSNS) en Speciaal (Basis)Onderwijs</h2>\n<p>Het beleid van de overheid is er op gericht om leerlingen zo veel mogelijk binnen het reguliere basisonderwijs te houden. Daarover zijn afspraken gemaakt met de basisscholen. Dit akkoord heet: Weer Samen Naar School (WSNS).<br>WSNS heeft er toe geleid dat scholen meer aandacht hebben voor de individuele begeleiding van kinderen. Ook op onze school is dat merkbaar. Wij toetsen de kinderen regelmatig of zij de geoefende leerstof ook beheersen en noteren dit in het leerlingvolgsysteem. Al deze gegevens worden besproken met de interne begeleider. Als blijkt dat een kind een bepaald onderdeel nog niet helemaal goed heeft begrepen, wordt een handelingsplan opgezet om het kind en de leerkracht te helpen hier aan te kunnen werken.In de groepen 1 en 2 volgen we de ontwikkeling van de kleuters intensief via observaties en toetsing. Hierdoor kunnen wij tijdig ingrijpen als de ontwikkeling van een kind te langzaam gaat of stagneert.</p>\n<p>De conclusie van onderzoeken en gesprekken kan zijn, dat het gewenst is de leerling aan te melden bij een speciale (basis)school. In dat geval wordt er door de intern begeleider een uitvoerig onderwijskundig rapport opgesteld dat, met instemming van de ouders, wordt gestuurd aan de zorgcommissie en de Permanente Commissie Leerlingenzorg (PCL). De zorgcommissie bekijkt of zij de basisschool op enige wijze nog kan ondersteunen of adviseren in het begeleiden van de leerling. Indien dit niet relevant is, dan geeft zij een advies tot plaatsing in het speciaal basisonderwijs, zo mogelijk met een plan van aanpak. De PCL is de door de wet ingestelde onafhankelijke commissie die uiteindelijk beslist of een kind geplaatst kan worden op een speciale basisschool. <br>Is een andere vorm van Speciaal Onderwijs gewenst, dan wordt het onderwijskundig rapport ingediend bij een Regionaal Expertise Centrum (REC) Deze bepaalt of de leerling in aanmerking komt voor die specifieke vorm van onderwijs of dat het mogelijk is om de leerling op de basisschool te laten blijven met (financiële) hulp vanuit de speciale school of instelling (het zgn. “rugzakje”). Zie hiervoor ook het hoofdstuk ‘Aanmelding nieuwe leerlingen’. <br>Als plaatsing op een speciale basisschool het best is voor een leerling wordt dat vrijwel automatisch de Speciale Basisschool “Park en Dijk” aan de Winterdijk. De reden daarvoor is dat we, samen met 33 andere P.C. basisscholen uit de regio, met deze speciale basisschool verbonden zijn in een samenwerkingsverband voor “Weer samen naar school". De scholen in dit samenwerkingsverband zijn samen verantwoordelijk voor een adequate begeleiding van kinderen met leer en/of opvoedingsproblemen. Zij hebben daar een gezamenlijk “zorgbudget” voor. De wijze waarop dit budget wordt gebruikt voor zorgleerlingen en de gezamenlijke afspraken t.a.v. doelstellingen en organisatie van de leerlingenzorg binnen het samenwerkingsverband wordt jaarlijks beschreven in het zorgplan. Dit plan ligt op school ter inzage. </p>\n<h2>Interne contactpersoon (vertrouwenspersoon voor de kinderen)</h2>\n<p>Op school zijn twee leerkrachten aangesteld als vertrouwenspersoon voor de kinderen. Dit zijn de interne contactpersonen. Kinderen van groep 3 tot en met 8 kunnen met allerlei problemen bij hen terecht. Aan het begin van elk nieuw schooljaar gaan de contactpersonen de groepen langs om zichzelf voor te stellen en informatie te geven. Voorafgaand aan deze klassenbezoeken worden de ouders schriftelijk ingelicht over de werkwijze van de interne contactpersonen. Tijdens dit klassenbezoek wordt verteld wat de rol is van de contactpersoon en wordt er een informatieve folder meegegeven. In deze folder staat wat de kinderen kunnen doen als zij zich thuis of op school niet fijn voelen. Op school staat een speciale brievenbus van de contactpersonen. Wanneer een kind met de contactpersoon over zijn/haar probleem wil praten, kan hij/zij dat aangeven door een briefje in deze brievenbus te doen. Een van de contactpersonen zal het kind dan uitnodigen voor een gesprekje. Vorig schooljaar hebben de interne contactpersonen het pestprotocol vernieuwd.</p>\n<h2>Voortgezet onderwijs, eindtoets (cito), schoolkeuze en uitstroomgegevens</h2>\n<p>Na groep 8 gaan de kinderen naar het voortgezet onderwijs (VO). De leerlingen ontvangen in dit laatste schooljaar de nodige informatie over verschillende schooltypes. Ook bezoeken wij met de kinderen een aantal scholen. We raden u aan met uw kind de open dagen en informatieavonden te bezoeken om u een goed oordeel te vormen over de vervolgschool. De keuze en de verwijzing naar het VO wordt zorgvuldig gedaan. Dit gebeurt altijd in overleg met u als ouders, het kind en de school waar de keuze op gevallen is. <br>Bij de keuze voor het VO speelt de CITO Eindtoets Basisonderwijs, die begin februari in groep 8 wordt afgenomen, een adviserende rol. Deze toets scoort de schoolvorderingen. Het toetsen gebeurt in de klas onder leiding van de leerkracht zelf. De uitslag verwachten we in maart retour. <br>De CITO-Eindtoets levert een score op die tussen de 500 en 550 ligt. Om u een idee te geven van de ‘waarde’ van deze cijfers: bij verwijzing naar het VO in de regio Alphen a/d Rijn worden, op grond van de uitslag van de CITO-Eindtoets de volgende normen gehanteerd:<br>Tot 520 LWOO<br>529 t/m 529 VMBO-B/K<br>530 t/m 532 VMBO-K/T<br>533 t/m 538 VMBO-T<br>539 t/m 540 VMBO-T/HAVO<br>541 t/m 550 HAVO/VWO</p>\n<p>We bespreken met de ouders en leerlingen van groep acht in het begin van het schooljaar de voorlopige schoolkeuze. Daaraan gerelateerd wordt afgesproken op welk niveau de schooltoetsen in groep 8 beoordeeld kunnen worden. Er kan uit drie niveaus gekozen worden: HAVO/VWO, VMBO-theoretisch en VMBO basis/kader. Uitgangspunten voor de keuze zijn gedrag en inzet, gegevens van de voorgaande jaren uit het LVS, gegevens van de CITO-entree toets en de motivatie van de leerling voor zijn of haar keuze. Bij de besprekingen rond de eind-cito kan de keuze eventueel gewijzigd worden voor de periode tot het volgende rapport. <br>In februari/maart bespreken we de eindtoetsuitslag (CITO) en de definitieve schoolkeuze na de basisschool. De school verzorgt de aanmelding. <br>Door de VO scholen worden wij gedurende de gehele schoolperiode van uw kind op de hoogte gehouden van de ontwikkelingen. Op deze wijze kunnen wij ook toetsen of de door ons geadviseerde school de juiste keuze is geweest. </p>\n<p>Uitstroom gegevens groep 8 (in leerling-aantal): <br>Schoolsoort          2008  2009  2010  2011  2012 <br>PRO / LWOO               1  <br>VMBO B/K          9      5         8        6        4<br>VMBO-T              7      9                  10       6<br>VMBO-T/HAVO 2       9         7                  7 <br>HAVO / VWO     6       7         4       10       3<br>Tot. aant. leerling. 24    31       19       26     20</p>
