1581	<p>De schoolraad is samengesteld uit ouders binnen de school die het zinvol vinden om mee te praten over het heden en toekomst<br/>van de school en over de veranderingen die onderweg daar naar toe zullen plaatsvinden.</p>\n<p><br/>De taak van de schoolraad is primair het actief stimuleren en bewaken van de identiteitsontwikkeling van de school. </p>\n<p>Hierbij valt te denken aan de Christelijke identiteit,<br/>maar ook aan de “eigenheid”van onze school in deze buurt en de kwaliteit van het onderwijs dat op onze school wordt gegeven.</p>\n<p><br/>De schoolraad functioneert als een adviesorgaan en klankbord voor de directie van de school, want als geen ander weten de<br/>ouders immers wat er gaande is rond de school en in de woonomgeving.</p>\n<p><br/>De schoolraad stelt de ouders van de leerlingen tenminste éénmaal per jaar in de gelegenheid om tijdens een daartoe door de<br/>schoolraad te beleggen vergadering de algemene gang van zaken in de school te bespreken.</p>\n<p><br/>Namen en telefoonnummers van SR-leden<br/>vindt u in “De Kleine Gids”</p>
