1162	<p><br/>De Immanuelschool is een school waar de bijbel als bron (inspiratie tot handelen) en richtsnoer wordt gebruikt. De school wil een samenbindende factor zijn binnen de protestants christelijke stromingen en getuigenis afleggen van Christus' woord. We gaan ervan uit dat Jezus Christus onze Verlosser is. Als school geven wij betekenis aan de bijbelse verhalen en vertalen deze naar de leefwereld van de kinderen. Ieder kind willen we als een uniek schepsel erkennen en behandelen en als zodanig tot zijn of haar recht laten komen.<br/>De Immanuëlschool wil voor kinderen een voorbeeld zijn. </p>
