675	<h1>Schooltijden</h1>
681	<p><em>P</em>ark &amp; <em>D</em>ijk is een christelijke school voor Speciaal Basisonderwijs, waar leerlingen zich manifesteren als actieve, enthousiaste, lerende kinderen. </p>\n<p><em>P</em>ark &amp; <em>D</em>ijk biedt onderwijs dat zich onderscheidt van andere scholen door specifieke kwaliteiten, zoals:<br/>• accent op motivatie<br/>• evenwicht tussen betekenisvol en zinvol<br/>• vermijden van negatieve stress<br/>• werken in de zone van naaste ontwikkeling<br/>• precieze instructie voor lezen, spelling, rekenen en schrijven<br/>• leerling kan kiezen uit een zinvol aanbod<br/>• passend bij de ontwikkelingsleeftijd van de leerling<br/>• talenten van leerlingen en leraren optimaal gebruiken</p>\n<p>Er is veel afwisseling in het dagprogramma. De leerlingen werken echter wel volgens een vaste dagindeling, waarin stamgroeptijd, werkplekken en instructieplekken elkaar afwisselen. </p>\n<p>De leerlingen kiezen zelf welke werkplekken zij bezoeken en kunnen hierdoor mede vormgeven aan de eigen ontwikkeling vanuit hun interesse. Zo wordt het onderwijs voor hen betekenisvol.</p>\n<p>Voor de leerlingen is het belangrijk dat ze hun wereld vergroten. We zorgen daarom dat de kinderen veel (betekenisvolle) ervaringen opdoen.</p>\n<p>Verder is het voor de leerlingen van wezenlijk belang, dat ze hun taal uitbreiden. Communicatie in de breedste zin, is de basis voor het onderwijs op <em>P</em>ark &amp; <em>D</em>ijk. De school biedt dus veel kansen voor taalontwikkeling.</p>
2389	<p>Het e-mailadres van de Schoolraad is: <a href="mailto:schoolraad.pcb.meesterlalleman@d4w.nl">schoolraad.pcb.meesterlalleman@d4w.nl</a>. Als u een vraag heeft aan de leden van de Schoolraad kunt u hen aanspreken op het schoolplein of u kunt contact opnemen met de Schoolraad via het e-mailadres.</p>
1166	<p><strong>Aanmelding nieuwe leerlingen</strong></p>\n<p>Voor onze school is een uitgebreid reglement vastgesteld door het Algemeen Bestuur. Dit is op school aanwezig. In de meeste gevallen komt het praktisch gezien neer op het volgende:<br/>Voor de aanmelding van nieuwe leerlingen kan contact worden opgenomen met de locatiedirecteur, Marja Timmer. Wij vinden het prettig de inschrijving te doen onder schooltijd in het bijzijn van de nieuwe leerling. Tijdens een rondleiding krijgen u en uw kind dan al vast een indruk van de nieuwe school. De inschrijving van jongste kleuters doen we bij voorkeur spoedig nadat ze 3 jaar zijn geworden. Van ouders die voor onze school kiezen verwachten we dat ze bewust kiezen voor christelijk onderwijs, dat ze instemmen met de vorm en inhoud van het onderwijs en de organisatorische afspraken zoals beschreven in deze schoolgids. En dat ze in principe deelnemen aan alle schoolactiviteiten gedurende de hele schoolperiode.<br/>Indien kinderen een specifieke begeleiding nodig hebben van de school, of middels een zogenaamde LGF (leerling gebonden financiering) regeling worden aangemeld, dan worden hiervoor in het reglement specifieke richtlijnen gegeven, welke met u zullen worden besproken.<br/>Wanneer kinderen van een andere school komen, geldt als voorwaarde voor eventuele toelating de toestemming van de oude school en het kunnen overleggen van een onderwijskundig rapport. Dit onderwijskundig rapport kan, evenals de groep waarin plaatsing gevraagd wordt, aanleiding zijn leerlingen niet toe te laten.<br/>Als uw kind vier jaar wordt, mag het naar de basisschool. Vanaf twee maanden voor de vierde verjaardag mag uw kind al vijf dagdelen meemaken en komen wennen op onze school. Hierover neemt de leerkracht van groep 1 contact met u op om de wendagen af te spreken. <br/>We kennen geen leerlingenstop, maar we laten de laatste vier schoolweken voor kerst- en zomervakantie geen leerlingen meer instromen en/of wennen. </p>
