1519	<p>De Plaswijckschool is een Protestants Christelijke basisschool met een open karakter, wat betekent dat respectvol wordt omgegaan met alle culturele en/of levensbeschouwelijk achtergronden.<br/>Vanuit de godsdienstmethode “Trefwoord” worden de Bijbelverhalen verteld en wordt de vertaling gemaakt naar ons samenleven hier en nu.<br/>Naast het leren omgaan met gevoelens en wensen van anderen en het stimuleren van gezond respectvol gedrag, zijn dagopeningen/-sluitingen, gebeden en vieringen van christelijke feesten de uitgangspunten van de methode. <br/>De jaarlijkse schooldienst en kerstviering worden met kinderen en ouders gevierd. De kerstviering vindt plaats in de Pauluskerk, de schooldienst om en om in de Veste of in de Pauluskerk. De paas- en pinkstervieringen vinden onder schooltijd plaats.</p>
