1749	<h1>Identiteit</h1><p>We zijn een school waar door het team, vanuit onze Protestants\nChristelijke identiteit, vorm en inhoud wordt gegeven aan onderwijs en\nopvoeding. Het evangelie van Jezus Christus nemen we daarbij als norm en\nuitgangspunt van denken en handelen. </p><p>Veel leerlingen van onze school komen uit gezinnen\ndie aangesloten zijn bij één van de Protestants Christelijke kerkgemeenschappen.\nOok kinderen met een andere achtergrond zijn welkom. Wel vragen we van\nouders/verzorgers, en van\n de kinderen, om het Protestants Christelijk karakter van de school te\nrespecteren. Betrokkenheid en zorg voor elkaar en respect voor een ieders identiteit,\nzijn belangrijke uitgangspunten bij het samen leven en samen leren op onze school.</p>
