1389	<h1>Schoolgids 2012 - 2013</h1>\n<p>Scholen verschillen steeds meer in werkwijze, sfeer en resultaten. Ze verschillen in kwaliteit. Dat maakt de keuze moeilijk. Daarom vraagt de overheid aan basisscholen een schoolgids te maken die u kan helpen bij uw keuze. </p>\n<p>De schoolgids van de Goede Herderschool is bedoeld voor ouders van (toekomstige) leerlingen. Voor wie al kinderen op school heeft, wordt verantwoording afgelegd over de manier van werken. Aan de ouders van nieuwe leerlingen wordt uitgelegd wat ze mogen verwachten als hun kind een leerling van onze school wordt.</p>
1628	<p>Ons team bestaat uit:</p>\n<p>groep 1/2: juf Hermy en juf Juliette</p>\n<p>groep 3/4: juf Martine en juf Carolien</p>\n<p>groep 5/6: juf Sanne en meester Hans</p>\n<p>groep 7/8: juf Carola </p>\n<p>leerlingbegeleiding en groepsondersteuning: juf Dita en juf Marja</p>\n<p>TSO coordinator: Linda Rullens-Ligterink</p>\n<p>ICT coordinator: Willem Groenendijk</p>\n<p>directie:  juf Marja Timmer<span class="Apple-tab-span" style="white-space: pre;">\t\t</span></p><p>administratief medewerker: Annemarie Six</p>
1582	<p>Alle scholen in ons land hebben een Medezeggenschapsraad, die bestaat uit leerkrachten en ouders. Deze is ingesteld ten<br/>behoeve van:<br/>· het overleg tussen ouders, bestuur en personeel;<br/>· de medezeggenschap van ouders en personeel;<br/>· het goed functioneren van de school in haar doelstellingen.</p>\n<p><br/>De taken en de bevoegdheden van de MR zijn wettelijk geregeld en vastgelegd in een medezeggenschapsreglement, dat ook voor<br/>onze school is vastgesteld. De MR wordt gekozen en bestaat op de Plaswijckschool uit 3 ouders en 3 leerkrachten. </p>\n<p>De taken en bevoegdheden hebben vooral betrekking op<br/>het te voeren beleid. De MR functioneert als een soort ondernemingsraad. Bij bepaalde beleidsvoornemens moet het bestuur advies of instemming van de MR vragen. De MR<br/>vergadert zo’n 8 tot 10 keer per jaar.<br/>Een lid van de MR is afgevaardigd in de<br/>Gemeenschappelijke Medezeggenschapsraad<br/>van de Stichting, waarin alle scholen vertegenwoordigd zijn.</p>\n<p><br/>Onderwerpen voor de MR zijn onder andere:<br/>Het beleid van de Stichting ‘De Vier Windstreken’ in het algemeen;<br/>· Omvang en samenstelling van de klassen;<br/>· De resultaten van de school;<br/>· Het toelatingsbeleid voor leerlingen;<br/>· De rechtspositie van de leerkrachten;<br/>· De organisatie van de school;<br/>· De veiligheid van leerlingen en<br/>personeel.<br/>De MR geeft soms een nieuwsbrief uit. Voor<br/>vragen over de MR bent u welkom bij de MRleden.</p>\n<p><br/>De namen en adressen van de MR-leden<br/>vindt u in “De Kleine Gids”</p>
1163	<p><br/>In 1882 werd de ‘Vereniging een school met de Bijbel te Oudewater’ opgericht. Deze vereniging beheerde één christelijke lagere school. Later is vanuit deze vereniging een tweede vereniging opgericht, nl. de ‘Vereniging tot oprichting en instandhouding ener Christelijke Kleuterschool’. In 1985 kwam de basisschool tot stand, waardoor een doorgaande lijn werd bewerkstelligd tussen kleuterschool en lagere school. In 1989 vond de echte integratie plaats, toen na een verbouwing alle groepen in één pand werden gehuisvest. Vanaf dat moment is er één (basis)school met één team.<br/>Sinds januari 2000 maakt de Immanuëlschool deel uit van de ‘Stichting Protestants Christelijk Primair Onderwijs De Vier Windstreken’ te Gouda. </p>
