1391	<h1>De Goede Herderschool</h1>\n<p>De Goede Herderschool is een protestants-christelijke basisschool, wat onder andere inhoudt dat:<br/>• er door alle leerlingen gebeden, gezongen en uit de Bijbel gelezen wordt<br/>• de christelijke feesten met elkaar gevierd worden.<br/>Van de ouders (indien zij hiervoor uitgenodigd worden) en de leerlingen wordt verwacht dat zij aan alle door de school georganiseerde vieringen mee doen.</p>\n<p>Doelstelling van het onderwijs op de Goede Herderschool is, dat wij willen leven zoals de Here Jezus het ons geleerd heeft. Wij willen vanuit de Bijbel laten zien hoeveel God van de mensen houdt, welke ruimte God ons geeft om te genieten van de schepping en waar wij falen. Het is belangrijk dat het kind leert om God te vertrouwen en goed naar Hem te luisteren. </p>\n<p>Wij streven er naar dat kinderen zich veilig en geborgen voelen. Wij vinden het van belang dat een kind op een plaats in de maatschappij komt, waar het gelukkig is en zijn talenten kan ontplooien. Wij willen het kind leren verantwoording te dragen voor zijn eigen werk en gedrag. Verder hechten wij grote waarde aan de begrippen vergeving, verdraagzaamheid, vriendelijkheid en vertrouwen.</p>\n<p>De school is een “tweede huis” voor de kinderen, waar bovengenoemde uitgangspunten naast kennis en vaardigheden een belangrijke plaats innemen. <br/>Tijdens de basisschoolperiode werken we met elkaar aan het positief beantwoorden van de vragen:<br/>- heeft de leerling een plezierige schooltijd?<br/>- legt de school een effectieve basis voor de toekomst van het kind?<br/>- draagt deze periode bij aan de kwaliteit van zijn of haar leven?<br/>- kan de leerling de verworven kwaliteiten inzetten voor anderen?</p>\n<p>Om goede resultaten te kunnen bereiken, wil de school zorgen voor een adequate organisatie, deskundige leraren en een actieve vorm van ouderparticipatie. De kernwoorden kwaliteit en identiteit staan hierbij voorop!</p>\n<p>Op de Goede Herderschool kunnen de leerlingen rekenen op:<br/>- een veilig leerklimaat<br/>- goed onderwijs door gekwalificeerde leerkrachten<br/>- het aanleren van sociale vaardigheden<br/>- een open en duidelijke communicatie met de ouders</p>\n<p>De school heeft haar verplichtingen omschreven in het schoolplan, dat op school ter inzage ligt.<br/>De leerkrachten vinden het belangrijk in gesprek te zijn en te blijven met de ouders. Wanneer er sprake is van “samen verantwoordelijk zijn” kan het kind optimaal profiteren van deze wisselwerking tussen ouders en school.</p>
