1118	<h1><br/>Bestuur</h1>\n<p>De voorzitter van het College van Bestuur is dhr. A.C. van Duijvenbooden.<br/></p>\n
1584	<p>De ouderraad van de Plaswijckschool bestaat uit 6 door u gekozen ouders (zie Kleine Gids).<br/>Het doel van de ouderraad is de relatie tussen de ouders, de schoolraad, de Medezeggenschapsraad en de school te<br/>bevorderen en wel op zodanige wijze dat het werk van de ouderraad aan het optimaal functioneren van het onderwijs bijdraagt.</p>\n<p>In de praktijk betekent dit o.a. ondersteuning bij bijvoorbeeld activiteiten als het Sinterklaasfeest, Kerstfeest, Pasen,<br/>jeugdavondvierdaagse, musical, kamp, schoolreis, sportwedstrijden, sport-/speldag, pleinparty en overblijven. Bij diverse<br/>activiteiten doen we ook een beroep op u als ouder. </p>\n<p>Op een oudercouponnenlijst, die aan het begin van het schooljaar wordt uitgereikt kunt u invullen of en hoe u zich voor onze<br/>school wilt inzetten. Wij zijn blij met alle hulp!</p>
1655	<h1><strong>Aanmelden hoe werkt dat?</strong></h1>\n<p>U kunt uw kind vanaf 3 jaar inschrijven bij onze school. Dit doet u door een afspraak te maken met Janneke Meijers. Belt u hiervoor met :</p>\n<p>0182-514324 </p>\n<p>Eén keer per jaar organiseren wij een inloopmiddag voor ouders die geïnteresseerd zijn in onze school. Deze middag is meestal in februari.</p>\n<p>Natuurlijk kunt u altijd vrijblijvend een rondleiding krijgen.</p>
750	<p>CBS "De Morgenster" is een open protestants christelijke school, waar in een veilige en rustige sfeer wordt gewerkt. Voor een goede ontwikkeling wordt zelfvertrouwen belangrijk gevonden. Respect, geborgenheid, acceptatie en eigen verantwoordelijkheid zijn fundamentele begrippen waaraan een ieder uiting geeft. Op de Morgenster wordt gewerkt aan een brede ontwikkeling van kinderen.</p><p>Dit betekent dat kinderen zich naast cognitief ook creatief en sociaal-emotioneel moeten kunnen ontwikkelen. Vanuit een gemeenschappelijke visie wordt een werkklimaat gecreëerd, waarin alle kinderen en teamleden tot hun recht kunnen komen. Plezier en humor maken hiervan deel uit.</p>
772	<h1>Identiteit</h1>
1106	<p>Actieve vormen van ouderparticipatie\nzijn belangrijk om goede resultaten te bereiken voor de leerlingen. Een\nvanzelfsprekend gevolg hiervan is, dat zowel de school als de ouders zich samen\nverantwoordelijk voelen voor het wel en wee van de kinderen. Onze school stelt\nde belangstelling van ouders voor het onderwijs in de basisschool zeer op\nprijs.</p><p>De school kent onder andere een <img src="/layout/cms/images/plugins/link.png" alt="Link - medezeggenschapsraad" id="plugin_obj_1108" title="Link - medezeggenschapsraad"/> en een schoolraad. </p>
1629	<p>Wij zijn een open protestants christelijke school. Dit staat in onze schoolgids. Dit betekent dat wij open staan voor iedereen die onze school wil bezoeken en die zich in onze identiteit en manier van werken herkent.</p>\n<p>Wij hebben de bijbel als basis in ons denken en handelen, met liefde en respect als centraal uitgangspunt. De liefde van God voor de mensen, de liefde voor mensen onderling, de liefde voor de natuur. Met zorg en aandacht voor elkaar.</p>\n<p>Wij willen de kinderen vertrouwd maken met en begeleiden in het christelijke geloof en hen leren wat het betekent in ons dagelijks doen en laten. Wij vinden het belangrijk dat de kinderen oog hebben voor de wereld om ons heen. Daarom willen wij de kinderen kennis laten nemen van en respect bijbrengen voor verschillende geloofs- en levensovertuigingen</p>
