1635	<p>Actieve vormen van ouderparticipatie zijn belangrijk om goede resultaten te bereiken voor de leerlingen. Een vanzelfsprekend gevolg hiervan is, dat zowel de school als de ouders zich samen verantwoordelijk voelen voor het wel en wee, de opvoeding en de ontwikkeling van de kinderen. Onze school stelt de belangstelling en participatie van ouders voor het onderwijs in onze basisschool zeer op prijs.</p>\n<p>De school kent onder andere;</p>\n<p>een schoolraad (meedenken)</p>\n<p>een medezeggenschapsraad (meebeslissen)</p>\n<p>een ouderraad (meedoen/ meehelpen)</p>
