1554	<h1>Kalender</h1>\n<p>Op de kalender kunt u vinden wanneer de verschillende activiteiten plaatsvinden. De kalender wordt gedurende het schooljaar steeds aangepast om zo actueel mogelijk te blijven. In de nieuwsbrief vindt u in de agenda ook de activiteiten voor de komende periode. Meer info staat ook in de verkorte schoolgids 3-2014 (onder: 'Over de school').</p>
808	<p>Wanneer u op zoek bent naar een basisschool voor uw kind, dan raden wij u aan tijdig een kijkje te nemen in verschillende scholen in uw wijk. <br>Als uw kind 4 jaar wordt, mag het tot de basisschool worden toegelaten. Het is belangrijk dat u uw kind – tijdig - in het schooljaar dat uw kind 3 jaar wordt, of eerder, aanmeldt. Zo kunnen wij een goed beeld krijgen van de toekomstige groepsgrootte en daar eventueel in aanpassen.</p>\n<p>Indien u interesse heeft in onze school, kunt u een afspraak maken met de directeur voor een kennismakingsgesprek en een rondleiding.<br>Na dit gesprek krijgt u, als u dat wenst, een formulier mee om uw kind in te schrijven als leerling alsmede een intakeformulier met vragen over de ontwikkeling van uw kind. Zodra u deze formulieren geretourneerd hebt ontvangt u een voorlopige toelating voor uw kind. Om een zo volledig mogelijk beeld van de leerling te krijgen voor het leerlingvolgsysteem - en om de begeleiding zo goed mogelijk af te stemmen - ontvangt u, ongeveer 8 weken voordat uw kind 4 jaar wordt, het entreeformulier, met daarop vragen over de sociale, lichamelijke en cognitieve ontwikkeling van uw kind. Wij vragen u dit zo zorgvuldig mogelijk in te vullen en binnen een week naar school te sturen. <br>De aannameprocedure verloopt verder als volgt: <br>Zowel het intakeformulier als het entreeformulier worden door de directeur en IB-er goed bekeken. Indien er nog onduidelijkheden bestaan, wordt er contact met u opgenomen. Pas daarna wordt besloten of uw kind definitief wordt toegelaten.<br>Wanneer uw kind de leeftijd van 3 jaar en 10 maanden heeft bereikt, ontvangt hij/zij een uitnodiging om drie dagdelen te gast te zijn in zijn/haar nieuwe groep om kennis te maken met de leerkracht en de kinderen. Voor de kinderen die meteen na de zomervakantie op school komen, is er alleen een wenmiddag in juni of juli. <br>De leerkracht zal met u een afspraak maken voor een kort gesprek dat plaatsvindt zodra uw kind bij ons op school zit. Daarbij zal het door u ingevulde entreeformulier als uitgangspunt worden genomen en kunnen ervaringen worden uitgewisseld. <br>Nieuwe leerlingen worden de dag na hun verjaardag toegelaten. De voorwaarde voor toelating is dat uw kind op dat moment overdag zindelijk is en zelfstandig het toilet kan bezoeken. Kinderen die tussen 15 november en 31 december jarig zijn, worden pas na de kerstvakantie toegelaten in verband met de decemberdrukte. <br>Indien uw kind afkomstig is van een basisschool binnen de gemeente Bodegraven, is er altijd overleg tussen de directeuren van beide scholen. Pas daarna krijgt u bericht van definitieve inschrijving.</p>\n<p>Voor kinderen die in hogere groepen instromen, wordt de volgende procedure gevolgd:<br>aanmelding bij directie + eventueel rondleiding<br>intakegesprek door directie en/of IB-er <br>het kind wordt pas ingeschreven na contact met de leverende school, waarbij vooral aandacht wordt besteed aan het sociaal-emotioneel en cognitief functioneren en aan de reden van de overstap. Als er problemen zijn op de leverende school, stimuleert de directeur de ouders het probleem op de leverende school te bespreken.<br>De IB-ers verzamelen informatie over de leerling en beoordelen of de Da Costaschool een passende plaats zou kunnen zijn voor de leerling. Indien het een ‘rugzakleerling’ is die aangemeld wordt, behoudt de school zich het recht voor om de leerling te kunnen verwijzen naar het bijbehorende cluster. Als er geen toetsgegevens bekend zijn dan worden er Citotoetsen afgenomen, passend bij het moment waarop het kind aangemeld wordt. Tevens wordt gekeken naar de samenstelling van de groep waarin het kind eventueel geplaatst gaat worden. De IB kan ook het managementteam om advies vragen.<br>De informatie van de directeur en de IB wordt met het managementteam gedeeld. Gezamenlijk wordt een beslissing genomen. Hierna wordt de betrokken leerkracht benaderd over de plaatsing in de groep<br>Bij weigering motiveert de directie/IB de afwijzing in een gesprek met of brief aan de ouders.</p>\n\n<p>Als u eerst meer informatie over onze school wilt ontvangen, dan kunt u contact met ons opnemen (tel. 0172-611897 of per mail <a href="mailto:dacostaschool@d4w.nl">dacostaschool@d4w.nl</a>). We sturen u een informatiepakket toe en maken een afspraak met u voor een rondleiding. U kunt dan de school bekijken en de sfeer proeven.<br><br>Het is ook mogelijk om het inschrijfformulier te downloaden, zie de link hieronder.</p>
