2009	<h1>Brede school Noord</h1>\n<p/><h3>Brede school Noord “Samen sterker voor kinderen”</h3><p>In de wijk Noord van Bodegraven is met ingang van het schooljaar 2008-2009 een brede school gestart. <br/>Een aantal organisaties op het gebied van onderwijs, welzijn en opvang werkt samen in deze brede school. Dit zijn: de Da Costaschool, de Pax Christischool, het Peuterplein en Kinderopvang Bodegraven.</p><p/>\n<p>De brede school biedt een goed dagarrangement aan voor kinderen. Er is een doorlopend en op elkaar aansluitend aanbod van onderwijs, opvang en welzijn. De voor-, tussen- en naschoolse opvang zijn goed op elkaar afgestemd. Vooral voor werkende ouders met kinderen van 4-12 jaar is dit een ondersteuning bij het combineren van zorg en werk. De gemeente Bodegraven is nauw betrokken bij de ontwikkeling van deze brede school. Naast de opvangondersteuning richt de brede school zich op verrijking. Dit gebeurt door een uitgebreid aanbod van activiteiten op sociaal, cultureel en sportief gebied voor kinderen. Daarbij wordt zo goed mogelijk gebruik gemaakt van de beschikbare accommodaties. Binnen de brede school worden de ontwikkelingskansen van kinderen vergroot door de afstemming van de pedagogische en de didactische aanpak en een goede doorgaande lijn voor kinderen van 2½ t/m 12 jaar (einde basisschool). Er is onderlinge uitwisseling van deskundigheid en ervaring. </p>\n<p>Het concrete aanbod van de brede school is:<br/>- Opvang buiten schooltijd.<br/>- Activiteiten voor kinderen buiten schooltijd.<br/>- Bevorderen van de doorgaande lijn met betrekking tot onderwijskansen voor kinderen.<br/>- Peuterspeelzaalwerk.<br/>- Aanbod van Voor- en Vroegschoolse Educatie.<br/>De brede school Noord gaat uit van een groeimodel. Elk jaar worden gezamenlijk activiteiten uitgevoerd en het aanbod zal langzaam uitgebreid worden. Het dagarrangement van de brede school is in een schema weergegeven. U ziet op deze manier wat de verschillende organisaties u kunnen bieden. Onder het schema vindt u meer informatie over de organisaties, hun werkwijze en manier van aanmelden/contact.</p>\n<p/><h3>Peuterplein</h3><p>De peuterspeelzaal biedt activiteiten gericht op de ontwikkeling van het jonge kind. In een veilige en geborgen omgeving worden de kinderen spelenderwijs gestimuleerd zich te houden aan regels. Veel aandacht wordt besteed aan de motorische-, sociale- en verstandelijke ontwikkeling. Door samen liedjes te zingen of door voorlezen wordt het taalgebruik gestimuleerd. Door het aanbieden van een extra dagdeel aan kinderen met een taalachterstand wordt de basis gelegd voor een probleemloze start op de basisschool. Naast de brede school zijn er nog drie andere locaties in Bodegraven en Nieuwerbrug. U kunt informatie en een inschrijfformulier aanvragen op woensdagochtend van 9.00-12.00 uur.<br/>Contact: ‘t Peuterplein Dronenplein 3 2411 HE Bodegraven T. 0172-612952 <br/>W. www.peuterplein.nl E. peuterplein@solcon.nl</p><p/>\n<p/><h3>Kinderopvang Bodegraven</h3><p>Op de brede school worden na schooltijd kinderen van 4 t/m 12 jaar opgevangen. In vakanties bieden wij hele dagopvang aan en organiseren wij activiteiten op diverse gebieden. U kunt dan denken aan sport, muziek, dans, zwemactiviteiten etc.<br/>Naast Buitenschoolse Opvang in de brede school bieden wij ook opvang voor kinderen van 0 t/m 12 jaar op andere locaties in Bodegraven. Wij bieden Dagopvang voor kinderen van 0-4 jaar. Voor schoolkinderen bieden wij Voorschoolse opvang en Naschoolse opvang. Voor bemiddeling via het Gastouderbureau werken wij samen met Stichting Kinderopvang Alphen a/d Rijn. Wilt u meer informatie dan kunt u onze uitgebreide informatiebrochure downloaden via de website of telefonisch aanvragen.<br/>Contact: Kinderopvang Bodegraven Bezoekadres kantoor: Beursstraat 6 in Bodegraven<br/>Postadres: Postbus 191 2410 AD Bodegraven T. 0172-630010 <br/>W. www.kinderopvangbodegraven.nl E. <a href="mailto:info@kinderopvangbodegraven.nl">info@kinderopvangbodegraven.nl</a></p><p/>
