1822	<h1>Plusklas</h1><p>We werken met een “Plusklas” voor (hoog)begaafde kinderen.\nOp basis van observatie van\n de leerkrachten en op grond van scores bij meerdere toetsen\nuit het leerlingvolgsysteem, worden potentiële plusklas-leerlingen\ngesignaleerd. Aan de hand\n van een protocol en in goed overleg met de ouders wordt\nvastgesteld of kinderen voor de Plusklas in aanmerking komen. Als dat zo is,\nkrijgen de kinderen gedurende een dagdeel per week les met gelijkgestemde\nmedeleerlingen uit andere groepen. In de Plusklas werken de kinderen op eigen\nniveau aan onderwerpen die hen boeien.</p>
2063	<p>Onze school is een Protestants Christelijke school. Dat is een vrij algemeen begrip.<br/>Toch hebben wij een eigen gezicht, een eigen karakter. Dat heeft met veel zaken te<br/>maken, zoals het bevoegd gezag (het bestuur), de ligging, de ouders, de kinderen en<br/>het personeel. Het geloof speelt een grote rol in onze identiteit. Hierin komt tot<br/>uitdrukking wat ons dagelijks inspireert bij ons werk, in de omgang met de kinderen en<br/>met elkaar. Wij proberen het geloof een plaats te geven in deze tijd en in deze cultuur.<br/>We willen onze identiteit niet alleen herkenbaar laten zijn uit wat we zeggen, maar vooral<br/>uit hetgeen we doen.<br/>Om aan te geven waaraan we denken als we spreken over identiteit, noemen we een<br/>aantal grondwoorden, gerelateerd aan de Bijbel, die uitgangspunten vormen voor ons<br/>handelen: Waardering, respect, zorg, vergevingsgezindheid, naastenliefde, aandacht,<br/>verdraagzaamheid, behulpzaamheid, eerlijkheid, rechtvaardigheid, vertrouwen, geloof,<br/>eerbied en dankbaarheid.<br/>Schoolgids SmdB de Rank-Sjaloomschool 11 2011- 2012<br/>Op een studiedag hebben we dit zo geformuleerd: ‘Wij willen vanuit de inspiratie die we<br/>putten uit Gods Woord, de Bijbel, in een respectvolle en veilige sfeer de kinderen leren<br/>samen te werken, op een zelfstandige manier basiskennis op te doen en leren<br/>vaardigheden te ontwikkelen, die nodig zijn om op te groeien tot een<br/>zelfverantwoordelijke volwassene’<br/>Het onderwijs- en vormingsproces is op deze woorden gebaseerd. In de schooldoelen<br/>vindt u de kenmerken daarvan terug.</p>
