1187	<p><br/>Als u uw kind bij ons wilt aanmelden, kunt u de schoolgids doorlezen. Die bevat veel informatie, maar wij kunnen ons voorstellen dat u graag de school wilt zien. Als ouder(s)/verzorger(s) kunt u een afspraak met ons maken. U wordt ontvangen door de directeur of de intern begeleider van de onderbouw en dan worden in ieder geval de volgende onderwerpen besproken:<br/>- de protestants-christelijke identiteit van de school<br/>- de wijze, waarop ons onderwijs is georganiseerd<br/>Van u als ouder(s)/verzorger(s) wordt gevraagd de uitgangspunten van de school tenminste te respecteren. Dat betekent dat uw kind ook zal deelnemen aan activiteiten, die voortvloeien uit het christelijk karakter van de school. Verder komen in het gesprek de mogelijkheden die de school heeft om kinderen met leer- en/of gedragsstoornissen voldoende extra aandacht te geven, ter sprake. Wij zijn aangesloten bij het samenwerkingsverband ‘WSNS 3304’. Dit houdt in dat wij samen met de andere basisscholen en de basisschool voor speciaal onderwijs onze zorg optimaliseren. Als blijkt dat een leerling niet meer bij ons op school kan blijven, zullen wij adviseren om gebruik te maken van de school voor speciaal onderwijs in Gouda.<br/>Kinderen die voor groep 1 worden aangemeld, worden geplaatst als ze 4 jaar zijn. Het komt voor dat vierjarige kleuters in het begin alleen de ochtenden naar school gaan; het kind doet veel indrukken op en dan kan een middagje rust goed doen. Vanaf de vijfde verjaardag is een kind leerplichtig.</p>
1406	<p>Onze school maakt deel uit van de Brede School in Korte Akkeren.<br/>Regelmatig vinden er in en buiten de school activiteiten plaats, waar de kinderen heel voordelig aan kunnen meedoen. </p>\n<p>Voor een actueel beeld van de Brede School en hun activiteiten verwijzen wij graag door naar hun website. U kunt hiervoor op onderstaande link klikken.</p>\n<p><img src="http://www.d4w.nl/layout/cms/images/plugins/link.png" alt="Link - Bredeschool" id="plugin_obj_1408" title="Link - Bredeschool"/></p>
