918	<p>Vanaf groep 5 gaan de leerlingen steeds meer het internet op om informatie te zoeken. Dit stimuleren we als school, want we willen de leerlingen graag de fijne en nuttige kanten van het wereld wijde web laten ontdekken. Tegelijkertijd willen we ook met elkaar afspraken maken om op een veilige manier met internet om te gaan. Daarvoor is een protocol opgesteld, dat we de leerlingen en hun ouders vanaf groep 5 laten ondertekenen.</p>
