991	<h1>Onze afspraken</h1>\n<p>We willen een school zijn waar kinderen, ouders en/of verzorgers en leerkrachten zich veilig en op hun gemak voelen. Alleen hierdoor kan er goed onderwijs worden gegeven en kan een kind tot goede leerprestaties komen.<br/>Om dat te realiseren zijn vijf afspraken met <em>kernwoorden </em>gemaakt.</p>\n<ul>\n<li>Wij zijn <em>vriendelijk</em> voor elkaar.</li>\n<li>Wij zorgen ervoor dat iedereen zich op school <em>veilig</em> voelt.</li>\n<li>Wij <em>gaan goed om</em> met de  spullen van school en die van onszelf.</li>\n<li>Wij zorgen ervoor dat kinderen <em>goede lessen</em> kunnen krijgen en de leerkracht goed les kan geven.</li>\n<li>Wij gebruiken <em>woorden</em> waarbij iedereen zich <em>goed voelt</em>.</li></ul>
