1128	<p><strong>Onze visie </strong></p>\n<p>CBS "De Morgenster" is een open protestants christelijke school, waar in een veilige en rustige sfeer wordt gewerkt. Voor een goede ontwikkeling wordt zelfvertrouwen belangrijk gevonden. Respect, geborgenheid, acceptatie en eigen verantwoordelijkheid zijn fundamentele begrippen waaraan een ieder uiting geeft. Op de Morgenster wordt gewerkt aan een brede ontwikkeling van kinderen.<br/>Dit betekent dat kinderen zich naast cognitief ook creatief en sociaal-emotioneel moeten kunnen ontwikkelen. Vanuit een gemeenschappelijke visie wordt een werkklimaat gecreëerd, waarin alle kinderen en teamleden tot hun recht kunnen komen. Plezier en humor maken hiervan deel uit. </p>\n<p><strong>De Morgenster staat voor kwalitatief goed en passend onderwijs.</strong></p>
