1059	<p>(14-01-1798 tot 28-04-1860) <br/>Isaäc da Costa was een schrijver en dichter uit de 19e eeuw. Hij is geboren in Amsterdam op 14 januari 1798 als enige zoon van de uit Portugal gevluchte, welgestelde joodse cargadoor-wijnkoper Daniël da Costa en zijn vrouw Rebecca Ricardo. Isaäc werd joods opgevoed, een opvoeding die hem dierbaar bleef. Zijn ouders gaven hem een zo breed mogelijke klassieke opleiding. Op achtjarige leeftijd deed Isaäc zijn entree op de Latijnse school. Hij was een begaafde leerling en kreeg heel wat prijzen. Op dertienjarige leeftijd verliet hij de school met het houden van een latijnse oratie over de werken van Heracles, kort daarna werd hij ingeschreven als student aan het Athenaeum illustre. Hij werd al spoedig geboeid door de colleges van professor David Jacob van Lennep, die hem interesseerde voor het joodse verleden. In 1812 waagde hij zich (als 14-jarige!) aan de ode "Lof der Dichtkunst" waaraan de gehele Griekse en Latijnse literatuur te pas kwam. Dit gedicht bracht hem in contact met Willem Bilderdijk, die hem privéles gaf in het Romeins recht en de Nederlandse taal. De voltooiing van zijn studie kon slechts in Leiden plaats vinden, waar hij in 1818 en in 1821 promoveerde; in 1822 liet hij zich daar in de hervormde Pieterskerk dopen. Ook zijn vrouw Hanna Belmonte, werd in deze bekering tot het christendom betrokken. Nauwelijks een jaar later ging Da Costa in de aanval tegen de zelfgenoegzaamheid van de tijdgeest, het rationalisme en het verslapte, vervlakte christendom door het schrijven van "Bezwaren tegen de geest der eeuw". In dit romantisch "manifest", geschreven in een proza van vaak klassieke allure, kondigde hij een "nieuwe geest" aan; in details schoot hij het doel voorbij, door letterlijk alles af te keuren wat men in die tijd als tekenen van "vooruitgang" beschouwde (bijv. afschaffing der slavernij). Vanaf 1826 houdt hij vele lezingen en bijbelbesprekingen, het hart van het Réveil. De voorlezingen van Da Costa werden bezocht door vooraanstaande en goed gesitueerde luisteraars die er veel geld voor betaalden. Da Costa vond het "zaliger te geven dan te ontvangen", deed veel aan liefdadigheid en was verre van rijk. Vervolgens schreef Da Costa naast veel proza een groot aantal indrukwekkende gedichten, wat mede verklaart waarom de dichter bij zijn dood op 28 april 1860 door velen als een der grootsten geëerd werd. Da Costa stond met open ogen in het leven. Het maatschappelijk en politiek leven ging hem niet zonder meer voorbij. Hij leefde in de verwachting van de nabije wederkomst van Christus, wat tot uitdrukking kwam in het gedicht "Vijf en twintig jaren. Een lied in 1840". Het is in wezen niet alleen een uiting van zijn christelijk geloof, maar van heel zijn denken. Het is de achtergrond waartegen het leven en werken van de christen-jood Isaäc da Costa gezien moet worden. </p>
