1515	<h2>kws.yurls.net</h2><p>Ook kunt\nu heel leerspelletjes vinden op de volgende site: <a href="http://kws.yurls.net/">kws.yurls.net</a>. Voor elk wat wils. Kom er\nmaar eens kijken met uw kind en ik hoop dat u / je regelmatig terugkomt om verder\nte oefenen en te zien wat er nu weer op staat.</p>\n\n<p>Misschien\nkent u zelf een goede site die er misschien bij past. Misschien\nzoekt u iets speciaals voor uw kind en kunt u het niet vinden?</p>\n\n<p>Kom\ngerust even langs, dan ga ik voor u op zoek.</p><p>De\nkinderen vanaf groep 5 mogen regelmatig opdrachten doen waarvoor ze het internet\nop moeten. Daar hebben we met de kinderen over gesproken en afspraken over\ngemaakt. Zie hiervoor het <a href="http://d4w.nl/media/cms_page_media/743/Internetprotocol.pdf">internetprotocol</a>.</p>\n\n<p>meester\nSjaak</p>
994	<h2>Effectief onderwijs</h2><p>Een belangrijk uitgangspunt van ons is dat kinderen\neffectief onderwijs moeten krijgen. Dit moet gebeuren door het aanbieden van\nleerstof door de leerkracht, waarbij effectieve instructie en goed\nklassenmanagement een voorwaarde is. Op onze basisschool "De\nEendragt" proberen wij elk kind de gelegenheid te geven zich persoonlijk\nte ontplooien. We vinden wel dat deze aandacht voor de persoon, het individu,\nniet ten koste mag gaan van anderen. Dit houdt enerzijds in, dat elk kind\nzoveel mogelijk onderwijs moet krijgen, dat voor hem het meest geschikt is en\nanderzijds betekent het, dat de kinderen moeten leren samenwerken en zich\ndienstbaar op te stellen. In onze visie leren leerlingen het beste door\nervaring, door het doen. De manier waarop ze iets doen is hierbij belangrijker\ndan het goede antwoord. Verder vinden wij dat:</p>\n\n<p>·        \nkinderen moeten worden uitgedaagd zich een gefundeerde\nmening te vormen waarbij het standpunt van de ander als waardevol beschouwd\nmoet worden.</p>\n\n<p>·        \nsociaal-emotionele aspecten net zo belangrijk zijn als\ncognitieve aspecten.</p>\n\n<p>Zo begeleiden wij de kinderen op weg naar de\nvolwassenheid. Daarbij streven we er naar onze schoolplandoelen en de\nverplichte kerndoelen te realiseren.</p>\n\n
995	<h2>Breed scholingsconcept </h2><p>Verder zijn we\nvoorstanders van een "breed scholingsconcept". Hiermee bedoelen we\ndat we naast de intellectuele ontwikkeling ook grote waarde hechten aan de\nsociale, creatieve en emotionele groei. Dit omdat onderwijs en opvoeding\nvolgens ons beide belangrijk zijn voor een harmonieuze ontwikkeling en niet\necht te scheiden. Daarbij merken we op dat ons zwaartepunt ligt bij de\nverwerving van basisvaardigheden zoals lezen, taal, schrijven en rekenen.\nHieraan besteden we, zeker vanaf groep 3, ook meer dan de helft van onze\nlesuren.</p>
996	<h3>Eigen ontwikkeling is het uitgangspunt</h3><p>Wanneer een vierjarig kind bij ons op school komt,\nkrijgt hij/zij ontwikkelingsgericht onderwijs. We bedoelen hiermee, dat de\neigen ontwikkeling van het kind uitgangspunt is. Er wordt uitgegaan van wat het\nkind al weet, kent en kan. Vervolgens worden activiteiten aangeboden, die hem\nof haar een stapje verder ontwikkelen. Daarbij wordt uitgegaan van\ntotaalontwikkeling. Bij jonge kinderen kunnen de verschillende\nontwikkelingsgebieden niet gescheiden worden. En daarbij is spelen gelijk aan\nleren. Betrokkenheid is belangrijk. Daarom vloeien de verschillende\nactiviteiten voort uit thema's, die de interesse hebben van de kinderen. Door\nhun enthousiasme zijn ze intensief bezig met de activiteiten en ontwikkelen ze\nzich breed. Het is logisch dat hierbij de interactie en communicatie tussen de\nkinderen onderling en evenzo de kinderen en de leerkracht belangrijk is.</p>
