1001	<h1>Over de school</h1><p>De Moordrechtse basisscholen De Rank en De Sjaloom krijgen een nieuw ultramodern schoolgebouw in de wijk Vijfakkers-Noord. De twee protestants-christelijke scholen gaan samen.</p><p>Het gemeentebestuur van Moordrecht heeft ingestemd met de nieuwbouw voor de scholen. Voor het nieuwe schoolgebouw zijn vier mogelijke plekken onderzocht. Een duidelijke voorkeur heeft de gemeente voor de locatie Vijfakkers-Noord, ten noorden van basisschool de Achtbaan. Het college ziet hier mogelijkheden om op deze plek ook andere functies aan het schoolgebouw te geven. Zo wordt er aan gedacht om er ook een brede school te huisvesten waar bijvoorbeeld wijkactiviteiten gehouden en kinderen buiten schooltijden opgevangen kunnen worden.</p>
1501	<p>Kinderen hebben een eigen ontwikkelingskracht en zijn tegelijk afhankelijk van hun omgeving. De Plaswijckschool kiest ervoor om het kind centraal te stellen tijdens de lessen en niet de leerstof. De leerkrachten zorgen voor een uitdagende leeromgeving, zodat kinderen gemotiveerd worden om mee te doen. Doordat leerlingen worden uitgedaagd, zijn ze persoonlijk betrokken en zullen ze zelf initatieven nemen. Dit heeft een positieve uitwerking op het zelfvertrouwen en het plezier van de kinderen.</p>
