2012	<h2>Ouderenquête 2011</h2><p>De ouderenquête is door ruim 50% van de gezinnen ingevuld. Hartelijk dank daarvoor! Samen gaf u ons als Kon. Wilhelminaschool gemiddeld een ruim voldoende.<br/>We stelden u ruim 40 vragen over een 7-tal items die u kon waarderen met 1 t/m 4. Volgens de landelijke norm is een gemiddelde onder 2.50 onvoldoende, 2.50 tot 3.00 is matig, 3.00 tot 3.25 is voldoende, 3.25 tot 3.50 ruim voldoende en boven 3.50 is goed.</p>
