1564	<p>Overblijven (Tussenschoolse Opvang – TSO)<br/>Tijdens de middagpauzes kunnen de leerlingen opschool blijven. Een groep ouders is verantwoordelijkheid voor de leerlingen tijdens het eten en het spelen. Er wordt in drie groepen gegeten (groepen 1-2, 3 t/m 5 en 6 t/m 8).</p>
