1502	<p>In de groepen wordt geobserveerd hoe leerlingen zich ontwikkelen, op cognitief en sociaal/emotioneel gebied. Met behulp van de methodegebonden toetsen en de CITO toetsen worden ontwikkelingen van individuele leerlingen nauwlettend gevolgd en vervolgens verwerkt in ons leerlingvolgsysteem.<br/>Kinderen die op een bepaald gebied onder– of bovengemiddeld scoren worden besproken in de leerling-besprekingen, geleid door de interne begeleiders. Als een kind structurele hulp nodig heeft, wordt er voor deze leerlingen een handelingsplan opgesteld. De ouders/verzorgers worden betrokken bij het opstellen van het plan en de eventuele inschakeling van professionele begeleiding. <br/>Een paar keer per jaar komt de plusgroep een periode bij elkaar. In deze groep zitten meer- en hoogbegaafde leerlingen die extra uitdaging wordt aangeboden door middel van pluswerk op het gebied van een vreemde taal, techniek of wereldoriëntatie. </p>
