1422	<h2>Rondleiding</h2><p>Voor een informatief gesprek en een rondleiding stellen we het op prijs als u daarvoor met ons een afspraak maakt.<br/>Voor zowel de schoolgids als de rondleiding kunt u contact opnemen met de school.<br/>Telefoonnummer 0182 - 513746 of via de e-mail wilhelminaschool@d4w.nl</p>
2013	<h1>Pedagogisch klimaat</h1><p><br/>Een gezond pedagogisch klimaat is voor leerlingen een voorwaarde om tot leren te komen. Een veilige omgeving, ontspannen sfeer en respectvolle omgang met elkaar zijn onderdelen waaraan op school veel aandacht wordt besteed.</p><p>In de sociaal-emotionele lessen worden aan de leerlingen sociale vaardigheden aangeleerd en maken we afspraken over de wijze waarop we verwachten dat leerlingen met elkaar omgaan. <br/>De leerkrachten zijn in het bezit van een licentie voor de Kanjertraining. Wekelijks wordt er een kanjerles gegeven. Deze lessen bieden handvatten over omgaan met elkaar, zelfvertrouwen en weerbaarheid.  <br/>Team en leerlingen zijn samen verantwoordelijk voor de sfeer in de groep. Om dit ook zo te ervaren organiseren we meerdere keren per jaar een groepsdoorbrekende activiteit. Leerlingen uit alle groepen vormen samen een groep en voeren een opdracht uit of doen met elkaar spelletjes. Op die manier leren alle kinderen elkaar kennen en werken zij met elkaar aan een gemeenschappelijk doel. </p>
1788	<h1>Wie was Da Costa?</h1>
526	<p><br/>Het werken aan sociale vaardigheden is een belangrijke doelstelling binnen het onderwijs. Door onder andere methodes te gebruiken die op sociale vaardigheden gericht zijn, proberen wij hieraan een bijdrage te leveren. In de school ziet u overal onze schoolregels. Deze geven aan hoe wij met elkaar willen omgaan. De regels gaan uit van het positieve standpunt: ‘Zo doen wij het hier’.<br/>De groep en de leerkracht bespreken de regels en maken zo nodig daar eigen routines bij: ze geven een concrete inhoud aan deze regels. Hierdoor worden het hun regels.<br/>Onze school hanteert vijf hoofdregels. Die regels zijn gevisualiseerd in pictogrammen die overal in school hangen, zowel in gangen als in de klas. </p>\n<h3>- Ik, jij, hij of zij… iedereen hoort erbij!<br/>- Als de ander praat, ben je stil. Dan hoor je wat die zeggen wil!<br/>- Pesten is nooit goed. Zorg dus dat je aardig doet!<br/>- Slaan of schoppen? Daar moet je snel mee stoppen!<br/>- Alle dingen hebben een doel. Kapotmaken is niet cool!</h3>\n<p><br/>Daarnaast is er nog een pleinregel en een werkplekregel.</p>\n<h3>- Rennen doe je op het schoolplein. Binnen moet je rustig zijn!<br/>- Op de gang werk je stil, omdat iedereen goed werken wil!</h3>\n<p><br/>Opvoeden kunnen wij echter niet alleen. Daarom willen wij een goede samenwerking met de ouder(s)/verzorger(s), met de bedoeling dat de leerlingen een duidelijk beeld krijgen van wat wenselijk gedrag is. Zo is er een positieve wisselwerking: de school sluit zoveel mogelijk aan bij de opvoeding thuis.<br/>We stellen het zeer op prijs als u ook thuis aan alle zeven regels aandacht besteed. </p>
1653	<h1><strong>Onze visie op onze christelijke identiteit.</strong></h1>\n<p>Wij werken vanuit een protestants-christelijke achtergrond en respecteren dat andere geloven naast het christendom bestaan. </p>\n<p>Onze identiteit wordt ook bepaald door respectvolle omgang met elkaar, de maatschappij en de ander.<br/>Wij hechten daarbij aan de volgende waarden:<br/>Liefde – Welke wij toepassen in onze christelijke school en wat ondere andere tot uitdrukking komt in integriteit, zelfreflectie, dienstbaarheid, vertrouwen en respect.<br/>Kwaliteit – De persoonlijke ontwikkeling van zowel de mens (kind en volwassenen) als de professional (team).<br/>Groei – Het steeds weer zoeken naar nieuwe perspectieven en mogelijkheden om het nog beter te doen.</p>
1605	<h1><strong>Hieronder vindt u ons vakantierooster</strong></h1><p>Herfstvakantie: maandag 21 okt t/m vrijdag 25 okt</p>\n<p>Kerstvakantie: maandag 23 dec t/m vrijdag 03 jan</p>\n<p>Voorjaarsvakantie: maandag 17 feb t/m vrijdag 21 feb</p>\n<p>Meivakantie: maandag 28 apr t/m vrijdag 09 mei</p><p>Lang weekend: maandag 06 juni t/m dinsdag 10 juni</p>\n<p>Zomervakantie: maandag 21 juli t/m vrijdag 29 aug</p>
1158	<p><br/>De schoolraad is samengesteld uit ouders/verzorgers binnen de school die zich beschikbaar hebben gesteld en die de grondslag van de stichting onderschrijven en actief belijden. Zij denken mee over het heden en de toekomst van de school en over de veranderingen die onderweg daar naar toe zullen plaatsvinden heeft primair tot taak het actief stimuleren en bewaken van de identiteitsontwikkeling van de school en het onderwijs, met in het verlengde daarvan de kwaliteit van het onderwijs. De schoolraad is zo het adviesorgaan van de directie, vanuit het perspectief van ouders/verzorgers en de lokale gemeenschap- handelt hierbij volgens het identiteitsstatuut van de stichting 'De Vier Windstreken' (op school na te vragen) - vaardigt één lid, desgewenst twee leden, af naar de sollicitatiecommissie bij de benoeming van personeel, mede in relatie tot haar taak 'het actief stimuleren en bewaken van de identiteit van de school en het onderwijs' - vaardigt twee leden af naar de raad van advies van de stichting- heeft minimaal één keer per jaar overleg met een contact-bestuurslid van het algemeen bestuur en verder zoveel vaker als gewenst en noodzakelijk is </p>\n<p>Zittingsduur en rooster van aftreden:Leden van de schoolraad worden gekozen voor een periode van vier jaar en kunnen op basis van herverkiezing tweemaal worden herbenoemd.Het periodiek aftreden van de leden van de schoolraad geschiedt volgens een op te stellen rooster van aftreden. </p>\n<p>Overleg schoolraad met de ouders en verzorgers:De schoolraad stelt de ouders/verzorgers van de leerlingen van de school ten minste één maal per jaar in de gelegenheid om tijdens een daartoe door de schoolraad te beleggen vergadering de algemene gang van zaken in de school te bespreken. </p>
1157	<p><br/>De teamleden werken vanuit de visie van de school en hebben een christelijke levensovertuiging. Elke leerkracht zet zich in om zijn/haar eigen groep zo goed mogelijk te begeleiden. Met parttimers vindt er onderling veelvuldig overleg plaats. Wij hebben een team waarin zowel mannen als vrouwen, jongeren en ouderen vertegenwoordigd zijn. Het is een betrokken team dat in onderzoeksgroepen werkt aan schoolontwikkeling. Dit gebeurt in een klimaat waarin we elkaar ondersteunen en waarin we met en van elkaar leren. Wij vinden het als team plezierig om te weten of om te vertellen hoe het gaat met een leerling. </p>\n<p>We realiseren ons dat wij een voorbeeldfunctie voor de kinderen hebben. Op school noemen de kinderen de leerkrachten ‘juf’ of ‘meester’ en noemen daar eventueel de voornaam bij. Als leerkrachten willen wij graag dat kinderen met plezier naar school gaan. We willen lesgeven op een manier die zowel bij de kinderen als bij ons als team past.</p>
1168	<p><br/>De scholen van ‘De Vier Windstreken’ zijn open protestants-christelijke scholen; d.w.z. ze willen vanuit een protestants-christelijke identiteit vorm en inhoud geven aan het onderwijs. <br/>Het uitgangspunt bij alle beleidskeuzen is: zoeken naar wat bindt. De protestants-christelijke identiteit van de school loopt als een rode draad door de schoolactiviteiten, zoals: de keuze van de methodes, de taal die gesproken wordt en de omgang met de kinderen en met elkaar. De identiteit is bijvoorbeeld zichtbaar in de vieringen van de christelijke feesten, in de projecten van ‘Kerk en School’ en rondom bid- en dankdagen. Ook is dit zichtbaar in de praktische vertaling van het begrip ‘omzien naar de ander’, door bijvoorbeeld een actie voor een school of een project in een ontwikkelingsland. De identiteit is mede merkbaar in de manier waarop wij met elkaar omgaan en bij het omzien naar elkaar in blijde en droevige gebeurtenissen. Wanneer ouder(s)/verzorger(s) besluiten om voor onze school te kiezen, verwachten wij dat de kinderen deelnemen aan alle activiteiten. Ook kinderen die niet vanuit een christelijke achtergrond worden opgevoed, zijn bij ons van harte welkom, mits zij respect hebben voor de manier waarop wij met ons geloof omgaan. Van onze kant hebben wij respect als ouder(s)/verzorger(s) ervoor kiezen het geloof op een eigen manier vorm te geven. De leerlingen mogen daarover in de groep vertellen en wij verwachten van de andere leerlingen een respectvolle houding. </p>
1161	<p><br/>Toen de Immanuëlschool deel ging uitmaken van ‘De Vier Windstreken’ is de <br/>‘Vereniging een school met de Bijbel te Oudewater’ opgeheven. Het plaatselijk bestuur van de ‘Vereniging een school met de Bijbel te Oudewater’ is schoolraad geworden en de financiële middelen zijn overgedragen naar de vereniging <em>Vrienden van de Immanuëlschool</em>. Deze vereniging schenkt regelmatig geld uit het vermogen van de voormalige vereniging voor doelen die kwaliteit en de identiteit van de Immanuëlschool ten goede komen (bijv. de bijbels voor de leerlingen van groep 8, vrijwilligersavond, nieuwbouw).<br/>Het gaat hierbij strikt om zaken die gerelateerd zijn aan de identiteit van de school en die niet bekostigd worden vanuit de overheid. <br/>Wij stellen het op prijs als u lid wordt van deze vereniging. U kunt hiervoor contact opnemen met school. Wij geven u dan de contactgegevens door van de secretaris van de Vrienden Van.</p>
1202	<p><br/>Wij maken werk van adaptief onderwijs. Dit betekent dat wij met ons onderwijs zoveel mogelijk aansluiten bij de individuele mogelijkheden van elk kind. We werken aan een goede relatie met alle kinderen. Goede interactie bevordert immers het aansluiten bij de individuele mogelijkheden van ieder kind. Wij bevorderen het zelfvertrouwen en het welbevinden van kinderen om een goede ontwikkeling mogelijk te maken. Omdat wij op de Immanuelschool van alle kinderen een goed beeld willen hebben, volgen wij de ontwikkeling van kinderen. Pas dan kunnen we met ons onderwijs goed aansluiten bij de mogelijkheden van het kind. Kennisoverdracht is belangrijk, maar het aanbod kan van kind tot kind op onderdelen verschillen. Wij gebruiken goede en zorgvuldig gekozen methodes om de kerndoelen van het onderwijs te realiseren. Soms moeten kinderen leerstof alleen verwerken. Daarnaast streven wij in leersituaties naar samenwerking tussen leerlingen.<br/>Wij willen bijdragen aan een school die zich voortdurend ontwikkelt om tegemoet te komen aan de continue ontwikkeling van kinderen. Op deze manier borgen wij de kwaliteit van ons onderwijs. Het gebruik van moderne media, waaronder ICT, maakt deel uit van onze manier van werken. Nieuwe onderwijskundige ontwikkelingen worden getoetst aan onze visie en, indien wenselijk, geïntegreerd in de wijze van werken.</p>
345	<h2>Klachtenregeling</h2><p><br/>Overal waar gewerkt wordt, ontstaan wel eens misverstanden of worden er fouten gemaakt, dus ook op school, de school van uw kind. Die misverstanden of fouten moeten natuurlijk wel uitgepraat en opgelost worden. Als ouder richt u zich in eerste instantie tot de leerkracht van uw kind en/of andere direct betrokkenen om over zaken waar u zich niet in kunt vinden te overleggen. Ons streven is dat elke leerkracht u en/of uw kind altijd serieus neemt en goed naar u en/of uw kind luistert en samen met u en/of uw kind naar de best mogelijke oplossing zoekt. Mocht u het gevoel krijgen dat u niet serieus genomen wordt of komt u er met de leerkracht niet uit, dan kunt u de zaak bespreken met de directie of de contactpersoon van de school. De contactpersoon heeft tot taak uw klacht aan te horen, u door te verwijzen naar de directie of eventueel naar een andere instantie.</p><p>Mocht de kwestie na overleg met de directie voor u alsnog niet op een bevredigende wijze zijn opgelost, dan kunt u uw klacht neerleggen bij de voorzitter van het College van Bestuur van De Vier Windstreken. U kunt ook contact opnemen met de vertrouwenspersoon (zie hierna). Op grond van de klachtenregeling staat het u ook vrij direct een klacht in te dienen bij de Landelijke Klachtencommissie Primair Onderwijs waarbij D4W is aangesloten. Het beleid van de Landelijke Klachtencommissie Primair Onderwijs is er evenwel op gericht dat klachten binnen de (school)organisatie zelf worden opgelost. In het kader van dit beleid verwijst de Landelijke Klachtencommissie Primair Onderwijs zaken die nog niet voldoende binnen de organisatie zelf zijn behandeld, naar de organisatie terug teneinde te bewerkstelligen dat binnen de organisatie alle wegen worden bewandeld om tot oplossing van de klacht te komen. Kan de klacht niet naar tevredenheid worden opgelost, dan neemt de Landelijke Klachtencommissie de klacht uiteraard in behandeling. Gelet op het beleid van de Landelijke Klachtencommissie Primair Onderwijs geven wij u dringend in overweging een klacht in eerste instantie op te lossen op schoolniveau en – indien dit niet leidt tot een voor u bevredigende uitkomst – de zaak voor te leggen aan de voorzitter van het College van Bestuur van D4W.</p><p><strong>Contactgegevens voorzitter College van Bestuur</strong><br/>Dhr. A.C. van Duijvenbooden,<br/>Postbus 2061<br/>2800 BE Gouda<br/>0182 526719<br/>Arjen.van.duijvenbooden@d4w.nl</p><p><strong>Contactgegevens Landelijke Klachtencommissie Primair Onderwijs</strong><br/>Landelijke Klachtencommissie Primair Onderwijs<br/>Postbus 82324<br/>2508 EH Den Haag <br/>070 3861697<br/>info@klachtencommissie.org </p><p>Bij klachten over seksueel geweld of seksuele intimidatie verzoeken we u direct de directeur van de school of de voorzitter van het college van Bestuur van D4W hiervan in kennis te stellen. Ook kunt u direct contact opnemen met de vertrouwensinspecteur, telefoonnummer: 0900 1113111</p>
1463	<h2>Identiteit</h2><p>Onze school is een protestants-christelijke basisschool. Vanuit een christelijke visie op maatschappij en samenleving wordt les gegeven en zo samen met de ouders de opvoeding op dit punt gestalte gegeven. We baseren ons op de tien woorden die in de bijbel te vinden zijn en worden samengevat in de woorden van Jezus: "Heb God lief boven alles en je naaste als jezelf". Wij zijn een school waar ieder elkaar kent. Wij staan open voor andersdenkenden, maar we vragen wel onze christelijke identiteit te respecteren.</p>\n\n\n\n
2108	<p>De Prinses Beatrixschool is een school die voor alle leerlingen veilig is. Dit houdt in dat leerlingen mogen zijn zoals ze zijn, dat leerkrachten er zijn voor de kinderen en belangstelling tonen voor de leefwereld van het kind.</p>\n<p>Een goed pedagogisch klimaat is belangrijk voor het welbevinden van het kind. Alleen een kind dat “lekker in zijn vel zit” komt tot goede prestaties.</p>\n<p>Wij stimuleren de leerlingen:</p>\n<p>- leergierig te zijn.</p>\n<p>- positief in het leven te staan</p>\n<p>- zelfstandig en geconcentreerd te werken.</p>\n<p>- zelf of samen met anderen oplossingen te zoeken.</p>\n<p>- hun gevoelens te uiten.</p>\n<p>- hun eigen leergedrag te kennen en eventueel te verbeteren.</p>\n<p>- goed met hun medeleerlingen om te gaan.</p>\n<p>Wij begeleiden emoties: troosten bij verdriet, geven rust bij woede, delen in vreugde en blijdschap.</p>\n<p>Wij zorgen dat de leeromgeving van de leerlingen opgeruimd en hygiënisch is.</p>\n<p>In de pauze is er pleinwacht. Problemen worden opgelost en indien nodig doorgespeeld naar de leerkracht van de betreffende leerling.</p>\n<p>Onderwijs</p>\n<p>De Prinses Beatrixschool is een school die wil bereiken dat ieder kind via een ononderbroken leer- en ontwikkelingsproces, die kennis en vaardigheden kan verwerven die het nodig heeft om een zelfstandig, sociaal en kritisch denkend mens te worden in een multiculturele samenleving.</p>\n<p>Dit gaat het beste in een omgeving waar de leerlingen zich thuis voelen.</p>\n<p>We zetten ons in voor het versterken en verbeteren van het klassen- en schoolklimaat.</p>\n<p>De in gebruik zijnde en nog aan te schaffen onderwijsleerpakketten waarborgen het bovengenoemde leerproces en de wettelijke plicht om aan de kerndoelen te voldoen.</p>\n<p>Wij zijn een school:</p>\n<p>- waar steeds meer projectmatig wordt gewerkt.</p>\n<p>- met een actueel onderwijsaanbod en waar gewerkt wordt aan adaptief onderwijs.</p>\n<p>- Waar leerlingen deelnemen aan de door school georganiseerde activiteiten.</p>\n<p>We bieden gestructureerd onderwijs: we hebben duidelijke regels en afspraken, waarbij het leren omgaan met elkaar en het samenwerken belangrijk zijn. Leerkrachten in een duobaan hanteren dezelfde regels, er is overleg als duo’s wisselen. Er zijn regels, die in de hele school gelden.</p>\n<p>We gebruiken een keuzebord, een programma op het bord , een agenda, dagritmekaarten en een werkwinkel, om te leren plannen. Naast de cognitieve overdracht vinden wij de sociaal-emotionele ontwikkeling erg belangrijk. Daarom besteden wij ruime aandacht aan de sociale vaardigheden, o.a. door gebruik van een methode.</p>\n<p>Motto: De Prinses Beatrixschool :</p>
2065	<p>De Schoolraad (SR)<br/>De Schoolraad is opgericht op 1 januari 2008. Sinds die datum bestaat er geen lokaal<br/>bestuur meer. De verantwoordelijkheid voor de school ligt vanaf die datum bij het<br/>Algemeen Bestuur van Stichting P.C.P.O "De Vier Windstreken". Iedere school van de<br/>stichting heeft een eigen Schoolraad. De Schoolraad is opgericht omdat de inbreng en<br/>betrokkenheid van ouders, met name op het gebied van de Protestants Christelijke<br/>identiteit, erg gewenst is. De Schoolraad bestaat uit minimaal 4 en maximaal 9 leden. De<br/>leden van de Schoolraad zijn ouders van leerlingen op school. Iedere ouder die zich<br/>betrokken voelt bij de Protestant Christelijke identiteit van de school zoals verwoord in<br/>de grondslag van Stichting P.C.P.O "De Vier Windstreken", deze onderschrijft en ook<br/>actief belijdt, kan zich aanmelden voor de Schoolraad.<br/>De taken van de Schoolraad zijn het bewaken van de Protestants Christelijke identiteit<br/>en het in de gaten houden van de kwaliteit van het onderwijs. Verder is zij een klankbord<br/>voor de directie en heeft zij een antennefunctie. De Schoolraad vertegenwoordigt de<br/>stem van de ouders bij de directie. Ze denkt mee en heeft een adviserende en<br/>stimulerende functie richting de directie. Ook heeft de Schoolraad het recht zitting te<br/>nemen in de sollicitatiecommissie bij het aannemen van nieuwe leerkrachten. Dit<br/>schooljaar 2011-2012 telt de Schoolraad 7 leden: Ineke Reichard, Martin Rook, José<br/>Both, Marc Lansink, Evie Tupan, Ilse Verduijn en Carolien van den Boomgaard<br/>(voorzitter). Het e-mailadres van de Schoolraad is: schoolraad.sjaloom-rank@d4w.nl.<br/>Als u een vraag heeft aan de leden van de Schoolraad kunt u hen aanspreken op het<br/>schoolplein of u kunt contact opnemen met de Schoolraad via het e-mailadres.</p>
2066	<p>De Medezeggenschapsraad (MR)<br/>Wat is medezeggenschap?<br/>De wettelijke regels voor medezeggenschap zijn vastgelegd in de Wet<br/>Medezeggenschap op Scholen (WMS). Deze wet biedt een stevige basis voor de positie<br/>van de medezeggenschapsraad in school. De wet bevat veel mogelijkheden om als<br/>ouder en leerkracht mee te denken en mee te beslissen over het reilen en zeilen van de<br/>school.<br/>Wat doet de MR?<br/>De medezeggenschapsraad denkt en beslist mee over schoolzaken en levert daarmee<br/>een bijdrage aan de kwaliteit van het onderwijs op school. De raad heeft daarvoor<br/>regelmatig overleg met de directie en/of de Schoolraad. Dit overleg gaat onder andere<br/>over zaken als de bestedingen van geld, de Ouderbijdrage, het vaststellen van vakanties<br/>en vrije dagen, veiligheid op en rondom de school, klachtenregeling, schoolgids,<br/>tussenschoolse opvang, discriminatie en fusie.<br/>Wat zijn de rechten van de MR?<br/>Over sommige onderwerpen adviseert de medezeggenschapsraad de directie en er zijn<br/>ook zaken waarin de MR een zwaardere stem heeft via haar instemmingsrecht. De<br/>Medezeggenschapsraad moet dus goed geïnformeerd en betrokken worden bij het<br/>beleid dat voor de school ontwikkeld wordt.<br/>Wat is de positie van de Gemeenschappelijke Medezeggenschaps Raad (GMR)?<br/>De medezeggenschapsraad van zowel de SmdB De Rank als de Sjaloomschool heeft<br/>een afgevaardigde in de GMR van de stichting “De Vier Windstreken”. Binnen deze<br/>Schoolgids SmdB de Rank-Sjaloomschool 25 2011- 2012<br/>stichting zijn 17 scholen aangesloten. Een aantal aspecten van de<br/>medezeggenschapsraad zijn gedelegeerd naar de GMR.<br/>Wat is de samenstelling van de MR?<br/>In 2009 is besloten door de Medezeggenschapsraden van de Sjaloomschool en SmdB<br/>De Rank om in het kader van de naderende fusie gemeenschappelijk te gaan<br/>vergaderen, waarbij de belangen van beide scholen aan de orde komen. Ook is besloten<br/>dat deze gezamenlijke MR uit acht leden zal bestaan. Beide scholen zullen 4 leden<br/>inbrengen: twee ouders en twee leerkrachten. Deze leden worden voor een periode van<br/>3 jaar gekozen waarna herverkiezing kan plaatsvinden.<br/>Wat zijn de aandachtsgebieden van de MR in het komende jaar?<br/>Dit jaar zal de fusie tussen beide scholen een belangrijk aandachtspunt zijn. Tevens<br/>hopen we dat de nieuwbouwplannen eindelijk verwezenlijkt worden. De<br/>informatievoorziening over deze beide punten naar u, als ouders van de leerlingen op<br/>onze school, staat hoog op de agenda. Uiteraard zullen wij ook de overige zaken niet uit<br/>het oog verliezen.<br/>U kunt de leden van de Medezeggenschapsraad altijd aanspreken over allerlei zaken<br/>die de school aangaan en waar u met de leerkrachten en/of de directeur niet uitkomt.<br/>Het zal niet zo zijn dat we al uw problemen kunnen oplossen maar wij doen ons best<br/>om dergelijke zaken bespreekbaar te maken.</p>
2387	<p><strong>Aanmelden</strong></p>\n<p>Onze school is een Protestants Christelijke school en staat open voor kinderen van allerlei levensbeschouwingen. In een persoonlijk gesprek met de directie kunt u informatie krijgen over het karakter van de school, de Protestants Christelijke identiteit, en onze verwachtingen t.a.v. het meedoen aan de daaruit voortvloeiende activiteiten en alles waar u verder in geïnteresseerd bent. Neemt u contact met ons op om een afspraak te maken.</p>
1776	<p>In ons onderwijs zorgen we voor een rijke leeromgeving. Diverse werkvormen worden benut om zowel samenwerking als zelfstandigheid te bevorderen. Via duidelijke leerlijnen en instructiemodellen werken we toe naar de eind- of kerndoelen die gelden voor het basisonderwijs en komen zo veel als mogelijk is tegemoet aan de verschillen tussen kinderen. Hiervoor maken we gebruik van goede en moderne methoden. Wij besteden veel aandacht aan zorg . Dit leggen we vast in handelingsplannen, waarover met u als ouder gecommuniceerd wordt. Naast de ontwikkeling op de reguliere vakgebieden hebben we ook oog voor de creatieve en sociaal emotionele ontwikkeling. We werken toe naar een goede overstap naar het voortgezet onderwijs. In ons onderwijs zien we de computer als ondersteunend middel. Op school werken we vanuit een goede relatie met elkaar: kinderen, ouders en leerkrachten. Dit uit zich in enthousiasme, betrokkenheid en plezier in het dagelijks werk. We voelen  ons samen met de ouders verantwoordelijk voor de algehele ontwikkeling van de kinderen en betrekken hen bij onderwijsondersteunende en praktische zaken op school.</p>
1754	<h2>Een goede basis...</h2><p><br/>In het onderwijs hebben wij de keuze gemaakt te investeren in de basis: taal, rekenen en lezen, differentiatie en een goed schoolklimaat.</p><p>Dit is heel belangrijk om goed te kunnen functioneren in onze maatschappij. Zonder een goede beheersing hiervan vindt een kind niet meer de aansluiting die het nodig heeft. Denk maar aan alle informatie die op je afkomt via tv, internet, regelgeving etc.</p><p>Differentiatie houdt in dat we proberen elk kind zoveel mogelijk op zijn of haar niveau aan te spreken binnen de klas. Vervolgens proberen we het kind het volgende stapje te laten maken, zodat het zich verder ontwikkelt.</p><p>Dit alles proberen we te doen in een schoolklimaat waarin elk kind zich thuis voelt.<br/>Natuurlijk vergeten we de andere vakgebieden niet, maar dit zijn enkele speerpunten, waarmee we elk kind willen voorbereiden op ... </p><h2>                                                een goede toekomst.</h2>
1462	<h2>Visie</h2>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p>Wij willen ervoor zorgen dat kinderen met plezier naar school gaan en zich in een veilige (leer)omgeving op onze school ontwikkelen tot competente mensen. Op onze school leren wij de kinderen:<br/>• zelfstandig te zijn en tot verantwoorde keuzes te komen<br/>• samen te werken<br/>• respectvol met elkaar om te gaan<br/>• zorgzaam te zijn<br/>• de ander te accepteren zoals hij / zij is<br/>• verschillend te mogen zijn<br/>• met zorg met materialen om te gaan<br/>• hun talenten te ontdekken en in te zetten</p>
2390	<p>De medezeggenschapsraad denkt en beslist mee over schoolzaken en levert daarmee een bijdrage aan de kwaliteit van het onderwijs op school. De raad heeft daarvoor regelmatig overleg met de directie en/of de Schoolraad. Dit overleg gaat onder andere over zaken als de bestedingen van geld, de Ouderbijdrage, het vaststellen van vakanties en vrije dagen, veiligheid op en rondom de school, klachtenregeling, schoolgids, tussenschoolse opvang, discriminatie en fusie. Over sommige onderwerpen adviseert de medezeggenschapsraad de directie en er zijn ook zaken waarin de MR een zwaardere stem heeft via haar instemmingsrecht. </p>
2325	<p><strong>Missie</strong>\n\n</p><p>Wij willen vanuit de inspiratie die we putten uit Gods Woord, de Bijbel, in een respectvolle en veilige sfeer de kinderen leren samen te werken, op een zelfstandige manier kennis op te doen en vaardigheden te ontwikkelen die nodig zijn om op te groeien tot  een zelfverantwoordelijke volwassene.\n</p><p><strong>Visie</strong>\n\n</p><p>De kernwaarden voor onze school worden vertaald naar de dagelijkse praktijk in de school en hoe wij met kinderen omgaan in de school.\n\nDeze zijn:\n<br/>Wij geven goed onderwijs op basis van de PC-identiteit met ruimte voor levensbeschouwelijke diversiteit.\n<br/>Wij vertrouwen en respecteren elkaar. \n<br/>Wij sluiten aan bij de vragen en de ontwikkeling van het kind, waarbij de onderwijskundige ontwikkeling centraal staat. <br/>We zetten het kind centraal en proberen eruit te halen wat erin zit.\n</p>
1778	<div>In het lesgeven uit dit zich in het respecteren van elkaar en het zorgvuldig omgaan met elkaar. Elke schooldag wordt geopend en afgesloten met gebed of een lied. Elke dag wordt een verhaal verteld. Dit kan een bijbelverhaal zijn dat bewerkt is voor kinderen of een verhaal rond een thema. Hierbij wordt de viertafel gebruikt die in elke klas staat. In groep 8 krijgen de leerlingen hun eigen bijbel, waaruit ze ook regelmatig op school lezen. Regelmatig zingen we bijbelse liederen. We vieren natuurlijk ook de christelijke feesten. Zo vieren we het kerstfeest met de hele school in de kerk en wordt Pasen gezamenlijk in de school gevierd. Daarnaast hebben we elke maand een viering met de hele school. Het godsdienstonderwijs is misschien in eerste instantie het vak waaraan men de identiteit van een school moet kunnen aflezen. Maar het is ook zo dat die identiteit niet alleen op het eerste halfuur van de dag terug te vinden moet zijn. We proberen daarom op basis van onze christelijke achtergrond met elkaar om te gaan.</div>
