1797	<h2>Wat doet de schoolraad?</h2><p>De doelstelling van de schoolraad is als volgt omschreven: </p><div>Het borgen van de identiteit van de school en het meedenken over de kwaliteit van het onderwijs op de school.</div><p>Opdracht aan de schoolraad is om ‘van buiten naar binnen te brengen’, om datgene wat zich in relatie tot de school voordoet buiten de school (van de directe schoolomgeving tot maatschappelijke ontwikkelingen) in de school bespreekbaar te maken.</p><div>Als schoolraad komen we ongeveer 6 à 8 x per schooljaar samen met de directie bij elkaar om aan de hand van een agenda diverse onderwerpen te bespreken.</div>
