2067	<p>De Oudercommissie (of Ouderraad)<br/>Deze ouders doen heel actief mee bij allerlei praktische activiteiten van de school of van<br/>een bepaalde groep.<br/>Zitting nemen in de Ouderraad gebeurt meestal op uitnodiging van een zittend<br/>Ouderraadslid of het team. Wilt u in deze raad meehelpen, dan stellen we het erg op<br/>prijs als u ons dat laat weten. Daarbij is het noodzakelijk dat men de uitgangspunten<br/>van ons onderwijs respecteert.</p>
