1839	<h1>Klassenouders</h1><p>Een\nbelangrijke rol bij de organisatie van activiteiten met de klas is\nweggelegd voor de klassenouders. Klassenouders zijn zowel voor de leerkracht als voor de\nouders een aanspreekpunt voor allerlei praktische zaken. Het is belangrijk dat de klassenouders de andere\nouders bij de activiteiten in de groep en op school betrekken en een\nstimulerende rol spelen. Natuurlijk hebben ze regelmatig overleg met de\nleerkrachten. Aan het begin van het schooljaar vragen we de ouders zich aan te\nmelden als klassenouder in de\n groep van hun kind(eren). De coördinatoren ouderbetrokkenheid\n(juf Lucia en juf Siska) kiezen in overleg met de leerkrachten klassenouders.\nHet heeft onze voorkeur om twee ouders per groep aan te stellen. </p>
