1889	<h1>Visie</h1>\n<p>- De Eendragt is een school, waar we met elkaar omgaan vanuit het gebod van de Liefde.<br/><br/>- Kinderen leren met plezier in een veilige omgeving. Er is aandacht voor creativiteit, kennis en omgang met elkaar.<br/><br/>- We gaan uit van de belangstelling van het kind waarbij we de leerdoelen goed bewaken.<br/><br/>- We leren de kinderen reflecteren op hun eigen handelen én het nemen van hun verantwoordelijkheid hiervoor.</p>\n<p><br/>Wilt u meer lezen over de visie van onze school, dan kunt u dat vinden in de schoolgids onder de kopjes levensbeschouwelijke visie, pedagogische visie en onderwijskundige visie. Klik voor de schoolgids op onderstaande link.</p>
1924	<h1>Medezeggenschapsraad</h1><p>De\nmedezeggenschapsraad bestaat uit twee onderdelen: de lokale MR en de gemeenschappelijke\nmedezeggenschapsraad (GMR). De GMR is de overkoepelende MR waarin de lokale\nmedezeggenschapsraden van alle scholen van ‘De Vier Windstreken’ zijn\nvertegenwoordigd. Vanuit de Eendragt is één leerkracht vertegenwoordigd. De GMR\nhoudt zich bezig met bovenschoolse zaken. De lokale MR houdt zich vooral bezig\nmet zaken, die direct te maken hebben met de gang van zaken op de Eendragt. Zij\nheeft tot taak alle partijen van de school een stem te geven. Dit gebeurt door\nmiddel van drie soorten rechten, namelijk: 1. adviesrecht, 2. instemmingsrecht,\n3. initiatiefrecht</p>\n\n<p>De\nMR onderhoudt namens team en ouder(s)/verzorger(s) contact met de schoolraad en\ndirectie. Zij maakt zich sterk voor zaken, die iedereen aangaan, zoals deelname\naan de sollicitatiecommissie, het overblijven en veiligheid in en rondom de\nschool.</p>\n\n<p>Volgens\nde Wet Medezeggenschapsraad Onderwijs behoort de MR van het primair onderwijs\nte bestaan uit twee gelijke delegaties van onderwijzende personeelsleden en van\nouders en/of verzorgers. </p>\n\n
1925	<h1>Schoolraad</h1><p class="MsoBodyText">De dagelijkse\nleiding van de school is in handen van de directie en het Algemeen Bestuur van\nDe Vier Windstreken. Om de (plaatselijke) identiteit en de kwaliteit van het\nonderwijs te waarborgen is sinds 1 januari 2008 de schoolraad ingesteld. De\nschoolraad was voorheen het (sectie)bestuur van de Eendragt en kan de directie\n(on)gevraagd advies geven.</p>\n\n\n\n\n\n<p>Taken en bevoegdheden van de schoolraad</p><ol><li>De\nprimaire taak van de schoolraad is het actief stimuleren en bewaken, vanuit het perspectief van de ouders en/of verzorgers\nen de lokale gemeenschap, van de identiteit van de school en het onderwijs, met in het\nverlengde daarvan de kwaliteit van dat onderwijs.</li><li>De\nschoolraad is een adviesorgaan voor de schoolleiding.</li><li>De\nschoolraad heeft zitting in de sollicitatiecommissie van een lid van de\ndirectie, c.q. van een leerkracht van de school met maximaal twee personen.</li><li>De\nschoolraad heeft minimaal één keer per jaar overleg met het contact bestuurslid\nvan het algemeen bestuur (zie ook hierboven) en\nzoveel vaker als gewenst en noodzakelijk is.</li></ol>\n\n
2068	<p>Per groep is er een contactouder.<br/>Hij/zij heeft een lijst van de ouders van leerlingen. Als de groepsleerkracht hulp nodig<br/>heeft bij het organiseren van een verjaardag, een excursie, een buitenles, een sportdag<br/>en dergelijke of als de klas versierd moet worden ter ondersteuning van een thema, dan<br/>kan er een beroep op de contactouder gedaan worden.<br/>De contactouder regelt zo nodig de extra schoonmaak in de klas tijdens het gymuur.<br/>De ouderraad organiseert ook activiteiten. Zij vraagt assistentie van de contactouders.<br/>Voor zover mogelijk wordt er deelgenomen aan plaatselijke en regionale activiteiten. Dit<br/>kunnen sportieve, recreatieve of culturele activiteiten zijn. Een en ander is wel<br/>afhankelijk van de mogelijkheid en bereidheid van ouders om bij vervoer of begeleiding<br/>te helpen. Er zal dan ook met enige regelmaat een beroep op ouders gedaan worden.<br/>Het is dan fijn als er mensen bereid en in staat zijn om mee te doen.<br/>We zijn ons er echter terdege van bewust dat het niet voor iedereen altijd mogelijk is<br/>mee te helpen. Het is dan ook beslist geen verplichting!</p>
