1983	<p>Vanaf groep 5 gaan de leerlingen steeds meer het internet op om informatie te zoeken. Dit stimuleren we als school, want we willen de leerlingen graag de fijne en nuttige kanten van het wereld wijde web laten ontdekken. Tegelijkertijd willen we ook met elkaar afspraken maken om op een veilige manier met internet om te gaan. Daarvoor is een protocol opgesteld, dat we de leerlingen en hun ouders vanaf groep 5 laten ondertekenen.</p>
1984	<p>Ook voor de ouders hebben we 10 tips om hun kinderen te begeleiden bij het juiste en veilige gebruik van internet.</p>
1986	<p>Pesten komt helaas op iedere school voor, ook bij ons. Het is een probleem dat wij onder ogen zien en op onze school serieus aanpakken. Daarvoor hebben we een protocol opgesteld, waarin stap voor stap staat beschreven hoe we met pesten omgaan, wat u van ons kunt verwachten en wat wij van u verwachten.</p>
2328	<p>Onze school is een Protestants Christelijke school en staat open voor kinderen van allerlei levensbeschouwingen. In een persoonlijk gesprek met de directie kunt u informatie krijgen over het karakter van de school, de Protestants Christelijke identiteit, en onze verwachtingen t.a.v. het meedoen aan de daaruit voortvloeiende activiteiten en alles waar u verder in geïnteresseerd bent. Neemt u contact met ons op om een afspraak te maken.</p>
1923	<h1>Ouderraad</h1>\n<p>De ouderraad werkt mee aan activiteiten zoals: de schoolfotograaf, de schoolreisjes, het schoolkamp, de sinterklaasviering, de kerstversiering in de school, christelijke feesten en de sportdag.</p>
1955	<h1>Weekinfo</h1>\n<p>In deze map kunt u de weekinfo nog eens rustig terug lezen.</p>
2069	<p>Het team van overblijfkrachten is een groep van vaste overblijfkrachten bestaand uit<br/>gecertificeerde vrijwilligers. Wij werken zoveel mogelijk met vaste overblijfkrachten die<br/>Schoolgids SmdB de Rank-Sjaloomschool 30 2011- 2012<br/>op vaste dagen werken. Hierdoor wordt de continuïteit gewaarborgd en kan er een<br/>vertrouwensband ontstaan tussen de kinderen en de overblijfkracht. Daarnaast kunnen<br/>wij putten uit vaste invalkrachten bij ziekte, vakantie of ander verzuim van onze vaste<br/>overblijfkrachten. Daarnaast is er op beide locaties een overblijfcoördinator die het<br/>aanspreekpunt is voor de overblijfkrachten en de ouders. De overblijfcoördinator regelt<br/>tevens de dagelijkse gang van zaken van het overblijven op school. Het hele team wordt<br/>aangestuurd door de directie.<br/>De doelstelling is om kinderen een goede middagpauze te geven, met een goed<br/>evenwicht tussen een goede lunch en ontspanning. Voor de ontspanning is er zowel<br/>binnen- als buitenspeelgoed aanwezig. Het gaat hierbij om spelletjes en materialen waar<br/>de kinderen in weinig tijd veel plezier aan kunnen hebben.</p>
1989	<h1>Ons gebouw</h1><p/><p>Ons schoolgebouw staat aan de rand van het dorp Driebruggen.\nHet is een overzichtelijk gebouw uit 2003. De school grenst aan een woonwijk en\naan het weiland. Vanuit school zijn de hazen, ooievaars en de koeien te zien,\niets wat in de randstad redelijk uniek is. \nIn het gebouw is veel lichtinval waardoor de sfeer in school ontspannen\nen vrolijk is. Dit wordt nog versterkt door de gedeeltelijk open\nbovenverdieping. Het lokaal van groep 8 is boven, net als de personeelskamer en\nde ruimtes voor IB, RT en directie. </p>\n\n<p>De overige lokalen en de centrale hal bevinden zich beneden.\n</p>\n\n<p>Het gebouw wordt meerdere keren per jaar thematisch\naangekleed door ouders. De raamschilderingen worden eveneens door ouders\nverzorgd. </p><p/>
1991	<h1>Onze leerlingen en ouders\t</h1><p/><p>De leerlingen en hun ouders komen uit Driebruggen, Waarder\nen Hogebrug. De meeste leerlingen wonen op loopafstand van de school. </p>\n\n<p>Een aantal leerlingen eet tussen de middag op school maar\nveel leerlingen gaan tussen door naar huis of eten bij een oppas of familielid.\n</p>\n\n<p>De schoolpopulatie bestaat uit leerlingen van verschillende (geloofs-)achtergronden.\nZowel leerlingen als ouders komen op school zoveel mogelijk tot hun recht door\nhun kwaliteiten in te zetten daar waar het past. </p><p/>
1994	<h1>Identiteit</h1><p/><p>De Wegwijzer is een Christelijke nationale basisschool. Leerlingen\nzijn welkom bij ons op school ongeacht hun nationaliteit, culturele- en (niet) kerkelijke\nachtergrond. </p>\n\n<p>Het team en directie gaan bij het werken met de kinderen uit\nvan onze protestants-christelijke levensbeschouwing en wij gebruiken de Bijbel\nals leidraad voor het dagelijks handelen op school. </p>\n\n<p>Wij maken de kinderen, eerst door kennis van de Bijbelse\ngeschiedenis en daarna door toepassing daarvan op school, vertrouwd met de Christelijke\nwaarden en normen en het omgaan daarmee in de samenleving.</p>\n\n<p class="MsoHeader">Gedurende het verblijf van de kinderen op onze school\nstreven we ernaar dat ze een zo volledig mogelijke ontwikkeling doormaken,\nrekening houdend met hun individuele kwaliteiten, capaciteiten en achtergrond.\nOns doel is hen zelfvertrouwen te geven en vaardigheden aan te leren zodat ze\nop een zelfstandige manier kunnen functioneren. </p><p>We willen de kinderen de kans geven zichzelf te ontplooien\nzodat ze kunnen deelnemen aan een voortdurend veranderende samenleving.</p><p/>
2120	<p>Aanmelden<br/>Wanneer u op zoek bent naar een basisschool voor uw kind(eren), raden wij u aan tijdig een kijkje te nemen in verschillende scholen in uw wijk. Zo kunt u telefonisch informatie aanvragen en, indien gewenst, meteen een afspraak maken voor een nadere kennismaking. U bent van harte welkom voor een vrijblijvend gesprek en een rondleiding. U kunt onze school onder lestijd bekijken.<br/>Voor kennismaking en aanmelding kunt u contact opnemen met de directie.</p>
1995	<h1>Missie</h1><p/><p class="MsoBodyText3">De Wegwijzer is een\nprotestants-christelijke basisschool voor kinderen van 4 t/m 12 jaar. Wij\nhanteren het leerstofjaarklassensysteem, met veel aandacht voor het individuele\nkind. </p>\n\n<p class="MsoBodyText2">De schoolpopulatie bestaat uit leerlingen van\nverschillende geloofsachtergronden (hervormd, gereformeerd, katholiek,\nislamitisch) of een niet kerkelijk gebonden achtergrond. We hebben een open\naannamebeleid wat betreft de leerlingen, maar we houden vast aan onze eigen\nprotestants christelijke achtergrond. Wij dragen die ook uit en vragen van\nouders en leerlingen daarvoor respect te hebben net zoals wij respect tonen\nvoor de achtergrond van niet protestants-christelijke ouders en kinderen. </p>\n\n<p>Het is ons doel om leerlingen verstandelijk en sociaal te\nhelpen ontwikkelen, zodat ze kunnen doorstromen naar een passende vorm van\nvervolgonderwijs. Wij hechten veel waarde aan de basisvakken lezen, taal en\nrekenen. Daarnaast vinden wij het ook belangrijk dat de kinderen in sociaal en\nmaatschappelijk opzicht vaardig worden en hun kennis vergroten.</p><p/>
1996	<h1>Visie</h1><p/><p>Vanuit onze beschreven missie, hebben wij in het schoolplan\nonze visie op een aantal voor onze school belangrijke onderwerpen beschreven.\nHierbij een samenvatting. Onze volledige visie kunt u nalezen in het schoolplan. </p>\n\n<ul><li>Visie op levensbeschouwelijke identiteit:</li></ul>\n\n<p>De Bijbel, het Woord van God is de basis voor ons handelen.\nOnze school staat open voor ouders en hun kinderen die de grondslag en de\nlevensbeschouwelijke aspecten van onze school respecteren.</p>\n\n<ul><li>Onderwijskundige visie:</li></ul>\n\n<p>Wij vinden het belangrijk om rekening te houden met de\nverschillen tussen de achtergronden en capaciteiten van kinderen. Dit doen we\nvanuit ons klassikale onderwijs, waarbinnen we voldoende mogelijkheden zien om\nzoveel mogelijk rekening te houden met deze verschillen. Daarnaast hechten wij\nveel waarde aan een goed zorgsysteem voor alle leerlingen.</p>\n\n<ul><li> Pedagogische visie:</li></ul>\n\n<p>Op onze school staan kinderen centraal, wij willen dat ze\nelke dag met plezier naar school gaan. Zelfstandig werken, samenwerken, en\nverantwoordelijkheid dragen zijn belangrijke begrippen in ons onderwijs. </p>\n\n<ul><li> Visie op zorg en begeleiding:</li></ul><p>Onze school besteedt veel\naandacht aan leerlingenzorg. Zowel voor kinderen die moeite hebben met de\nleerstof als voor kinderen voor wie de leerstof te makkelijk is hebben wij\nextra aandacht. </p>\n\n<ul><li>Visie op onderwijskundig personeel/beroepshouding:</li></ul>\n\n<p>Op onze school wordt veel waarde gehecht aan goede\nlesgevende capaciteiten van het personeel en een professionele / lerende\ninstelling. </p>\n\n<ul><li>Visie op contacten met ouders:</li></ul>\n\n<p>Contacten met ouders zijn zeer waardevol voor onze school.\nOuders en school hebben een gedeelde verantwoordelijkheid. Zorgvuldige\ncommunicatie en laagdrempeligheid zijn hierbij kernbegrippen. </p><p/>
2359	<h1>Medezeggenschapsraad (MR)</h1>\n\n\n\n\n
2362	<h1>Activiteitencommissie (AC)</h1>
2391	<p>In 2009 is besloten door de Medezeggenschapsraden van de Sjaloomschool en SmdB De Rank om in het kader van de naderende fusie gemeenschappelijk te gaan vergaderen, waarbij de belangen van beide scholen aan de orde komen. Ook is besloten dat deze gezamenlijke MR uit acht leden zal bestaan. Beide scholen zullen 4 leden inbrengen: twee ouders en twee leerkrachten. </p>
2392	<p>U kunt de leden van de Medezeggenschapsraad altijd aanspreken over allerlei zaken die de school aangaan.</p>
1997	<h1>Streefbeelden</h1><p/><p class="MsoBodyText3">Streefbeelden zijn\nbeelden van onze school in de huidige situatie en toekomst. Deze beelden zijn\nbelangrijk voor ons. Veel onderdelen van deze streefbeelden zijn nu al\ngerealiseerd, maar ontwikkeling is op de meeste gebieden nog verder mogelijk.\nOnze streefbeelden: </p>\n\n<ol>\n <li>Op onze\n     school wordt systematisch aandacht geschonken aan de sociaal-emotionele\n     ontwikkeling </li>\n <li>Op\n     onze school wordt gewerkt vanuit het leerstof-jaarklassensysteem, waarbij\n     voor ieder kind gekeken wordt of differentiatie nodig is</li>\n <li>Op\n     onze school bestaat een goede zorgstructuur, waarbij zowel aandacht is\n     voor     minder begaafde kinderen,\n     de gemiddelde leerling,  als voor\n     meer begaafde kinderen</li>\n <li>Alle\n     medewerkers werken (samen) aan hun persoonlijke ontwikkeling, gerelateerd\n     aan de schoolontwikkeling </li>\n <li>Op\n     onze school maken we gebruik van samenwerkend leren</li>\n <li>Op\n     onze school zijn de kinderen zelfstandig en kunnen ze eigen\n     verantwoordelijkheid dragen</li>\n</ol><p/>
1998	<h1>Ouders</h1><p><br/>In onze school zijn ouders van harte welkom. We hebben u graag in de school om ons te helpen; als klassenouder bijvoorbeeld. Of bij het vervoer van en naar allerlei activiteiten.</p><p>Het belangrijkste is echter dat ouders/verzorgers en leerkrachten samen proberen de kinderen te begeleiden op een belangrijk stuk van de weg naar volwassenheid.<br/>Wij vinden het dan ook prettig om zo veel mogelijk met u in gesprek zijn over uw kinderen. Daarvoor mag u gerust de school binnenlopen, zowel bij de leerkrachten als bij de directeur. We zullen tijd vrijmaken om met u over uw kinderen te praten. Zeker wanneer het met uw kind op school niet zo makkelijk gaat zullen we veel contact hebben. Heel belangrijk daarbij is dat we van elkaar weten hoe we de problemen gaan aanpakken en op welke wijze er wordt begeleidt, thuis en op school. </p><p>In de schoolgids kunt u lezen hoe wij de zorg voor de kinderen organiseren. We willen u in dat proces graag zo goed mogelijk op de hoogte houden en waar mogelijk uw hulp vragen. Ook bij de alledaagse gang van zaken kunt u ons helpen. </p><p>Op De Wegwijzer zijn ouders op veel verschillende manieren betrokken bij de school. Uiteraard is iedere ouder vrij om daar zelf keuzes in te maken.<br/>We kennen ouders die deel uitmaken van een raad: de schoolraad, de medezeggenschapsraad en de ouderraad. In dit document kunt u nog meer informatie hierover vinden.</p><p>Daarnaast zijn ouders op allerlei manieren betrokken bij De Wegwijzer.</p>Voorbeelden zijn:<ul><li>leesouders, die kinderen begeleiden bij het lezen in niveaugroepjes</li><li>‘chauffeurouders’, die ons helpen om de kinderen te rijden en begeleiden naar uitstapjes buiten Driebruggen, zoals de bibliotheek, natuurexcursies en het zwembad</li><li>raamverfouders, die ervoor zorgen dat onze school altijd voorzien is van de mooiste verftekeningen</li><li>versiercommissie-ouders die ons helpen de school telkens weer leuk aan te kleden rond een bepaald thema</li><li>klassenouders, die de leerkrachten van een bepaalde groep helpen bij de organisatie van allerlei activiteiten</li><li>sportdagcommissie, ouders die jaarlijks zorgen voor een spetterende sportdag </li><li>luizenpluizers, ouders die na iedere vakantie de leerlingen controleren</li><li>TSO ouders, coördinatoren en hulpouders die er dagelijks voor zorgen dat leerlingen op een gezellige en overzichtelijke manier tussen de middag bij ons op school blijven eten. </li></ul><p><br/>Wij zijn heel erg blij met alle inzet van de ouders. Zo kunnen we met elkaar in een plezierige omgeving kwalitatief goed onderwijs verzorgen!</p>
1999	<h1>Schoolraad (SR)\t</h1><p><br/>Met ingang van januari 2008 is de bestuursstructuur veranderd. Onze school heeft vanaf die tijd geen schoolbestuur meer maar een schoolraad. De schoolraad bestaat uit ouders waarvan de kinderen op onze school zitten. </p><p>De schoolraad heeft als taak het actief stimuleren en bewaken van de identiteit van de school. <br/>Hierbij valt te denken aan de christelijke identiteit, maar ook aan de ‘eigenheid’ van een dorpsschool en de kwaliteit van het onderwijs dat op school wordt gegeven. De schoolraad functioneert als een adviesorgaan voor de directie van de school; als geen ander weten ouders (en verzorgers) immers wat er gaande is rond de school en in de woonomgeving. <br/>Deze taak lag tot voor kort bij het lokaal bestuur van de vereniging, maar is door de nieuwe bestuursstructuur binnen De Vier Windstreken, overgedragen aan de schoolraad. </p><p>De schoolraad houdt één keer per jaar een algemene ouderavond, waarin de eventuele verkiezingen plaatsvinden. Daarnaast zijn er zo’n 6 vergaderingen per jaar. <br/>Aangezien er dit jaar geen nieuwe kandidaten zijn voor de schoolraad blijven de huidige leden de schoolraad vertegenwoordigen. Contactpersoon van onze schoolraad is Jenny Hagoort; zij is tevens de secretaresse. </p>
2000	<h1>Medezeggenschapsraad (MR)</h1><p><br/>De M.R. van onze school bestaat uit twee ouders (de oudergeleding) en twee leerkrachten (de personeelsgeleding). Zij hebben vier jaar zitting in de raad. De raad vergadert over allerlei zaken die te maken hebben met de school. Aan de hand van het M.R.- reglement kan de raad instemming verlenen en adviezen geven over in dit reglement genoemde onderwerpen. Zij onderhoudt contacten met het schoolbestuur, de ouders en het personeel. Via de M.R. kunt u als ouders meedenken over het beleid dat op onze school gevoerd wordt. Hebt u belangstelling voor de M.R.-verslagen, dan kunt u deze inzien. Het M.R.-reglement ligt op school ter inzage. Vraag er even naar bij de directie. Een van de M.R.-leden vertegenwoordigt onze school in de GMR.</p>
2001	<h1>Ouderraad (OR)</h1><p><br/>De ouderraad is samengesteld uit ouders die actief betrokken willen zijn bij onze school. Zij bestaat uit 6 leden die elk vier jaar zitting hebben. </p><p>Taken van de ouderraad zijn: Het team ondersteunen bij Sinterklaasfeest, Kerstfeest, Paasmaaltijd, schoolreizen, sportdagen, verkeersexamen, afscheid groep 8 enz. <br/>Een van de teamleden is altijd aanwezig bij de ouderraadsvergadering. </p><p>In de schoolgids vind u namen van de leden. </p>
2130	<p/><p>Emailadres: prinsesbeatrixschool@d4w.nl</p><p/><p>\nTelefoonnummer: 0172-612878\n</p><p>Adres: Dronenplein 7, 2411 HE Bodegraven\n</p><p/><p/>
2004	<blockquote><h1><br>           De weg naar zelfvertrouwen, zelfstandigheid en doorgaande ontwikkeling.</h1></blockquote><p><br>De Wegwijzer.....</p><p>Is een protestants-christelijke basisschool met ongeveer 120 leerlingen, vijf groepen en in totaal 10 leerkrachten die de hele week of een deel daarvan actief zijn voor de school.</p>
2070	<h1>Schooltijden</h1><p><br/>Groep 1 t/m 8 Maandag t/m vrijdag: 8.30 – 12.00 uur en 13.15 – 15.15 uur.<br/>Groep 1 t/m 8 Woensdag tot 12.15 uur; ’s middags vrij.<br/>Groep 1 t/m 4 Vrijdag tot 12.00 uur; ’s middags vrij.</p>
2396	<p>De school staat altijd open voor ouders om met het onderwijzend personeel te praten, maar liever niet tijdens schooltijd. U kunt beter een afspraak maken met de leerkracht. </p>
1819	<h1>Leerlingenzorg</h1><h2>Leerlingvolgsysteem</h2><p>De resultaten van toetsen,\nobservaties en beschrijvingen, door leerkracht of intern begeleider, leggen we\nvast in ons leerlingvolgsysteem. We leggen de cognitieve en sociaal-emotionele ontwikkeling\nvan kinderen vast, zodat we kunnen bepalen of die ontwikkeling naar wens\nverloopt. Als ouder kunt u de gegevens die we over uw kind opslaan, inzien.\nVanaf groep 3 krijgen kinderen bij het rapport de leerlingenkaart uit het\nleerlingvolgsysteem mee. Aan de hand daarvan kunt u uw kind vergelijken met de\n“gemiddelde” Nederlandse basisschoolleerling.</p><h2>Intern begeleiders</h2><p>Om alle leerlingen de zorg en\naandacht te bieden die nodig is en de leerkrachten daarin te begeleiden heeft\nde school drie intern begeleiders. Ze hebben met de directie regelmatig overleg\nover het onderwijskundig beleid van de school en de zorg voor leerlingen. Zij voeren\nleerlingbesprekingen met groepsleerkrachten, zijn betrokken bij het opstellen\nvan plannen voor extra zorg en gaan na wat het rendement van de extra leerhulp is.\nDaarnaast hebben de intern begeleiders een belangrijke rol op het gebied van de begeleiding van\ngroepsleerkrachten, de\n afstemming van het onderwijs tussen de groepen e.d. Voor\nvragen over de\n ontwikkeling van uw kind kunt u in de eerste plaats terecht\nbij de leerkracht. Maar zonodig kunt u uiteraard een afspraak maken met één van de intern begeleiders,\nNatalie Zuidam,\nAlice Rijneveld\nof Janny Buma.</p>
2201	<p><br/>Informatie voor de ouders</p>\n<p>Aanmelding en inschrijving:<br/>• Gaat u gebruik maken van het overblijven dan vragen wij u om vooraf het aanmeldingsformulier in te vullen en in te leveren bij de overblijfcoördinator of (locatie)directeur. Ook kunt u het downloaden via de schoolsite en ingevuld retour mailen. <br/>• Als uw kind in plaats van het geplande overblijven ergens anders gaat eten, moet u dit vooraf melden aan de overblijfcoördinator of overblijfkracht van die dag. Gebeurt dit niet dan kunnen wij uw kind niet meegeven aan een ander en mag uw kind de school tijdens de pauze niet verlaten. U kunt ook op het aanmeldingsformulier voor overblijven aangeven dat u toestemming geeft dat uw kind met (bepaalde) andere kinderen mee naar huis mag. Uw kind moet wel melden dat het ergens anders eet of dat het niet komt. N.B. U dient dan toch wel de TSO te betalen.<br/>• Mededelingen kunt u op overblijfdagen doorgeven bij de overblijf(kracht) via een briefje of u kunt mailen naar de TSO-coördinator ook voor vragen e.d.: <a href="mailto:ineke.groenendijk@d4w.nl">ineke.groenendijk@d4w.nl</a> . Tel. 0619993768</p>\n<p>Indeling:<br/>• Het overblijven op school is in principe gesplitst in drie groepen. Groep 1/2, 3/4 en 5 t/m 8.<br/>• Groep 1/2 en 3/4 zijn vanaf 11.45 tot ±12.30 uur in het overblijflokaal om te eten.<br/>• Groep 5 t/m 8 gaan van 12.00 –12.30 uur naar buiten en van 12.30 uur tot ±12.50 uur eten.<br/>• Groep 1 en 2 worden opgewacht door de overblijfkracht bij hun lokaal. De kinderen van groep 3/4 gaan zelfstandig naar het overblijflokaal waar de overblijfmoeder wacht.</p>\n<p>Eten en drinken:<br/>• Kinderen dienen een gezonde lunch mee te krijgen. Dit betekent brood met beleg, drinken en eventueel fruit. <br/>• De lunch het liefst in een broodtrommel en het drinken in een beker, bidon of een pakje, voorzien van naam en groep.<br/>• Tijdens het eten wordt een rustige en gezellige sfeer gecreëerd en de kinderen worden gestimuleerd om minimaal 1 boterham op te eten. Zij zitten maximaal 30 minuten aan tafel.<br/>• Voor en na het eten wordt er gebeden.<br/>• Tijdens het eten verwachten we dat de kinderen op hun plaats blijven zitten.<br/>• Met ingang van het schooljaar 2012-2013 mag er géén snoep meer meegenomen worden. De kinderen krijgen iets kleins van de TSO.</p>\n<p>Hygiëne:<br/>• De overblijf heeft de beschikking over een koelkast in de gemeenschapsruimte.<br/>• Voor het eten kunnen kinderen plassen en handen wassen (met zeep).</p>\n<p>Gedragsregels:<br/>• Wij hebben respect voor elkaar is de leidende regel. Verder heeft elke groep zijn eigen regels.<br/>• Bij kinderen die zich herhaaldelijk niet aan de gedragsregels houden nemen wij (TSO-coördinator en/of directie) altijd contact op met u als ouder(s).</p>
2177	<p><strong>Het ontstaan van de schoolraad</strong> :</p>\n<p>• fusie van CNS met D4W</p>\n<p>• D4W schoolraadavond : ‘couleur locale’</p>\n<p>• toolkit : - reglementen en afspraken (bijv. m.b.t. werving van leden)<br/>- handelen conform identiteitsstatuut van D4W<br/>- suggesties m.b.t. gespreksonderwerpen met directie</p>\n<p><strong>Welke opdracht heeft de schoolraad meegekregen ?</strong></p>\n<p>het van ‘buiten naar binnen brengen’ van datgene wat zich voordoet buiten de school, <br/>in de school bespreekbaar te maken <br/>(van gebeurtenissen in directe schoolomgeving tot maatschappelijke ontwikkelingen)</p>\n<p><strong>Taken van de schoolraad :</strong></p>\n<p>• het actief stimuleren en bewaken van de identiteitsontwikkeling <br/>van de school en haar onderwijs</p>\n<p>• het meedenken over de kwaliteit van het onderwijs</p>\n<p>• advies aan de directeur van de school en fungeren als klankbord</p>\n<p>• zitting in de sollicitatiecommissie</p>\n<p><strong>Verhouding tot andere oudergeledingen</strong></p>\n<p>• MR : beslist mee</p>\n<p>• Schoolcommissie : doet mee</p>\n<p>• Schoolraad : denkt mee</p>\n<p><strong>Wat heeft de schoolraad tot dusver gedaan :</strong></p>\n<p>• deelname in sollicitatiecommissie </p>\n<p>• aanbrengen van structuur (vergaderschema, verdelen functies, ed.)</p>\n<p>• overleg met directie </p>\n<p>• identiteit verwoord in bewoordingen van ouders (binnen richtlijnen D4W)</p>\n<p>• raakvlakken (overlappen) gezocht en overlegd met MR en SC</p>\n<p><strong>Wat gaat de schoolraad nog doen :</strong></p>\n<p>• zichzelf verder ontwikkelen </p>\n<p>• identiteitsaspecten verder met directie bespreken</p>\n<p>• klankborden met directie over actuele zaken (bijv. brede school)</p>\n<p>• leren van andere schoolraden</p>\n<p><strong>Wie zijn de leden van de schoolraad :</strong></p>\n<p>· Arco Baelde – Voorzitter</p>\n<p>· Klaus Broersma – Vice Voorzitter</p>\n<p>· Annet van Stavel – Notuliste</p>\n<p>· Trudy Janmaat – afgev. Raad van Advies</p>\n<p>· Anita Versloot – afgev. Raad van Advies</p>\n<p>· Petra Nottelman – PR &amp; nieuwsbrief</p>\n<p>· Gabrielle Schaap – lid</p>\n<p>· Bart Deege – lid</p>\n\n<p>• <strong>Waar zijn wij te vinden :</strong></p>\n<p>• op schoolplein : ook wij brengen onze kinderen naar school</p>\n\n<p>• én via email : schoolraad.pbs@d4w.nl </p>
247	<h1><strong>Missie Goejanverwelleschool</strong></h1>\n<p>Op de Goejanverwelleschool willen we vanuit onze protestants-christelijke geloofsovertuiging en daaruit voortvloeiende levenshouding aan ieder ons toevertrouwd kind, binnen een veilig schoolklimaat, kwalitatief goed onderwijs bieden. Verder willen we bijdragen aan de opvoeding van kinderen door hen te leren goed samen te leven.</p>\n<h1>Visie <strong>Goejanverwelleschool</strong></h1>\n<p>Ieder kind is een uniek schepsel van Gods hand. De protestants-christelijke levenshouding impliceert, naast de rijkdom van de individuele en gezamenlijke beleving van leerkracht en kind, een grote sociale bewogenheid (dichtbij en ver weg) en een respectvolle houding ten opzichte van ieder medemens en Gods  schepping.</p>\n<p>Kwalitatief goed onderwijs houdt rekening met de behoeften uit de samenleving en speelt daar op in. Binnen een veilig schoolklimaat willen we ieder kind stimuleren zich optimaal te ontwikkelen, zowel cognitief als sociaal-emotioneel. Belangrijke bouwstenen zijn voor ons het tegemoetkomen aan verschillen tussen kinderen in aanleg en ontwikkeling en het daarbij ruimte geven voor plezier en creativiteit. </p>
2233	<h1>Leerplicht</h1><p><strong>Leerplicht:  </strong></p>\n\n<p class="word">Vanaf hun vierde\nverjaardag gaan kinderen naar school. Soms komen ze van tevoren al een paar\nkeer kijken om te wennen. Een kind is leerplichtig zodra het 5 jaar wordt. Als\neen hele schoolweek voor een 5-jarige nog te lang duurt, kunnen ouders daar met\nde schoolleiding een afspraak over maken. Als leerplichtige kinderen zonder\ngrondige reden en zonder toestemming van de schoolleiding\nafwezig zijn, moeten we dit melden aan de leerplichtambtenaar. Ongeoorloofd\nverzuim kan flinke boetes tot gevolg hebben. Als kinderen zonder mededeling\nniet op school verschijnen, zullen wij in de loop van de dag contact met u\nopnemen. </p>\n\n<p class="word"> </p>\n\n<p class="word"><strong>Verlof wegens afwijkende\nvakanties:</strong></p>\n\n<p class="word">Over vakantieverlof is\nde leerplichtwet duidelijk. Dat is niet toegestaan, tenzij er in de\nverschillende schoolvakanties geen enkele gezinsvakantie mogelijk is vanwege de aard van het beroep\nvan één van de ouders.\n De noodzaak tot verlof moet blijken uit een verklaring van de werkgever. Ook\neen roostertechnisch probleem bij de werkgever is geen reden voor verlof. </p><p class="word"/>\n\n\n\n<p class="word"><strong>Vakantieverlof is aan\nstrikte regels gebonden:</strong></p>\n\n<p class="word">-de vakantie mag\nmaximaal twee weken duren, </p>\n\n<p class="word">-het gaat om de enige\nvakantie van een gezin in een jaar, </p>\n\n<p class="word">-het verlof mag niet\nplaatsvinden in de eerste twee weken van een schooljaar.</p>\n\n<p class="word"> </p>\n\n<p class="word"><strong>Verlof wegens gewichtige\nomstandigheden:</strong></p>\n\n<p class="word">Diverse bijzondere\nomstandigheden kunnen reden zijn voor het toekennen van een verlofdag. Hierbij\nkan gedacht worden aan een verhuizing van het gezin, het bijwonen van een\nhuwelijk, ernstige ziekte of overlijden, of een huwelijksjubileum van ouders of\ngrootouders. Dit verlof wordt toegekend door juf Marleen. Zij kan u ook meer\ninformatie geven. </p>\n\n<p class="word"> </p>\n\n<p class="word"><strong>Verlof om gezondheidsredenen:\n</strong></p>\n\n<p class="word">Een bezoek aan de\nhuisarts, specialist of tandarts kunt u doorgeven aan de leerkracht. Dit verlof\nduurt in de regel hoogstens een ochtend of een middag. Wanneer een kind door\nziekte of andere omstandigheden niet op school kan komen, zijn ouders/verzorgers\nwettelijk verplicht de school tijdig, op de hoogte te stellen. Belt u ons in\ndat geval tussen 8.00 en 8.20 uur en tussen 12.30 en 12.50 uur! </p>\n\n<p class="word"> </p>\n\n<p class="word">Een informatiefolder\nover verlof en een aanvraagformulier kunt u verkrijgen bij de schoolleiding.\nVerzoeken voor vakantieverlof en gewichtige omstandigheden moeten, indien\nmogelijk, 8 weken van tevoren worden ingediend. Overleg met de\nleerplichtambtenaar is soms noodzakelijk. <strong>Om\nteleurstellingen en hoge kosten te voorkomen, raden we u dringend aan om geen\nvakantie te boeken voordat u toestemming heeft voor het verlof!</strong></p>
2236	<h1>Sociaal-emotionele ontwikkeling</h1><p style="text-align: justify;" class="word">Door een gerichte\naandacht voor de sociaal-emotionele ontwikkeling willen we zorgen voor een\nevenwichtig en prettig school- en klassenklimaat. We streven ernaar dat alle\nkinderen zich prettig en veilig voelen, zodat ze zich optimaal kunnen ontwikkelen.</p><p style="text-align: justify;" class="word">In de klas is er vrijwel dagelijks aandacht voor de\nomgang met elkaar. Regelmatig zijn er speciale lessen waarin een aspect van de sociaal-emotionele\nontwikkeling behandeld wordt. In de groepen 4 t/m 8 gebruiken we de\nzogenaamde emotiepost: kinderen kunnen in een brievenbus een briefje doen over\neen probleem waar ze over willen praten. Voor kinderen die extra hulp op dit\ngebied nodig hebben, maken we gebruik van het programma “SijS”  (Sterker in je schoenen). Via bemiddeling van de intern begeleiders\nis het in bepaalde gevallen ook mogelijk om de hulp van\n schoolmaatschappelijk werk in te roepen.</p><p><img src="/static/cms/images/plugins/image.png" alt="Afbeelding - SijS" id="plugin_obj_2237" title="Afbeelding - SijS"/></p>
2368	<h3>Uitschrijving</h3>\n\n\n\n\n\n<p style="text-align: justify; text-align: justify;" class="MsoBodyText2">Het uitschrijven van leerlingen vindt in overleg met de directie en met de directie van de toekomstige school plaats. De gegevens van uw kind worden door ons aan de nieuwe school toegezonden.<br/>Voor leerlingen die worden uitgeschreven naar een andere school, stelt de school een onderwijskundig rapport op. In dit rapport worden de vorderingen van de leerling vermeld, de gebruikte methoden en overige relevante informatie voor de nieuwe school.</p>\n\n\n\n\n
2239	<h1>Ouderbetrokkenheid</h1><p>Ouders en leerkrachten zien we als partners\nin de ontwikkeling en opvoeding van kinderen. Kinderen presteren beter en\nvoelen zich prettiger als de leerkrachten en de ouders regelmatig contact\nhebben met elkaar en op één lijn zitten. De thuiswereld en de schoolwereld zijn\nvoor het kind dan ook beter met elkaar verbonden. Een goede onderlinge verstandhouding\nen afstemming vinden we dus van\n groot belang. </p><h2>Een greep uit de activiteiten\ndie we in dit verband organiseren:</h2><p>- Bij diverse activiteiten die\nmet de kinderen ondernomen worden, vragen we de ouders om ondersteuning zoals bij\nuitstapjes, spelletjesdagen, sportdagen, voorleesactiviteiten e.d.</p><p>- Om het\njaar doen we in de groepen 1 t/m 6 huisbezoeken.  </p><p>- Ouders\nvan nieuwe kleuters worden uitgenodigd om een keer in de groep te komen kijken.</p><p>- Aan\nhet begin van elk schooljaar houden we voor elke groep een informatieavond. Ouders kunnen dan met de\nleerkracht(en) kennismaken en vernemen wat er op het programma staat, hoe er\ngeleerd wordt e.d.</p><p>- Voor\nalle groepen zijn er twee keer per jaar de 10-minutengesprekken. U kunt dan met ons praten over de sociale\nontwikkeling en de\n vorderingen van uw kind. Als dat noodzakelijk of gewenst is,\nkunnen ouders en/of leerkrachten ook op andere momenten met elkaar overleggen.</p><p>-\nJaarlijks organiseren we in samenwerking met ouders van schoolraad en MR een algemene ouderavond met een opvoedkundig\nen/of onderwijskundig onderwerp.</p><p>\n\n-\nregelmatig kunnen ouders aan het begin van de dag een poosje in de kleuterklas van hun\nkind blijven om met hun kind te spelen of te werken.</p>
2242	<p>Ons team bestaat uit:<br>groep 1: juf Ilona van Duuren en juf Iet Kleuver<br>groep 1-2a: juf Gerjanne de Bruijn en juf Marianne Boot<br>groep 1-2b: juf Debbie de Mooij en juf Gea Haaksman<br>groep 3: juf Margreeth Ruven<br>groep 3-4: juf Willeke Huizer<br>groep 4: juf Mirjam van Beek en juf Mariska Bergstra<br>groep 5: juf Christa Verbree en juf Marcella Grob<br>groep 6: juf Jeanette Boer en juf Els Sterk<br>groep 7: meester Erik van Genderen<br>groep 8: meester Frank Neerhof<br>IB: Marcella Grob en Jolijn van de Hoef<br>ICT: Jos Koen<br>Gym: Jan Folsche<br>onderwijsondersteuners: Erna de Ridder en Helma Huybrechts<br>conciërges: Jan ten Brink en Karel Ellerbroek<br>administratief medewerkster: Monique den Hoedt<br>directeur: Hans Compagne</p><p>Het bestuur is de werkgever van de leerkrachten. Het bestuur is bevoegd om leerkrachten te benoemen. Natuurlijk wordt de directie daar altijd bij betrokken. Bij de werving en selectie wordt zeer zorgvuldig te werk gegaan, omdat de kwaliteit van het onderwijs gegarandeerd moet blijven.</p><h2>Het team\n\n</h2>\n\n<p>Het team van de Da Costaschool bestaat uit de volgende functies:</p>\n\n<p class="p310">* Directeur: belast met de leiding over de school. </p>\n\n<p class="p310">* De managementstructuur is met ingang van 2011/2012 veranderd. Er is een managementteam. De directeur is eindverantwoordelijk voor alle zaken. Daaronder komen een managementteam (MT) en een zorgteam (ZT). Het managementteam bestaat uit drie bouwcoördinatoren en het zorgteam uit twee interne begeleiders. Het MT is in functie met ingang van 1-8-2011 en bestaat uit Ilona Bukman (onderbouwcoördinator, gr. 1-2), Gerjanne de Bruijn (midden-bouwcoördinator, gr. 3-5) en Christa Verbree (bovenbouwcoördinator gr. 6-8). Er is een taakomschrijving van het MT, met daarin verwoord de bevoegdheden, verantwoordelijkheden en taken van de leden van het MT. Het MT is hiervoor één woensdagochtend per twee weken vrijgesteld van lestaken.</p>\n\n<p class="p290">* Het ZT bestaat uit de interne begeleiders Marcella Grob (onderbouw, gr. 1-4) en Jolijn van de Hoef (bovenbouw, gr. 5-8).</p>\n\n<p class="p290">* Groepsleerkracht: een leerkracht die voornamelijk belast is met lesgevende taken, leerlingenzorg en klassenmanagement in een groep.</p>\n\n<p class="p320">* Vakleerkracht: een leerkracht die een bepaald vakgebied voor zijn/haar rekening neemt en dat voor een aantal leeftijds­groepen verzorgt. Bijvoorbeeld gymnastiek.</p>\n\n<p class="p320">* Onderwijsassistent: Erna de Ridder</p>\n\n<p class="p320">* ICT coördinator: een groepsleerkracht die extra kennis heeft over de computers en die collega’s helpt bij het werken met computers.</p>\n\n<p class="p320">* Leerkracht extra taalondersteuning: geeft extra zorg aan kinderen met een handelingsplan op het gebied van taal. </p>\n\n<p class="p320">* Tuinman: voor het onderhoud van de tuin.</p>\n\n<p class="p320">* Conciërge: voor het kleine onderhoud van het schoolgebouw en kopieerwerkzaamheden.</p><h2>Fulltime-parttime</h2>\n\n\n\n<p>Een aantal groepen heeft te maken met twee groepsleerkrachten. Samen hebben zij de zorg voor de groep. Zij houden elkaar goed op de hoogte van wat er in de klas gebeurt. Ook de directeur en het MT zijn niet alle dagen van de week op school. Zij hebben nauw contact over de lopende zaken. Alle leerkrachten die voltijd werken hebben CV (CompensatieVerlof). Ook maakt de directeur gebruik van BAPO (extra vrije dagen als de leerkracht 52 jaar of ouder is). Dit betekent dat hij een aantal dagen per jaar vrij heeft. </p><h2>Invalleerkrachten</h2>\n\n\n\n\n\n<p class="MsoBodyText">Als een leerkracht ziek is of om een andere reden onverwacht niet voor de klas kan staan, doet de school een beroep op de invaller. Deze juf of meester komt dan de groep overnemen. Het kan soms voorkomen dat er geen invalleerkracht beschikbaar is. Dan wordt er intern naar een andere oplossing gezocht. Het kan zijn dat er groepen worden gecombineerd of dat de kinderen worden verdeeld over de andere groepen. In principe sturen we geen kinderen naar huis. Mocht dit in het uiterste geval wel gebeuren, dan wordt u daar tijdig over bericht.</p><h2>Stagiaires</h2><p>Ieder jaar komen er \nstagiaires van de PABO (pedagogische academie basisonderwijs) of een \nID-college (opleiding voor onderwijsassistenten) op onze school \nonderwijservaring opdoen. Wij willen hen hiervoor graag de gelegenheid \ngeven. Er zijn verschillen. Eerstejaarsstagiaires worden stap voor stap \nbegeleid, maar studenten die bijna klaar zijn met hun opleiding, moeten \nvrijwel geheel zelfstandig een groep leerlingen begeleiden. Dit gebeurt \nonder leiding van de groepsleerkracht. Hierover worden van tevoren \nduidelijke afspraken gemaakt, omdat wij vinden dat het lesprogramma \ngewoon moet doorgaan. Binnen het team is een ICO, Interne Coach \naangesteld. Hij heeft de coördinatie over de inzet van stagiaires. \nMeestal ontvangen wij stagiaires van de Marnix Academie in Utrecht. Onze school heeft er voor gekozen om in het Partnerschap in Opleiding en Ontwikkeling (POO) samen te werken met de Marnix Academie, lerarenopleiding basisonderwijs (pabo), in Utrecht. Studenten van de Marnix Academie lopen stage en doen onderzoek in onze school.  </p><p>Ook ontvangen wij ieder jaar snuffelstagiaires voor enkele dagen. Dit zijn leerlingen van het voortgezet onderwijs die een aantal dagen met een leerkracht meelopen om te kijken of een opleiding tot onderwijsassistent of leerkracht iets voor hen is.</p><p>Ook voor verdere ontwikkeling maken wij gebruik van advies, cursussen en opleidingen van het Marnix Onderwijscentrum, onderdeel van de Marnix Academie.</p>\n\n\n\n\n\n\n\n
1386	<p>Dit is de website van de Goejanverwelleschool,\neen grote basisschool in de Goudse woonwijk Goverwelle. We zijn een gewone,\ndegelijke basisschool met een leerstofjaarklassen systeem, waar goed gelet\nwordt op de individuele behoeften van elk kind.</p>\n\n<p>Maar we zijn toch ook wel een bijzondere school!<br/>Bijzonder, omdat we een christelijke school zijn\ndie daar ook inhoud aan geeft.<br/>Bijzonder, omdat we goede resultaten halen en elk\nkind de kans willen geven om zijn/haar eigen mogelijkheden goed te ontplooien.<br/>Bijzonder, omdat we een goede sfeer hebben op onze\nschool en ernaar streven dat kinderen elke dag vrolijk naar school gaan.<br/>Bijzonder, omdat de juffen en meesters op onze\nschool bijzondere mensen zijn, die zich met hart en ziel voor de kinderen\ninzetten.<br/>Bijzonder, omdat er nog zoveel andere dingen zijn die\nonze school bijzonder maken, zoals de Plusklas, Onderwijstijdverlenging,\nSterker in je schoenen, het Zone-Parc plein en nog veel meer! </p><p>Daar willen we u\ngraag meer over vertellen. U bent van harte welkom om kennis te maken met onze\nschool.</p><p><img src="/static/cms/images/plugins/image.png" alt="Afbeelding - Mml.JPG" id="plugin_obj_2244" title="Afbeelding - Mml.JPG"/></p>
