2280	<h1>Identiteit en Uitgangspunten</h1><p>Onze school is een christelijke school. Uitgangspunt voor ons christelijk geloof is de Bijbel. Onze school baseert zich op de Bijbelse waarden die wij van Jezus Christus geleerd hebben: </p>\n\n<p>* Wij leven rechtvaardig en verdraagzaam met elkaar en zijn bereid elkaar te vergeven.</p>\n\n<p>* Wij hebben zorg en respect voor elkaar en de wereld om ons heen, omdat wij beseffen dat de wereld ons in bruikleen is gegeven.</p>\n\n<p>* Wij respecteren ieders cultuur, geaardheid en geloofsovertuiging. </p><p>* Wij vinden het belangrijk om hierbij midden in de maatschappij te staan. Dit doen wij onder andere door:</p><p>* te werken vanuit thema's.</p><p>* de actualiteit bij het onderwijs te betrekken.</p><p>* een intensieve samenwerking na te streven met ouders en andere instanties om een doorgaande ontwikkelingslijn voor het kind te realiseren.</p><p class="MsoBodyText2">Omzien en zorgen voor de mensen die op je weg komen is bij dit alles heel belangrijk. Een positieve sfeer en zorg voor anderen is één van de kenmerken van onze school. Ook komt dit naar voren in de keuzes die wij maken en de taal die wordt gesproken.</p>\n\n<p class="MsoBodyText2">Zorg en respect voor elkaar en voor de leefwereld om je heen, hebben te maken met het besef dat de wereld ons in bruikleen gegeven is. Het is belangrijk dat kinderen leren dat het in de wereld van vandaag ook om andere dingen gaat dan materialisme en competitiedrang. Eén van de manieren waarop dit concreet wordt gemaakt voor de kinderen is, dat er elke maandagmorgen geld wordt ingezameld. Het geld wordt besteed aan projecten in het kader van zending en werelddiaconaat.</p>\n\n<p class="MsoBodyText2">Iedere schooldag wordt begonnen en afgesloten met gebed. Wekelijks wordt een aantal bijbelverhalen verteld en er worden daarbij liederen aangeleerd. Aan het begin van het schooljaar is er een jaaropening. Ook vieren wij jaarlijks één van de christelijke feesten: Kerstfeest, Pasen of Pinksteren gezamenlijk met ouders en kinderen. Op onze school wordt onderwijs gegeven op Protestants-Christelijke grondslag. Ook kinderen die niet tot deze geloofsrichting behoren zijn van harte welkom. Wij verwachten dat iedereen die de school bezoekt onze grondslag respecteert en meedoet met alle activiteiten.</p><h2>Doelen van onze school</h2><p>Ons doel is dat alle kinderen zich veilig en geborgen voelen. Het is een basisvoorwaarde om tot goede resultaten te komen. Op onze school willen we dus op een prettige manier samenwerken. We hebben een luisterend oor voor kinderen en ouders. Wij streven naar het realiseren van:</p><p>* \nEen veilig leer- en leefklimaat;</p><p>* \nGoed onderwijs, overdragen van kennis;</p><p>* \nHet bijbrengen van sociale vaardigheden;</p><p>* \nEen open en duidelijke communicatie van de school naar de ouders. \n</p><p>Naast kennis en vaardigheden die aangeleerd worden, wordt daarom ook veel aandacht besteed aan verbondenheid, sociale omgang en weerbaarheid. In alle groepen wordt gewerkt aan een goede sfeer. We vertellen kinderen steeds opnieuw dat er regels in en om de school gelden. Respect, trouw, eerlijkheid, zorg, orde en regelmaat zijn hierbij de kernwoorden. Conflicten worden uitgesproken en excuses aangeboden. De school heeft haar verplichtingen omschreven in het schoolplan. Dit plan kan op school worden ingezien.\n</p><h2>Inrichting leeromgeving</h2><p>Kinderen zijn van nature nieuwsgierig. Onze school wil die nieuwsgierigheid tot volle bloei laten komen door aandacht te besteden aan de totale ontwikkeling (cognitief, sociaal-emotioneel, motorisch, creatief, etc.). Wij willen kinderen uitdagen om zich te ontwikkelen in een prettige en leerrijke sfeer. \n\n</p><p>Wij bieden kinderen een rijke leeromgeving. Kinderen leren niet alleen via de methode, maar gebruiken ook andere leerbronnen zoals de computer, educatieve spellen en materialen om mee te handelen. Ook buiten de schoolomgeving doen ze ervaringen op. Hierbij streven wij naar een betekenisvol aanbod om betrokkenheid bij kinderen te realiseren.\nWij geven ruimte om samen te werken. Zo kan er optimaal geleerd worden van elkaar.\nWij geven zoveel mogelijk onderwijs op maat. Er wordt rekening gehouden met de leerstijl en leerbehoeften van ieder kind.\n</p><h2>Onze schoolregels</h2><p>Wij vinden het belangrijk dat er duidelijke regels zijn waar we ons allemaal aan houden. In de klas komen deze regels regelmatig ter sprake in het kringgesprek. \n\n\t</p><p>* Ik, jij, hij of zij... Iedereen hoort erbij!\n\t</p><p>* Samen spelen, samen delen, elkaar niet vervelen!\n\t</p><p>* Slaan of schoppen, daar moet je snel mee stoppen\n\t</p><p>* Als de ander praat, ben je stil. Dan hoor je wat die zeggen wil!\n\t</p><p>* Pesten is nooit goed, zorg dus dat je aardig doet.\n\t</p><p>* Een bijnaam krijgen is niet fijn, want een bijnaam doet vaak pijn.\n\t</p><p>* Met lachen is niets mis, zolang het maar niet om een ander is.\n\t</p><p>* Noemt iemand jou vaak stom of suf, zeg het dan tegen meester of juf.\n\t</p><p>* Hoe leuk het buiten ook was. Kom rustig in de klas!\n</p><p>* Alle dingen hebben een doel. Kapotmaken is niet cool!\t</p> \n\n\n
2279	<p>Op onze school zitten de kinderen van dezelfde leeftijd meestal in dezelfde jaargroep. De groepen 1 t/m 4 noemen we de onderbouw en de groepen 5 t/m 8 heet de bovenbouw. We vinden het belangrijk dat de leerstof goed over de jaargroepen is verdeeld, zodat er onderling een goede aansluiting is.</p>
