2315	<p>De school kent 2 locaties waarvan 1 aan de rand van Moordrecht tussen de Westringdijk en de nieuwbouw nabij de Sportlaan. De andere locatie ligt aan de Middelweg, aan de doorgaande route van het dorp. Beide locaties liggen dicht bij het multifunctionele centrum De Zuidplas. </p>\n<h1><br/>Nieuwbouw </h1><p><br/>Het schooljaar 2007-2008 zijn we begonnen met een nieuwbouwtraject. Samen met de Jozefschool, de BSO Kern en de BSO Kids en Zoo hoopten wij we in de loop van 2011 te starten in een nieuw gebouw. Door het opgaan van de gemeente Moordrecht in de gemeente Zuidplas en door problemen bij het verkrijgen van de bouwgrond is de bouw vertraagd.</p>
