2311	<p>Algemene gegevens PCB Meester Lalleman </p>\n<p>Locatie onderbouw<br/>Bezoekadres:<br/>Middelweg 62 <br/>2841 LC MOORDRECHT <br/>Tel: 0182 - 375495 <br/>Postadres : Postbus 63 <br/>2840 AB MOORDRECHT <br/>Email : <a href="mailto:pcb.meesterlalleman@d4w.nl">pcb.meesterlalleman@d4w.nl</a> </p>\n<p>Locatie bovenbouw<br/>Bezoekadres:<br/>4e Tochtweg 14<br/>2841 LS MOORDRECHT<br/>Tel: 0182 - 373447<br/>Postadres: Postbus 63<br/>2840 AB MOORDRECHT<br/>Email: <a href="mailto:pcb.meesterlalleman@d4w.nl">pcb.meesterlalleman@d4w.nl</a></p>\n<p>Website :http://www.d4w.nl/scholen/pcb-meester-lalleman/ </p>\n\n\n\n
2340	<h1>Over de school</h1>
2365	<p>De ouderbetrokkenheid wordt gerealiseerd door middel van een schoolraad, waarin ouders zitting hebben die door ouders worden gekozen. De schoolraad is de gesprekspartner van de directie van de school betreffende de identiteit van de school en betreffende de kwaliteit van het onderwijs van de school.<br/>De schoolraad is samengesteld uit ouders binnen de school die zich beschikbaar hebben gesteld om mee te denken over het heden en de toekomst van de school en over de veranderingen die onderweg daar naar toe zullen plaatsvinden en die de grondslag van de stichting onderschrijven en actief belijden; de verkiezing van leden van de schoolraad vindt plaats conform het ‘reglement schoolraad’. </p>\n\n\n\n\n\n<p>De schoolraad heeft primair tot taak het actief stimuleren en bewaken van de identiteitsontwikkeling van de school en het onderwijs, met in het verlengde daarvan de kwaliteit van het onderwijs.<br/>De schoolraad heeft een adviserende rol aan de directeur van de school en is ook betrokken bij sollicitatieprocedures. De schoolraad vaardigt twee leden af naar de raad van advies van de stichting.</p>\n\n<p>Samenstelling Schoolraad<br/>Dhr. R. van Duuren - voorzitter<br/>Dhr. C. van der Wel - secretaris<br/>Dhr. K.J. Pos<br/><br/>e-mailadres: schoolraad.dacostaschool@d4w.nl</p>\n\n\n\n\n
2331	<p><strong>Overblijven (Tussenschoolse Opvang (TSO))</strong> </p>\n<p>De doelstelling is om kinderen een goede middagpauze te geven, met een goed evenwicht tussen een goede lunch en ontspanning. Voor de ontspanning is er zowel binnen- als buitenspeelgoed aanwezig. U kunt uw kind aanmelden via een aanmeldingsformulier, dat u bij de overblijf coördinator kunt opvragen.</p>\n<p>Het is de bedoeling dat u voordat uw kind(eren) overblijven een 10- strippenkaart aanschaft à € 22,50.</p>\n<p>Voor vragen m.b.t. het overblijven, kunt u terecht bij onderstaande persoon: <br/>Jantine Oskam- Westerbroek TSO- coördinator, e-mail: <a href="mailto:tso.pcb.meesterlalleman@d4w.nl">tso.pcb.meesterlalleman@d4w.nl</a></p>\n<p><br/> <strong>Buitenschoolse opvang (BSO)</strong></p>\n<p>De buitenschoolse opvang wordt verzorgd door het bureau van Kern-kinderopvang, telefoon nummer : 079 - 346 11 00. U kunt een afspraak maken voor een persoonlijke rondleiding. Meer informatie over de mogelijkheden binnen de opvang vindt u ook op de website: www.kern-kinderopvang.nl. De leerlingen van onze school gaan veelal naar BSO Het Gruttonest. De BSO is dagelijks geopend van 15.30 – 18.00 uur, op woensdag zelfs vanaf 11.30 uur. In de schoolvakanties is de BSO de hele dag open. De kinderen worden door de leidsters van school gehaald. BSO Het Gruttonest <br/>Prinses Beatrixstraat 15A <br/>2841 VS MOORDRECHT <br/>Telefoon nummer : 0182 - 379199 </p>
2360	<p>De medezeggenschapsraad (MR) komt op voor de belangen van personeelsleden, ouders en leerlingen. De MR bestaat uit 3 team-leden en 3 ouders.<br/>De MR spreekt haar woordje mee in de zaken die vooral met het schoolbeleid te maken hebben. Onderwerpen die bijvoorbeeld behandeld worden zijn: de huisvesting van de school, de groepenverdeling, de schoolbegroting, ouderparticipatie en de algemene gang van zaken in en om de school.<br/>De MR komt regelmatig bij elkaar. De MR is vertegenwoordigd in de GMR (Gemeenschappelijke Medezeggenschapsraad). De directeur van de school is als adviseur van de raad aanwezig. De MR brengt tijdens de algemene ouderavond een jaarverslag van het voorgaande schooljaar uit. De vergaderingen van de MR worden via de Nieuwsbrief bekend gemaakt. Wilt u eens een vergadering bijwonen, dan bent u van harte welkom! Kondig uw komst wel van tevoren even telefonisch aan. Namen en adressen van de MR vindt u in de adressenlijst. Zodra er nieuwe leden in de MR komen, zullen de namen in de nieuwsbrief bekend worden gemaakt. </p><p>Samenstelling MR<br/>Geleding ouders:<br/>Collin Stegeman<br/>Eelco Mulder<br/>Corieke Müller<br/><br/>Geleding personeel:<br/>Jeanette Boer<br/>Christa Verbree<br/>Willeke Huizer<br/><br/>e-mailadres: mr.dacostaschool@d4w.nl</p>\n\n\n\n\n
2363	<p class="MsoBodyText2">Onze school heeft ook een activiteitencommissie (AC). Hierin zitten 10 enthousiaste ouders die allerlei activiteiten organiseren in, rond en voor de school. Zij ondersteunt het team van de school in praktisch opzicht. Denk hierbij aan het organiseren van het schoolreisje of een spetterend feest, het opknappen van het schoolplein, verkeersveiligheid bevorderen etc. Ook een belangrijke taak van de AC is het beheren van het Schoolfonds.</p>\n\n<p>Het organiseren van activiteiten gebeurt altijd in overleg met het lerarenteam. Namen en adressen van de AC vindt u in de adressenlijst.</p><p/><p>Samenstelling AC:<br/>Geleding ouders:<br/>Jeroen Wichers - voorzitter<br/>Annemiek van der Meer - penningmeester<br/>Jacqueline Kemp - secretaris<br/>Yvette Starrenburg<br/>Mariska de Vries<br/>Esther van der Sterre<br/>Joost de Jong<br/>Henk Hoogeveen<br/>Yetske Vrieswijk</p><p>Geleding personeel:<br/>Ilona Bukman<br/>Liset Slingerland<br/><br/>e-mailadres: ac.dacostaschool@d4w.nl</p><p/>\n\n\n\n\n
822	<p>Onze school is een christelijke school en valt onder het bestuur van Stichting PCPO De Vier Windstreken. Het is de oudste school van Bodegraven. Zij is opgericht in 1896. De school ligt in Bodegraven-Noord. Uit deze wijk, maar ook uit Bodegraven-Centrum en de Meije komen veel van onze leerlingen. We zijn gehuisvest in een karakteristiek pand, dat is aangepast aan alle eisen van de moderne tijd. De school telt ongeveer 260 leerlingen. Deze zijn over 10 groepen verdeeld.</p>
