2343	<h1>Organisatie en inhoud van ons onderwijs</h1>
2339	<h1>Kwaliteitszorg en zorg voor kinderen</h1>
2356	<h1>Oudercontact</h1><h3>Oudergesprek</h3>\n\n\n\n<p>Wanneer u of wij over uw kind willen praten, dan maken wij daarover een afspraak. Als ouder kunt u voor of na schooltijd even de school binnenlopen, een mailtje sturen of telefonisch contact opnemen met de leerkracht.  Houdt u er rekening mee dat wij hebben afgesproken niet over leerlingen te communiceren via de mail? Dat doen we liever in een persoonlijk gesprek.<br/>Als u een kleuter in de groepen 1 en 2 brengt, kunt u gebruik maken van het zogenaamd ‘inloopkwartier’. Dit is alleen op maandag. U kunt dan natuurlijk best even met de leerkracht praten, maar voor een écht gesprek met de leerkracht kunt u beter een afspraak maken.</p><h3>Nieuwsbrief</h3>\n\n\n\n\n\n\n\n\n\n\n\n<p>Elke twee schoolweken vertellen wij u alle nieuws en nieuwtjes in een nieuwsbrief voor de ouders. Ook staan daarin steeds belangrijke data van vrije (mid)dagen en allerlei activiteiten vermeld. De nieuwsbrieven zijn ook te lezen op deze site onder het kopje Nieuws.</p><h3>Andere contactmogelijkheden</h3>\n\n\n\n<p>* De informatieavond aan het begin van het schooljaar in de groep van uw kind;</p>\n\n<p>* Een huisbezoek; als dit nodig is;</p>\n\n<p>* De tien-minuten-gesprekken; 2 keer per jaar. </p>\n\n<p>* Op vrijdagochtend hebben de ouders de gelegenheid om in groep 3-8 1x per maand (zie jaarkalender) van 08.25-08.40 uur naar het werk van de kinderen te komen kijken.</p>\n\n<p>* De algemene ouderavond;</p>\n\n<p>* Informatie in de Nieuwsbrief van de school (verschijnt elke twee weken);</p>\n\n<p>* Informatie in brieven/circulaires over een bepaald (incidenteel) onderwerp;</p>\n\n<p>* Informatie op het prikbord in de hoofdgang van de school;</p>\n\n<p>* Informatie bij het lokaal van uw kind.</p>\n\n\n\n<h3>Informatie aan gescheiden ouders</h3>\n\n<p>Iedere ouder heeft recht op informatie omtrent de ontwikkeling van zijn/haar kinderen. Bij het verstrekken van informatie aan niet-verzorgende ouders hanteren we twee belangrijke uitgangspunten:</p>\n\n<p>* de school wil zich niet mengen in conflicten tussen ouders</p>\n\n<p>* het belang van het kind moet gediend worden.</p>\n\n<p>Wij gaan ervan uit dat u in onderling overleg de informatievoorziening regelt en op de 10-minutengesprekken aanwezig bent. In principe gaat er één exemplaar van (nieuws)brieven met uw kind mee naar huis. Mocht u toch steeds informatie mislopen, neem dan even contact op met de leerkracht van uw kind, dan kunnen we u toevoegen aan de adressenlijst voor de digitale nieuwsbrief. </p>\n\n\n\n\n\n\n\n
2348	<h1>Externen</h1>
2354	<h1>Praktische info</h1>
2355	<h3>Verjaardagen</h3>\n\n<p class="MsoBodyText">De verjaardag van uw kind is een feest en daar hoort ook de traktatie op school bij. De jarige mag in zijn/haar groep trakteren. Graag zouden wij zien dat u een gezonde traktatie mee naar school geeft. Dit om het gebit en de gezondheid van de kinderen en de leerkrachten te beschermen! Wilt u ook rekening houden met kinderen met een voedselallergie of met een islamitische achtergrond? Informatie hierover kunt u altijd bij de leerkracht krijgen. </p>\n\n<p class="MsoBodyText">Uitgenodigd worden voor een verjaardagspartijtje is altijd fantastisch! Heel teleurstellend is het natuurlijk als je niet uitgenodigd wordt. Wilt u, als uw kind een verjaardagspartijtje geeft, vooral rekening houden met de laatst genoemden?! Geeft u daarom de uitnodigingen niet in de klas of op het schoolplein. Bezorg ze liever thuis!</p>\n\n<h3>Eten/drinken</h3>\n\n\n\n\n\n\n\n<p>Uw kind mag voor de pauze (gezond) eten en drinken. Iedere woensdag is het GRUIT-dag. Deze dag mogen de kinderen van groep 1-8 behalve drinken, alleen groente en/of fruit meebrengen als tussendoortje. Denk bijvoorbeeld aan: appel, banaan, bessen, aardbeien, stukjes paprika, peer, stukjes komkommer, kiwi, druiven. Zo wordt iedere woensdag een gezonde dag!<br>Wilt u uw kind niet te veel meegeven?!<br>Gemiddeld 20 kinderen nemen per dag een pakje drinken mee naar school. Aan het einde van de week zijn dit dan 100 pakjes. Dan heeft één klas dus twee vuilnisbakken vol aan lege pakjes drinken geproduceerd!<br>Door uw kind i.p.v. een pakje, een beker drinken mee naar school mee te geven, kunt u die grote hoeveelheid afval gemakkelijk terug laten dringen. Door dit te stimuleren op school, proberen wij iets voor het milieu te doen. Daarom willen wij u vragen om hier aan mee te werken.  </p><h3>Procedure ziekmelding leerlingen</h3><p>Als uw kind ziek is en niet op school kan komen of als er een afspraak is met de dokter of tandarts onder schooltijd, moet de school hiervan in kennis gesteld worden. Ons verzoek is om voor schooltijd op te bellen. Er wordt vanaf 8.30 uur geïnventariseerd welke leerlingen niet op school zijn en ook niet zijn afgemeld. De ouders van die kinderen worden opgebeld om er zeker van te zijn dat de kinderen op weg naar school niets is overkomen.</p>\n\n<h3>Speelgoedochtend kleuters</h3>\n\n<p class="MsoBodyText">Op vrijdagmorgen is het één maal per maand speelgoedochtend. De kinderen mogen dan van thuis speelgoed  meenemen. Zij kunnen daar op school mee spelen. Liefst maximaal 2 stuks, geen kleine onderdeeltjes, geen schiet/vechtspeelgoed en geen speelgoed op batterijen. Fietsen kunnen wij i.v.m. de veiligheid niet toestaan. De speelgoedochtend is bedoeld om ervoor te zorgen dat de kinderen op de andere dagen geen speelgoed mee naar school nemen!</p>\n\n<h3>Verkeer en oversteken</h3>\n\n<p>Om bij te dragen aan een verkeersveilige schoolomgeving helpen verkeersbrigadiers bij het oversteken voor en na schooltijd bij de oversteekplaats aan de Oranjelaan. Als de school begint van 8.15-8.30 uur en als de school uitgaat om 15.15 uur. Een aantal ouders, leerkrachten en stagiaires is door de politie hiervoor opgeleid en heeft de bevoegdheid gekregen het verkeer op de Oranjelaan te regelen. Dit geldt ook voor kinderen uit groep 7 die hiervoor toestemming van hun ouders hebben gekregen. </p>\n\n<p>De verkeersbrigadier is te herkennen aan een oranje jas en voor het geven van een stopteken heeft hij/zij een stopbord. Aanwijzingen van verkeersbrigadiers moeten worden opgevolgd. Het negeren van een aanwijzing kan een bekeuring opleveren.</p>\n\n<h3>Parkeren</h3>\n\n\n\n<p>Wij verzoeken alle ouders die hun kind met de auto naar school brengen zeer dringend hun auto volgens de regels te parkeren. Wij stellen het zeer op prijs dat ouders hun auto parkeren in de parkeergarage of op het parkeerterrein bij C1000 en het laatste stukje naar school te voet afleggen. Hierdoor creëren we met elkaar een veilige schoolomgeving. Vooral in de Laan van Turkenburg wordt er regelmatig dubbel geparkeerd, waardoor er voor kinderen die op de fiets naar school komen een onveilige situatie ontstaat. Wij ontvangen met regelmaat klachten van buurtbewoners over het parkeergedrag van ouders in de Laan van Turkenburg.</p><h3>Op de fiets</h3>\n\n\n\n\n\n<p class="MsoBodyText">De leerlingen van de groepen 1, 2, 3 en 4, die op de fiets komen, zetten hun fiets in de berging op het grote plein. De leerlingen van de overige groepen zetten hun fiets in de berging op het kleine plein en lopen.<br>Dus: Afstappen ten gunste van de veiligheid van uw kind.</p><h3>Vervoer van leerlingen</h3>\n\n<p class="MsoBodyText">Bij het vervoer van kinderen tijdens schoolactiviteiten speelt veiligheid een grote rol. Wanneer er wordt gekozen met auto’s te reizen, gelden de volgende regels:</p>\n\n<p class="MsoBodyText">* er worden niet meer passagiers vervoerd dan er veiligheidsgordels beschikbaar zijn</p>\n\n<p class="MsoBodyText">* iedere passagier dient de veiligheidsgordel te dragen</p>\n\n<p class="MsoBodyText">* een driepuntsgordel mag niet meer als heupgordel gedragen worden</p>\n\n<p class="MsoBodyText">* kinderen moeten bij voorkeur achterin zitten</p>\n\n<p class="MsoBodyText">* kinderen kleiner dan 1.35 m. met een maximum gewicht van 36 kilo moeten in principe, zowel voorin als achterin de auto, gebruik maken van een geschikt en goedgekeurd kinderzitje of zittingverhoger.</p>\n\n<p class="MsoBodyText">* incidenteel mag bij vervoer over beperkte afstand worden volstaan met het gebruik van de gordel op de achterzitplaatsen voor kinderen vanaf 3 jaar (maar niet de eigen kinderen)</p>\n\n<p class="MsoBodyText">Als uw kind tijdens schoolactiviteiten vervoerd wordt per auto, kunt u altijd een kinderzitje meegeven voor het vervoer. We zullen er op toezien dat dit zitje dan voor uw kind op de juiste manier gebruikt wordt.</p>\n\n<h3>Hoofdluis</h3>\n\n\n\n<p class="Pa30">Ieder jaar zijn er kinderen, bij wie hoofdluis geconstateerd wordt. Om te voorkomen, dat de hoofdluizen zich gaan verspreiden, nemen wij preventieve maatregelen.<br>De volgende maatregelen zijn daarom ook dit schooljaar van kracht:</p>\n\n<p class="Pa130">* Zonder tegenbericht gaan wij ervan uit dat u toestemming geeft om uw kind na elke vakantie, of eventueel tussentijds, op school te mogen controleren op hoofdluis door (vrijwillige) ouders. </p>\n\n<p class="Pa130">* Er bestaat een mogelijkheid om een luizentas aan te schaffen om daarin de jas en de gymtas weg te hangen aan de kapstok. </p>\n\n\n\n<p>* Indien u zelf bij uw kind hoofdluis constateert, meldt u dit dan op school. De kinderen ontvangen dan een brief waarop staat hoe te handelen. Schroom niet het te zeggen; snel ingrijpen kan verspreiding voorkomen!</p><h3>Foto’s</h3>\n\n<p>De Vier Windstreken heeft in verband met de privacy en kans op oneigenlijk gebruik van foto’s, zorgvuldig beleid opgesteld. We plaatsen geen foto’s in digitale web-albums. Ook mailen we ze niet naar ouders. We geven geen foto’s op cd-rom of USB-stick aan ouders of kinderen mee. <br>Foto's die op de website worden geplaatst, worden met zorg geselecteerd. Op deze foto's staan altijd meerdere kinderen.</p><h3>Schoolreisje/feest/kamp</h3>\n\n<p class="MsoBodyText">Ieder jaar houden wij een schoolreisje voor de groepen 3 t/m 7. Dit vindt meestal plaats in de voorlaatste maand voor de zomervakantie. De groepen 1 en 2 hebben ook een schoolreis, dicht in de buurt, of een groot kleuterfeest op school. Groep 8 gaat 3 dagen op afscheidskamp als afsluiting van een fijne periode op onze school.</p><h3>\n\nSponsoring</h3><p class="MsoBodyText2" style="text-align: justify;">Op onze school zijn wij terughoudend met het gebruik maken van sponsoring; zeker ten aanzien van structurele bekostiging van het onderwijs. Wel kan bij de organisatie van feesten of andere activiteiten een beroep gedaan worden op ouders of bedrijven in Bodegraven om in deze kosten bij te dragen.</p>\n\n<h3>Ouderbijdrage</h3><p class="MsoBodyText2">De ouderbijdrage is een jaarlijkse, vrijwillige, bijdrage per leerling voor het schoolfonds. Deze bijdrage wordt gebruikt voor bijzondere activiteiten in de school die geen onderdeel zijn van het gewone onderwijs. Hierbij kunt u onder meer denken aan sport- en culturele activiteiten, schoolreisjes, Kerst-/Paas-/Pinkstervieringen en verzekeringen. De penningmeester van de Activiteitencommissie is belast met het innen van deze bijdragen. Het tarief is:</p>\n\n<p class="MsoBodyText2">1<sup>e</sup> kind                     € 30,=</p>\n\n<p class="MsoBodyText2">2<sup>e</sup> en 3<sup>e</sup> kind             € 27,50</p>\n\n<p class="MsoBodyText2">Voor ieder volgend kind kunt u de bijdrage zelf bepalen.</p>\n\n<p>Wij verzoeken u het verschuldigde bedrag in één van de eerste maanden van het schooljaar over te maken op ons bankrekeningnummer 30.88.12.379 t.n.v. Oudercommissie Da Costa o.v.v. de achternaam en het groepsnummer van uw kind(eren).</p><h3>Ongevallenverzekering</h3>\n\n\n\n\n\n<p class="MsoBodyText2">Alle leerlingen zijn gedurende de schooluren en het uur vóór en na schooltijd (als zij onderweg zijn naar of van school) verzekerd tegen ongevallen. Deze verzekering geldt ook tijdens sportdagen,  schoolreisjes, schoolkamp, excursies, enz. Voor deze verzekering wordt geen extra bijdrage gevraagd.</p><h3>WA-verzekering</h3><p class="MsoBodyText2">De school heeft vanzelfsprekend voldoende maatregelen genomen om uw kind(eren) veilig te laten spelen en werken. Maar een ongelukje is natuurlijk toch snel gebeurd. Als uw kind op school schade lijdt, die in formele zin een gevolg is van nalatigheid van de school, kunt u de schoolleiding of het bestuur aansprakelijk stellen voor de schade. Veel voorkomende kleine ongelukjes, zoals bijvoorbeeld verf op de kleding, een kapotte fietslamp of een bril die sneuvelt, kunnen niet op de school worden verhaald.</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n
2357	<h1>Ouderhulp</h1>
2358	<p>Er vinden veel activiteiten in en buiten de school plaats waarbij u, als ouder, een belangrijke rol kunt spelen.</p>\n\n\n\n\n\n<p class="MsoBodyText2">Onder andere bij: decoratie, kopieerwerk, klassenouder, zitting nemen in de MR of AC, decoreren van de school, hulp bij expressiemiddagen, klussen, hulp bij het begeleiden van de Plusgroep (intelligente en/of begaafde kinderen), niveaulezen, sportbegeleiding bij de vele sportevenementen waar wij aan deel nemen en bij de sportdag, tussenschoolse opvang (overblijven), begeleiding schoolzwemmen, hulp bij de spelletjesmiddagen, bibliotheekbezoekjes en uitstapjes van de kleuters, enz.<br/>Aan het begin van het schooljaar ontvangt u een formulier waarop u kunt aangeven aan welke activiteiten u actief mee wilt werken. In geval van bijzondere activiteiten voor de kinderen wordt u zo nu en dan, via de nieuwsbrief of een losse brief gevraagd ons en uw kind te helpen.<br/>Wij doen een dringend verzoek aan u om u voor één of meerdere activiteiten op te geven. Alleen samen kunnen we er een goede, gezellige en veilige school van maken! Goed om te weten: alle ouders kunnen helpen. De toezegging voor hulp via het bovengenoemde formulier geldt in principe voor één schooljaar.<br/>Disciplinaire maatregelen t.a.v. leerlingen bij activiteiten met ouders worden alleen door een leerkracht  genomen. Wanneer er problemen zijn, meldt de ouder dit aan de verantwoordelijke leerkracht.</p>\n\n\n\n<h3>Spelletjesochtend/middag</h3>\n\n<p class="MsoBodyText">In de groepen 1 en 2 organiseren we regelmatig een spelletjesochtend of –middag. Op deze morgen mogen de kinderen spelletjes van huis mee nemen die dan samen gespeeld mogen/kunnen worden. Veel van deze spellen kunnen niet zonder begeleiding gespeeld worden, dus wij kunnen uw hulp daar goed bij gebruiken! De kinderen vinden het fantastisch dat hun moeder of vader in de klas komt en voor u is het ook heel leuk om te ervaren hoe de sfeer in de klas is. De activiteit duurt ongeveer een uur. De data staan vermeld op de intekenlijst op het prikbord bij de lokalen.</p>\n\n\n
2388	<p>De Schoolraad bestaat uit minimaal 4 en maximaal 9 leden. De leden van de Schoolraad zijn ouders van leerlingen op school. Iedere ouder die zich betrokken voelt bij de Protestant Christelijke identiteit van de school zoals verwoord in de grondslag van Stichting P.C.P.O "De Vier Windstreken", deze onderschrijft en ook actief belijdt, kan zich aanmelden voor de Schoolraad. De taken van de Schoolraad zijn het bewaken van de Protestants Christelijke identiteit en het in de gaten houden van de kwaliteit van het onderwijs. Verder is zij een klankbord voor de directie en heeft zij een antennefunctie. De Schoolraad vertegenwoordigt de stem van de ouders bij de directie. Ze denkt mee en heeft een adviserende en stimulerende functie richting de directie. Ook heeft de Schoolraad het recht zitting te nemen in de sollicitatiecommissie bij het aannemen van nieuwe leerkrachten. </p>
2394	<p>Deze ouders doen heel actief mee bij allerlei praktische activiteiten van de school of van een bepaalde groep. Zitting nemen in de Ouderraad gebeurt meestal op uitnodiging van een zittend Ouderraadslid of het team. Wilt u in deze raad meehelpen, dan stellen we het erg op prijs als u ons dat laat weten. </p>
2393	<p>Het emailadres van de Medezeggenschapsraad is:<br/><a href="mailto:mr.pcb.meesterlalleman@d4w.nl">mr.pcb.meesterlalleman@d4w.nl</a><br/>secretariaat: Elze Bos</p>
2397	<p><strong>Schooljournaal</strong></p>\n<p>De school geeft regelmatig een nieuwsbrief uit, het zgn. Schooljournaal, met daarin: Mededelingen, informatie, verslagen van activiteiten en dergelijke. </p>\n<p><strong>Kennismakingsavond/Informatieavond</strong></p>\n<p>De kennismakingsavond is in een van de eerste weken van het nieuwe schooljaar. We willen dan met elkaar van gedachten wisselen over een aantal zaken die uw kind dat jaar in de groep meemaakt.</p>\n<p><strong>Rapporten</strong></p>\n<p>Drie maal per jaar worden de ouders van de vorderingen van hun kind op de hoogte gebracht door middel van het rapport (dit geldt voor gr. 3 t/m 8). De ouders van leerlingen van groepen 1 en 2 worden geïnformeerd middels het ‘Kleuterfunctioneringsverslag’. <br/>De rapporten zullen meegegeven worden in: <br/>• Eerste rapport : november <br/>• Tweede rapport : maart <br/>• Derde rapport : juli <br/>Na het 1e en 2e rapport volgen de ouderspreekavonden. Het rapport of het KFV (Kleuter Functionerings Verslag), kan dan startpunt van het gesprek zijn. Voor groep 8 geldt een aparte regeling in verband met de schoolkeuze. Hierover krijgen de ouders in de loop van het seizoen bericht. </p>
2409	<h2>Wat doet de MR?</h2>\n<p>Alle scholen in ons land hebben een Medezeggenschapsraad, die bestaat uit leerkrachten en ouders. Deze is ingesteld ten behoeve van:<br/>- het overleg tussen ouders, bestuur en personeel;<br/>- de medezeggenschap van ouders en personeel;<br/>- het goed functioneren van de school in haar doelstellingen.</p>\n<p>Onderwerpen voor de MR zijn onder andere:<br/>- het beleid van de Stichting ‘De Vier Windstreken’ in het algemeen;<br/>- omvang en samenstelling van de klassen;<br/>- de resultaten van de school;<br/>- de rechtspositie van de leerkrachten;<br/>- de organisatie van de school;<br/>- de veiligheid van leerlingen en personeel.</p>\n<p>Naast zaken die voor de Koningin Wilhelminaschool gelden, zijn er ook de zogenaamde bovenschoolse zaken. Bovenschoolse zaken zijn zaken die gelden voor alle scholen van -in ons geval- “De Vier Windstreken”. Voor bovenschoolse zaken is er de Gemeenschappelijke Medezeggenschapsraad (GMR). De GMR wordt gevormd door leden die namens de MR'en van scholen van “De Vier Windstreken” worden afgevaardigd.</p>
2398	<p>De vorige enquêtes zijn van de afzonderlijke scholen geweest in 2011. (Zie downloads). <br/><br/>In het voorjaar 2013 zal de nieuwe enquête worden gehouden.</p>.
2213	<h1>Onze school</h1><p><br/>De Moordrechtse basisscholen De Rank en De Sjaloom krijgen een nieuw ultramodern schoolgebouw in de wijk Vijfakkers-Noord. De twee protestants-christelijke scholen gaan samen. De nieuwe naam is geworden: PCB Meester Lalleman.</p><p>Het gemeentebestuur van Moordrecht heeft ingestemd met de nieuwbouw voor de scholen. Voor het nieuwe schoolgebouw zijn vier mogelijke plekken onderzocht. </p>
