2386	<h1>Ouders</h1><p><br/>We hechten veel belang aan een goed contact met de ouders. We willen hen zo goed mogelijk informeren over de vorderingen van hun kind en over de gang van zaken op school. Het is stimulerend voor de kinderen als ze merken dat ouders en leerkrachten hun vorderingen waarderen en allerlei zaken van school met elkaar bespreken.</p>
