2410	<h2>Contact</h2>\n<p>U bent van harte uitgenodigd om een van ons aan te spreken op het schoolplein met ideeën en of vragen. U kunt deze ideeën en vragen ook aan ons mailen via het volgende e-mailadres: U kunt ook aangeven in uw mail dat u gebeld wilt worden. Vanzelfsprekend zal uw mail vertrouwelijk worden behandeld</p>
2403	<h3><strong lang="nl">Klachtenregeling</strong></h3>\n\n<p style="text-align: justify; text-align: justify;" class="MsoBodyText2">Overal waar mensen samenwerken, kan iets fout lopen. Ook op een school. Als school voelen wij ons verantwoordelijk voor het realiseren van een veilige school met een prettig pedagogisch klimaat. Mochten er ondanks onze inspanningen toch zaken anders gaan dan u verwacht had, dan kunt u ons hierop aanspreken.</p>\n\n<p class="MsoBodyText2"> * <em lang="nl">Stap 1</em>   U bespreekt uw vraag, opmerking of klacht met de betreffende groepsleerkracht(en). Ook pestgedrag dat u signaleert bij uw eigen of andere kinderen, meldt u bij de betreffende groepsleerkracht. Voor klachten over het beleid wendt u zich rechtstreeks tot de directie.</p>\n\n<p class="MsoBodyText2">* <em lang="nl">Stap 2 </em>Indien dit overleg voor u onbevredigend is verlopen, wendt u zich tot de directie.</p>\n\n<p class="MsoBodyText2">* <em lang="nl">Stap 3 </em>De directie bespreekt uw vraag, opmerking of klacht met de betreffende leerkracht(en)</p>\n\n<p class="MsoBodyText2">* <em lang="nl">Stap 4 </em>Indien het noodzakelijk is, zal de directie bemiddelend optreden d.m.v. een gesprek. Zowel u als de leerkracht(en) zijn hierbij aanwezig.</p>\n\n<p class="MsoBodyText2">* <em lang="nl">Stap 5 </em>Indien dit alles voor u onbevredigend is verlopen, kunt u zich wenden tot de externe vertrouwenspersoon die aangesteld is door ons schoolbestuur. </p>\n\n<p style="text-align: justify; text-align: justify;" class="MsoBodyText2">In de klachtenregeling wordt onderscheid gemaakt tussen <em lang="nl">klachten over machtsmisbruik </em>en<em lang="nl"> overige klachten. </em>De <em lang="nl">overige klachten </em>kunnen bijvoorbeeld gaan over begeleiding van leerlingen, toepassing van strafmaatregelen, beoordeling van leerlingen, de schoolorganisatie. Mocht er sprake zijn van ernstige klachten over een vorm van machtsmisbruik ten opzichte van een leerling, dan kunt u een beroep doen op de (interne) contactpersoon, de externe vertrouwenspersoon of een officiële klacht indienen bij de klachtencommissie.</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p style="text-align: justify;" class="MsoBodyText2">Landelijke Klachtencommissie voor het Christelijk Onderwijs<br/>Postbus 82324<br/>2508 EH Den Haag<br/>Tel: 070-3861697 / 070-3861697<br/>Fax: 070-3020836<br/>Web: www.klachtencommissie.org<br/>Mail: info@klachtencommissie.org</p><h3>De contactpersoon</h3>\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p style="text-align: justify;" class="MsoBodyText2">Op onze school zijn N. van Dixhoorn en E. Sterk aangesteld als interne contactpersoon.<br/>Wij verzoeken u om, in geval van een klacht, zo mogelijk eerst contact op te nemen met hen. Bij hen kunt u altijd terecht om, vertrouwelijk, een geval van (vermeend) machtsmisbruik te bespreken. Zij zullen naar uw verhaal luisteren en bespreken welke stappen ondernomen zouden kunnen worden.<br/>De contactpersoon kan u doorverwijzen naar de externe vertrouwenspersoon van de school, aangesteld door ons schoolbestuur. U vindt naam en adres in de adressenlijst. De externe vertrouwenspersoon is er om met u verder over de klacht te praten en u te ondersteunen bij eventuele \fverdere stappen. De externe vertrouwenspersoon is onafhankelijk. Ook de gesprekken met deze persoon zijn strikt vertrouwelijk.<br/>Als het nodig mocht zijn, wordt de klacht officieel ingediend bij de klachtencommissie. De klachtencommissie onderzoekt dan de klacht en adviseert het bestuur van de school over de te nemen maatregelen.<br/>We gaan er van uit dat u met <em lang="nl">overige klachten</em> in eerste instantie naar de betrokkene gaat, bijvoorbeeld de leerkracht. Komt u er samen niet uit, dan kunt u bij de directie van de school terecht. Bent u daarna nog niet tevreden, dan kunt u het schoolbestuur inlichten dat samen met u naar een oplossing zal zoeken.</p><h3>De vertrouwenspersoon</h3>\n\n<p style="text-align: justify; text-align: justify;" class="MsoBodyText2">Het bevoegd gezag, het bestuur, heeft ten minste één externe contactpersoon die u kunt aanspreken als u een klacht heeft. Deze vertrouwenspersoon is onafhankelijk en wordt benoemd door het bestuur. De vertrouwenspersoon weet hoe het onderwijs in elkaar zit en weet hoe hij/zij de klager kan opvangen en naar wie doorverwezen kan worden. De vertrouwenspersoon is, voor wat betreft zijn/haar werk, alleen verantwoording schuldig aan het bevoegd gezag. De vertrouwenspersoon zal eerst nagaan of de klager geprobeerd heeft de problemen met aangeklaagde op te lossen. Als dat niet het geval is, kan eerst voor die weg gekozen worden. </p>\n\n<p style="text-align: justify; text-align: justify;" class="MsoBodyText2">De vertrouwenspersoon kan een klager adviseren:</p>\n\n<p class="MsoBodyText2">* geen klacht in te dienen;</p>\n\n<p class="MsoBodyText2">* de klacht in te dienen bij de landelijke klachtencommissie;</p>\n\n<p class="MsoBodyText2">* de klacht in te dienen bij het bevoegd gezag;</p>\n\n<p class="MsoBodyText2">* aangifte te doen bij politie/justitie.</p>\n\n<p style="text-align: justify; text-align: justify;" class="MsoBodyText2">Als een klager dit wenst, begeleidt de vertrouwenspersoon de klager bij volgende stappen.</p>\n\n<p style="text-align: justify;" class="MsoBodyText2">Als de klager een minderjarige leerling is, wordt er – met medeweten van de leerling – contact met de ouders/ verzorgers opgenomen. Tenzij dit, naar het oordeel van de vertrouwenspersoon, niet ten goede komt aan het belang van de minderjarige.  De naam en het telefoonnummer van deze vertrouwenspersoon vindt u in hoofdstuk 13.</p>\n\n<h3>De klachtencommissie</h3>\n\n<p style="text-align: justify;" class="MsoBodyText2">Soms\nis het nodig een klacht in te dienen bij de klachtencommissie. De externe\ncontactpersoon helpt u hierbij. Iedereen die bij de schoolorganisatie betrokken\nis kan een klacht indienen.</p>\n\n<p style="text-align: justify;" class="MsoBodyText2">De\nklachtencommissie is onafhankelijk en heeft daarom geen binding met de school\nof het bestuur. Het bestuur heeft zich aangesloten bij de landelijke\nklachtencommissie van de BCPO.</p>\n\n<h3>Procedure indienen klacht</h3>\n\n<p style="text-align: justify;" class="MsoBodyText2">Een\nklacht kan zowel mondeling als schriftelijk worden ingediend. Van een\nmondelinge klacht wordt een schriftelijk verslag gemaakt. De contactpersonen\nvan de school verwijzen naar de externe contactpersoon. Deze kan de klacht (in\noverleg met de klager) zelf afhandelen, of doorverwijzen. De klachtencommissie\ngeeft binnen vijf werkdagen bericht van onderzoek. Hierna volgt binnen 4 weken\neen hoorzitting. Vier weken na de hoorzitting krijgt het schoolbestuur\nschriftelijk advies van de klachtencommissie. Binnen vier weken na dit advies\nneemt het bevoegd gezag een beslissing op grond van het rapport van de\nklachtencommissie, en laat dit aan alle betrokken partijen weten.</p>\n\n<h3>Meer informatie</h3>\n\n<p>Een\nexemplaar van de klachtenregeling ligt voor u ter inzage op school\n(directiekamer). De contactpersonen kunnen u hierbij helpen.</p>\n\n\n\n\n\n
