1890	<h1>Identiteit</h1>\n<p>Wij zijn een open christelijke school. Wij zien onze school als een gemeenschap, waarin de liefde tot God en de naaste centraal moet staan. Vanuit dit beginsel beschouwen we het als onze taak om zorg te dragen voor elkaar (leerlingen, ouders/ verzorgers en leerkrachten) en een ieder tot zijn recht te laten komen. </p>\n<p>In onze school vragen wij van iedereen respect voor de uitingen van onze identiteit en we hebben respect voor de eigen levensovertuigingen van de ouders/verzorgers en van de kinderen. </p>\n<p>Wilt u hier meer informatie, zie schoolgids.</p>
