2346	<h1>Zo ontwikkelen wij ons onderwijs</h1><h3><br/>De afgelopen jaren</h3><ul><li>Voor\nde groepen 3-8 zijn digiborden aangeschaft.</li><li>De\nleerkrachten hebben voor hun groepen groepsoverzichten gemaakt volgens de\nprincipes van opbrengstgericht werken.</li><li>Er\nzijn jaarlijks projecten uitgevoerd in het kader van Brede School. Afgelopen\njaar is hiervoor ook een teamontmoeting georganiseerd.</li><li>Voor\ngroep 3-8 zijn nieuwe tafels en stoelen aangeschaft.</li><li>In\ngroep 5-8 wordt nu gewerkt met de methodes ‘Naut’ (aardrijkskunde en natuur) en\n‘Meander’ (geschiedenis), inclusief de digibordlessen.</li><li>Het\nmanagementteam is een jaar in functie.</li><li>In\ngroep 2 wordt de schrijfwijze van de cijfers aangeleerd volgens de methode\n‘Schrift’.</li><li>In\ngroep 3 en 4 is de methode ‘Schrift’ ingevoerd.</li><li>Er\nzijn afspraken gemaakt over een doorgaande lijn voor het maken van werkstukken,\npowerpoints, boekbesprekingen en spreekbeurten.</li><li>Estafette-lezen\nis ingevoerd in groep 4-8.</li><li> De\nleerkrachten van groep 1 en 2 hebben zich verdiept in het maken van\nspelscripts.</li><li>De\nschool heeft zich ingezet voor de (nieuw)bouw van extra lokalen. Helaas is dit\nniet gehonoreerd door de gemeente Bodegraven.</li></ul>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<h3><br/>De nieuwe plannen</h3><ul><li>We gaan ons bezinnen op onze onderwijsvisie.</li><li>We\nzullen ons onderwijs evalueren op kwaliteit op de onderwijsgebieden taal-lezen,\nburgerschap en integratie, rekenen en begrijpend lezen.</li><li>Naar\naanleiding van de toetsuitslagen zal twee maal per schooljaar een\nschoolzelfevaluatie geschreven worden. Op de uitkomst hiervan passen wij de\nontwikkelplannen en ons handelen in de groepen aan.</li><li>Naast\nde groepsoverzichten gaan we werken met groepshandelingsplannen in de groepen.\nDit in het kader van het HandelingsGericht Werken.</li><li>Op\nde Pax-Christi-locatie worden twee kleutergroepen gehuisvest. Dit zullen wij in\nde eerste helft van 2013 evalueren.</li><li>Een\nnieuwe rekenmethode wordt uitgekozen en aangeschaft.</li><li>Een\n4<sup>e</sup> jaars pabostagiaire zal zich bezighouden met het verankeren van\nwoordenschatontwikkeling in ons onderwijs. De aanbevelingen zullen we in ons\nbeleid opnemen.</li><li>De\nspelscripts worden ingezet in de groepen 1 en 2.</li><li>De\nmuziekvisie die is ontwikkeld, zal worden geïmplementeerd in het onderwijs.</li></ul><h3><br/>Het schoolplan</h3><p>De school heeft haar verplichtingen omschreven in het schoolplan. Dit plan kan op school worden ingezien.</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n
1922	<h1>Ouderhulp</h1>\n<p>Wij vinden het fijn, om u, ouders en/of verzorgers, de kans te geven mee te denken en hulp te bieden bij schoolactiviteiten die worden georganiseerd voor uw kind(eren). U kunt zitting nemen in de MR, de OR, begeleiden bij een spel- of sportdag, helpen met de schoolkrant, helpen bij luizencontrole, helpen bij de overblijf (TSO), deelnemen aan de gebedsgroep, enz. Aan het begin van het schooljaar krijgt u een lijst met ouderactiviteiten. Wanneer u zich wilt opgeven, kunt u dit d.m.v. de lijst (of de leerkracht) kenbaar maken. Ouderhulp valt onder de verantwoor- delijkheid van de school; u bent via school W.A. verzekerd.</p>
