1062	<h1>ICT</h1>\n\n<p>Vanaf groep 3 staan er in elke groep leerlingcomputers waarop kinderen volgens een rooster o.a. extra kunnen oefenen met de softwareprogramma's voor taal en rekenen. Op dit moment wordt er in twee van de drie kleutergroepen een touchscreen gebruikt waarop kinderen met de softwareprogramma's van Bas spelenderwijs de voorwaarden oefenen om tot rekenen, lezen en schrijven te komen. In de andere kleutergroep wordt hiervoor momenteel nog een leerlingcomputer gebruikt.<br><br>Elk schooljaar worden met de kinderen afspraken gemaakt omtrent het gebruik van de computer, e-mail en Internet. De volgende afspraken zijn voor alle kinderen vastgesteld:</p><p>1.\tInstalleer zelf geen programma’s.<br>2.\tLog altijd in met je eigen naam en wachtwoord. <br>3.\tHoud wachtwoorden geheim.<br>4.\tHoud de werkplek netjes en ga netjes om met de hardware (computer, beeldscherm, toetsenbord en koptelefoon).<br>5.\tOpen geen bijlagen van onbekende e-mailberichten.<br>6.\tJe abonneren of iets via Internet bestellen is niet toegestaan.<br>7.\tGa op Internet alleen naar pagina’s waarvan je weet dat je ze mag bezoeken.<br>8.\tKom je echt per ongeluk op een ongewenste pagina (bloot, seks, geweld of grof taalgebruik) klik dan op het huisje en meld dat bij de leerkracht.<br>9.\tDownloaden van Internet is alleen toegestaan na toestemming.<br>10.\tMaak NOOIT afspraken om mensen te ontmoeten, die je via Internet hebt leren kennen.</p><p>Naast deze afspraken zal het D4W-Internetprotocol voor de leerlingen aan het begin van het jaar met de kinderen besproken en ondertekend worden (zie onderstaande link).</p>
775	<h1>Welkom</h1>\n<h2>op de website van de Da Costaschool in Bodegraven</h2>\n<p>De basisschool is een stukje van je leven, voor de kinderen en voor u. Jarenlang is er dezelfde weg van huis naar school en weer terug. In de loop van de jaren vertrouwt u uw kind vele uren toe aan de zorg van de leerkrachten van de basisschool. Een basisschool kies je dan ook met zorg.<br>Op deze site kunt u alles lezen over de school, onze uitgangspunten, de zorg voor de kinderen en nog veel meer. We nodigen u uit om een kijkje te nemen, niet alleen op deze site, maar ook op onze school!</p>\n<p>We proberen met de informatie zo volledig mogelijk te zijn, maar mocht u iets niet kunnen vinden of opmerkingen of suggesties hebben, laat het ons dan gerust weten.<br>Over wijzigingen en aanvullingen in de loop van het jaar zult u via de “nieuwsbrief" op de hoogte worden gebracht.</p>\n<p>Laat het schooljaar 2013 - 2014 een fijn jaar worden voor u en <br>uiteraard voor uw kinderen!</p>\n<p>Hans Compagne<br>Directeur</p>
