2830	<h1>De oudercommissie </h1>
2829	  \n<p>De oudercommissie bestaat uit een aantal enthousiaste ouders die een heleboel leuke dingen regelen binnen de school. U kunt denken aan het gezellig maken van de gangen, het zorgen voor een hapje en een drankje bij allerlei gelegenheden in de school, het organiseren van de meesters- en juffendag en nog heel veel meer. </p>\n<p>Dit jaar bestaat de OC uit (vlnr): <br/>Daphne van Beek, Dyenne Verboom, Debbie van Ronkel, Brenda Langeveld (voorzitter), Karin Wiltenburg (penningmeester), Anita van Duijn, Mariska Dekkers (secretaris), Gerda Lok en Roos Schreurs. </p>\n<p>Voor vragen kunt u contact opnemen met de voorzitter.</p>
