2714	<h1>Verlof aanvragen</h1><p>In bepaalde gevallen is het mogelijk om vakantie buiten de reguliere schoolvakanties of vrijstelling van onderwijs aan te vragen. Een aanvraag moet ruim van te voren gebeuren. Met behulp van de formulieren hieronder kunt u een aanvraag indienen.</p><p><img src="/static/cms/images/file_icons/pdf.gif" alt="Bestand - Aanvraagformulier vakantie" id="plugin_obj_2717" title="Bestand - Aanvraagformulier vakantie"/> <strong>aanvraagformulier vakantie</strong> - hiermee kunt u vakantie aanvragen buiten de reguliere schoolvakanties om. U dient ook een vakantieverklaring mee te sturen.</p><p><img src="/static/cms/images/file_icons/pdf.gif" alt="Bestand - Vakantieverklaring" id="plugin_obj_2716" title="Bestand - Vakantieverklaring"/> <strong>vakantieverklaring </strong>- samen met het aanvraagformulier heeft u dit formulier nodig om vakantie buiten de reguliere schoolvakanties aan te vragen.</p><p><img src="/static/cms/images/file_icons/pdf.gif" alt="Bestand - Aanvraagforulier vrijstelling schoolbezoek" id="plugin_obj_2715" title="Bestand - Aanvraagforulier vrijstelling schoolbezoek"/> <strong>aanvraagformulier vrijstelling schoolbezoek</strong> - met dit formulier kunt u vrijstelling van schoolbezoek aanvragen. Criteria zijn: </p><ul><li>huwelijk van bloed- of aanverwanten tot\nen met de derde graad van het kind: maximaal twee dagen.</li><li>huwelijksjubilea (12½, 25, 40, 50 of\n60-jaar van ouders en/of grootouders: één dag.</li><li>25-, 40- of 50-jarig ambtsjubileum van\nouders of grootouders: één dag.</li><li>Ernstige ziekte van ouders, bloed- of\naanverwanten tot en met de derde graad van het kind: duur in overleg met\ndirecteur.</li><li>Overlijden van bloed- of aanverwanten\ntot en met de vierde graad van het kind: duur in overleg met de directeur.</li><li>Verhuizing van gezin: één dag.  </li></ul>\n\n\n\n\n\n\n\n\n\n
