2796	<h1>De Plusklas</h1>
2764	<h3><strong>Onze identiteit in de praktijk</strong></h3>\n<h5>De Nessevliet is een kleine school met een open christelijke identiteit waar kinderen, ouders en leerkrachten zich veilig en geaccepteerd voelen. Dit betekent onder andere dat we respect hebben voor elkaar, respect voor de verscheidenheid van opvattingen van kinderen, ouders en leerkrachten. Ouders die voor onze school kiezen, stemmen hiermee in.<br/>Als christelijke school zijn we een gemeenschap, waarin de liefde tot God en naar elkaar uitgangspunt is. We zorgen voor de ander en laten de ander zoveel mogelijk tot zijn recht komen.<br/>Als school vieren we regelmatig dat we een christelijke school zijn. Dit doen we door met elkaar aandacht te besteden aan de christelijke feesten, in groeps- en in schoolverband, zowel zonder als met de ouders. We willen met elkaar regelmatig de projecten rond de Bijbel afsluiten door middel van vieringen. Naast het Bijbelse thema is er tijdens deze bijeenkomsten gelegenheid om de kinderen aan elkaar te laten presenteren waar ze in de groep mee bezig zijn. Dit zal rond de vakanties plaatsvinden en wordt steeds door een andere groep voorbereid.</h5>
335	<h1><strong>De Raad van Toezicht van Stichting P.C.P.O. De Vier Windstreken bestaat uit:</strong></h1><ul><li>Ad de Regt, \t\tvoorzitter </li><li>Richard de Jongh, \tvicevoorzitter</li><li>Brenda van den End </li><li>Dieter Möckelmann </li><li>Joost Goslings </li><li>Paul Ruijgrok </li><li>Peter van der Sterre</li></ul>
2797	<p>Sinds het schooljaar 2011-2012 werken we met plusklassen op de Immanuelschool. <br/>In het begin van dit schooljaar hebben we met elkaar een naam verzonnen voor de plusklas. Het heet voortaan ‘De Smartie-klas’. </p>\n<p>De Plusklas van de Immanuëlschool betreft een klas met leerlingen van de Immanuelschool die op grond van hun prestaties een andere uitdaging nodig hebben met betrekking tot de leerstof. Er is een Plusklas voor leerlingen uit groep 3 en 4, 5 en 6 en een voor groep 7 en 8. De leerlingen van groep 3 starten na de herfstvakantie in de Plusklas. De betreffende leerlingen worden ongeveer 1 uur per week uit de groep gehaald.</p>\n<p>De doelstelling van de Plusklas is het tegemoet komen aan de specifieke behoeften van (hoog)begaafde kinderen in de leeftijd van 7 tot 12 jaar op zowel intellectueel als op sociaal-emotioneel en creatief gebied. Dit willen wij doen door:<br/>• ieder kind een intellectuele stimulans en uitdaging op eigen niveau te bieden (cognitief aspect);<br/>• alle kinderen de gelegenheid te bieden met gelijkgestemde leeftijdsgenoten in contact te komen en daarmee te kunnen optrekken (sociaal aspect);<br/>• de creatieve capaciteiten te stimuleren zodat deze zich zo optimaal mogelijk kunnen ontplooien (creativiteitsaspect).</p>\n<p>Om te bepalen wie er in de Plusklas geplaatst wordt, hanteren wij voorlopig de volgende criteria. Een leerling die gediagnosticeerd hoogbegaafd is of een leerling die hoog-intelligent is en/of zeer goede scores op de Cito-toetsen heeft komt in aanmerking om geplaatst te worden in de Plusklas. Een grote zelfstandigheid en een goede werkhouding zijn ook belangrijke factoren om geplaatst te worden in de Plusklas.</p>\n<p>Juf Margret Boere is de leerkracht van de plusklas. Als er vragen zijn, kunt u altijd bij haar terecht.</p>
