2817	<p>Voor het inschrijven van uw kind nodigen we u uit om op school langs te komen en het inschrijfformulier samen met ons in te vullen. Bij nieuwe ouders vindt er eerst een informatief gesprek plaats en is er een rondleiding door de school.<br/>Ook ouders waarvan al een ouder kind de school bezoekt nodigen wij uit om samen het inschrijfformulier in te vullen.</p>\n<p>Voor het maken van een afspraak kunt u bellen met het telefoonnummer van de school; 0182 - 513746 of een mail sturen naar <a href="mailto:wilhelminaschool@d4w.nl">wilhelminaschool@d4w.nl</a> </p>\n\n<p>Op het inschrijfformulier worden diverse gegevens van uw kind en van u gevraagd, zoals natuurlijk de naam, adres en telefoonnummers, maar ook de naam en telefoonnummers van uw huisarts en tandarts, het Burgerservicenummer en het zorgverzekeringsnummer. <br/>Wij zijn ook verplicht gegevens van uw opleiding en mogelijke diploma's te noteren. <br/>Wilt u deze gegevens bij de inschrijving meenemen?</p>\n<p>Naast deze administratieve gegevens vinden wij het ook belangrijk om informatie over de ontwikkeling van uw kind te noteren. Zo kunnen wij uw kind vanaf de start op onze school zo goed mogelijk begeleiden.</p>
2176	<p><br>De Medezeggenschapsraad ( MR ) denkt mee met de directie over het beleid van de school. In de wet op de medezeggenschapsraad ( de WMS ) zijn de bevoegdheden van de MR geregeld ; over bepaalde onderwerpen heeft de MR instemmingsbevoegdheid en over andere onderwerpen adviesbevoegdheid.</p>\n<p>Vanuit de medezeggenschapsraden van alle scholen die onder de stichting “de Vier Windstreken”vallen, wordt een gemeenschappelijke medezeggenschapsraad ( GMR ) gevormd die zeggenschap uitoefent op het beleid van de stichting.</p>\n<p>Ons doel is een meedenkende en opbouwende MR te zijn. </p>\n<p>Onze MR bestaat uit zes leden; drie leden namens de ouders en drie leden namens het personeel. <br>Voor het schooljaar 2013/2014zijn de leden:</p><p>Ton Sterk<br>Voorzitter<br>mr.pbs@d4w.nl (t.a.v. voorzitter)<br><br>Jacqueline Verploeg<br>Lid en TSO<br>mr.pbs@d4w.nl<br><br>Patrick Huisman<br>Lid en GMR<br>mr.pbs@d4w.nl<br><br>Edith Vermeij<br>Secretaris<br>edith.vermeij@d4w.nl <br><br>Cobie van Meijeren<br>Lid<br>cobie.van.meijeren@d4w.nl <br><br>Nelda Zwijnenburg<br>Lid<br>nelda.zwijnenburg@d4w.nl<br></p>\n<p>Onze vergaderingen hebben een vaste opbouw :</p>\n<p>Opening</p>\n<p>Vaststellen van de notulen van de vorige vergadering</p>\n<p>Post / Mededelingen </p>\n<p>Mededelingen van de directie en vragen aan de directie</p>\n<p>GMR zaken</p>\n<p>Agendapunten</p>\n<p>Rondvraag</p>\n<p>Sluiting</p>\n<p>Als u vragen heeft, of onderwerpen waarover u graag van gedachten wilt wisselen met de MR, laat het ons dan weten. </p>
