2866	<h1>De gebedsgroep</h1>\n\n<h2>Wie zijn wij?</h2>\n<p>Wij zijn moeders met een verschillende kerkelijke achtergrond die het belangrijk vinden dat er regelmatig voor de school; de leerkrachten en de leerlingen gebeden wordt.</p>\n<h2>Wat doen we?</h2>\n<p>Wij komen 1x per 2 weken op woensdag van 8.30 uur tot 9.00 uur bij elkaar.<br/>Wij lezen een Bijbelgedeelte met elkaar, zingen samen en bidden voor: de school, de kinderen, het team, bestuur, thuissituaties, zieken, enz. </p>\n<h2>Waarom doen we dat?</h2>\n<p>Omdat wij geloven dat God wil dat we voor elkaar en degenen die wij liefhebben, bidden.<br/>Omdat God een hoorder van gebeden is.<br/>Omdat we daarom ook heel veel verwachting hebben van onze gebeden.<br/>Omdat het onze betrokkenheid bij school en op elkaar vergroot.</p>\n<h2>Wat vinden we belangrijk?</h2>\n<p>Dat God ons en onze kinderen wil zegenen.<br/>Dat er thuis voor school gebeden wordt.<br/>Dat u weet wat wij als gebedsgroep doen.</p>\n<h2>Gebedsbrievenbus</h2>\n<p>We hebben twee gebedsbrievenbussen. Eén gaat de klassen rond en de andere hangt in de schoolgang. Hier kan iedereen gebedspunten in doen. Als gebedsgroep nemen we deze gebedspunten mee in onze gebeden.</p>\n<h2>Daarom!</h2>\n<p>Willen we je uitnodigen om met ons mee te bidden, op woensdag om de twee weken om 8.30 uur in de personeelskamer.<br/>Of voel je vrij om gebedspunten in de gebedsbrievenbus te doen. Dan zullen wij die punten in vertrouwen in ons gebed meenemen.</p>\n<p>Wil je mee weten vraag het gerust aan Tjissie Alles en Tilly Sonneveld namens de gebedsgroep</p>
