2946	<h1>Rond de school</h1>\n<p>Tijdens de lessen van "De Vreedzame School"  stellen we met de kinderen in de klas gedragsregels op om de tijd op school voor iedereen zo fijn mogelijk te laten verlopen. In verschillende groepen kunnen die regels verschillend zijn.</p>\n<p>Op het plein en in de gangen gelden regels die voor alle kinderen hetzelfde zijn. U kunt die hieronder lezen.</p><p>Ook hebben we op school TSO / tussenschoolse opvang, zie hieronder in de overblijfkrant en ook in de Verkorte schoolgids 2013-2014 op deze site. Daarnaast hebben we BSO / buitenschoolse opvang van Quadrant Kindercentra (zie nun nieuwsbrief en ook weer de Verkorte schoolgids) in ons schoolgebouw.</p>
