3013	<h1><strong>Buitenschoolse Opvang</strong></h1><p/><p><strong>Welkom bij Kern Kinderopvang!</strong></p><p>Sinds 1 augustus 2007 zijn basisscholen wettelijk verplicht om een voorziening voor buitenschoolse opvang aan te bieden aan ouders. Scholen maken hiervoor afspraken met kinderopvangorganisaties.<br/>In de gemeente Vlist biedt Kern Kinderopvang verschillende mogelijkheden voor kinderopvang.</p><p>Op de Grote Haven 2 en 2a in Haastrecht  vindt u: BSO "De Groene Kikker<strong>"                   </strong><br/>Op deze locatie zorgen onze pedagogische medewerkers met liefde, plezier én deskundigheid voor uw kind(eren).</p><p>Buitenschoolse opvang “De Groene Kikker” heeft: <br/>1 groep (4 tot 13 jaar) met maximaal 40 kinderen. </p><p><strong>Openingstijden:</strong></p><p>Buitenschoolse opvang betekent: <br/>Naschoolse opvang, opvang na schooltijd tot 18.00 uur, op maandag-, dinsdag-, donderdag-  en vrijdagmiddag.        <br/>Wij halen de kind(eren) op bij de volgende basisscholen<br/>- OBS “De Vlisterstroom”<br/>- De Morgenster<br/>- St. Catharina</p><p>Tijdens de schoolvakanties is de buitenschoolse opvang de hele dag geopend van <br/>07.30 uur tot 18.00 uur en worden er extra activiteiten georganiseerd.<br/>De kinderen die gebruik maken van de BSO in Stolwijk in de vakantie worden opgevangen op de BSO-locatie in Haastrecht aan de Grote Haven 2-2a. De groepen worden samengevoegd.</p><p><strong>Kosten:</strong></p><p>Wanneer u gebruik wilt maken van kinderopvang sluit u met Kern Kinderopvang een overeenkomst af. <br/>U dient een aanvraag in bij de Belastingdienst voor een maandelijkse tegemoetkoming in de kosten voor kinderopvang. Voor meer informatie over deze tegemoetkoming verwijzen wij naar de website van de Belastingdienst. </p><p><strong>Aanmelden:</strong></p><p>U kunt uw kind(eren) bij Kern Kinderopvang aanmelden door een inschrijfformulier in te vullen. <br/>Dit inschrijfformulier kunt u telefonisch aanvragen op het volgende nummer, 0182 - 892788<br/>of via onze website www.kern-kinderopvang.nl <br/>Via de school van uw kind kunt u een informatieboekje en het inschrijfformulier opvragen. <br/>Op het inschrijfformulier geeft u aan welke vorm van opvang u zoekt.<br/>Contactpersoon voor vragen over aanmelding en plaatsing voor bovenstaande locaties,  <br/>is de Locatiemanager: mevrouw Kitty de Jong</p><p>Voor informatie kunt u met haar contact opnemen op de volgende manieren:<br/>- telefonisch: 06-22938958 of 0182-503993. <br/>- per e-mail: groenekikker@kern-kinderopvang.nl<br/>Uiteraard bent u ook welkom om, volgens afspraak, eens op een van de locaties te komen kijken, <br/>zodat u zelf de sfeer kunt proeven.<br/>Wij hopen dat dit informatieve gedeelte uw belangstelling heeft gewekt.</p>
