2347	<h3><br/>Jeugdgezondheidsdienst</h3><p class="MsoBodyText2">Onze school heeft contact met de Schoolartsendienst. Ieder schooljaar worden de leerlingen van groep 2 en groep 7 door de schoolarts onderzocht. Voor dit periodiek gezondheidsonderzoek van uw kind, dat in het gebouw van de vierstroom (Spoorlaan) plaatvindt, ontvangt u een oproep via de school.  Als er bijzonderheden zijn, kan de schoolarts dit onder zorg houden, of doorverwijzen naar de huisarts, logopedist, of jeugdhulpverlening. De uitkomsten van het onderzoek worden doorgesproken met de leerkracht van uw kind. U kunt ook buiten deze preventieve gezondheidsonderzoeken om altijd een beroep doen op de schoolarts met vragen over gezondheid en ontwikkeling.   </p>\n\n<h3><br/>Centrum voor Jeugd en Gezin</h3><p>Het Centrum voor Jeugd en Gezin (CJG) is de plek waar ouders terecht kunnen met allerlei vragen over opgroeien en opvoeden. Bijvoorbeeld over slapen, voeding, pesten, alcohol, relaties, seksualiteit, drugs of andere thema’s. Het CJG ondersteunt ouders bij de opvoeding van hun kind. Bij vragen, problemen of moeilijkheden kan het CJG ondersteuning bieden.</p>\n\n<p>Heb je een vraag? Bel: 0900 4440008 of mail. Website: www.cjgbodegraven-reeuwijk.nl</p>\n\n<h3><br/>Logopedist</h3><p class="MsoBodyText2">Een goede spraak-/taalontwikkeling is van groot belang voor de ontwikkeling van uw kind.</p>\n\n\n\n\n\n<p>Logopedie op school wordt verzorgd door de jeugdgezondheidszorg van de GGD Hollands Midden. Hanna Bouman-Been, de logopedist van de afdeling Logopedie, bezoekt vanaf januari 2013 onze school. Zij werkt alleen preventief. Onder preventie vallen screening, onderzoek en adviesgesprekken.<br/>Alle kinderen worden rond hun 5e verjaardag na toestemming van de ouders gescreend. Ouders krijgen hier van te voren schriftelijk informatie over en via een vragenlijst wordt het oordeel van de ouders en de leerkracht gevraagd.<br/>Voor kinderen uit alle groepen geldt: als u twijfelt over de spraak-taalontwikkeling van uw kind, dan kunt u het via de leerkracht aanmelden voor een logopedisch onderzoek. Hieraan zijn geen kosten verbonden.<br/>Indien logopedische behandeling nodig blijkt te zijn, kan de logopedist op school u adviseren in het vinden van een logopediepraktijk bij u in de buurt.</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p>De logopedist kan uw vragen beantwoorden op het gebied van:<br/>- adem en stem (heesheid)<br/>- afwijkend mondgedrag<br/>- spraak en onduidelijk spreken<br/>- mondademen<br/>- taalontwikkeling en taalproblemen<br/>- duim-/speenzuigen<br/>- horen en luisteren<br/>- slappe mondspieren<br/>- stotteren<br/>- problemen met kauwen en slikken</p>\n\n<h3><br/>OnderwijsAdvies (voorheen MHR/schoolbegeleidingsdienst)\n\n</h3><p class="MsoBodyText2">Onze school werkt samen met OnderwijsAdvies. Deze dienst adviseert de school op het gebied van schoolzaken. De begeleiding heeft betrekking op het kind, de ouders en de leerkrachten. Er is een contract met begeleidingsafspraken, welke jaarlijks worden vastgesteld.</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n
3064	<h1>Schoolkeuze met de VO Gids en VO Gids.nl</h1><p><br/>Ieder schooljaar ontvangen alle groep 8 leerlingen van de basisschool in de meeste delen van Nederland de VO Gids. Met de regionale VO Gids en en de bijbehorende site, devogids.nl, ben je goed voorbereid op je schoolkeuze. <br/><br/></p>
2174	<p>Wat doet de schoolcommissie in de praktijk?</p>\n<p>De schoolcommissie organiseert in overleg en samenwerking met de directie/leerkrachten diverse evenementen en verleent praktische ondersteuning daarbij. De kerstviering, sport- en speldag, het schoolreisje en de ouderavond zijn een paar voorbeelden hiervan. Bij al haar activiteiten roept de schoolcommissie zo nodig hulp in van ouders.</p>\n<p>Schoolcommissie leden:</p>\n<p>Aly Kortekaas<br>Algemeen lid<br><br>Tessa Langerak<br>Secretaris<br><br>Marina Sterk<br>Algemeen lid</p>\n<p>Gerda van Beekum<br>Penningmeester</p>\n<p>Joke Werkmeester<br><span style="background-color: rgb(255, 255, 255);">Algemeen lid</span></p>\n<p>Irma Soet<br>Voorzitter</p>\n<p>Yvonne Moenen<br><span style="background-color: rgb(255, 255, 255);">Algemeen lid</span></p>\n<p>Aline Visser<br>Algemeen lid</p>\n<p><br>Indien u contact zoekt met de schoolcommissie, dan kunt u dit mondeling of schriftelijk doen bij de secretaris. Het is ook mogelijk één van de andere leden aan te spreken. Ons e-mail adres is: sc.pbs@d4w.nl </p>\n<p>Schoolcommissie overleg<br>De schoolcommissie vergadert elke maand. Bij dit overleg is altijd een afgevaardigde van de directie aanwezig.</p>
