3129	<p>Na een periode van hard werken maken verschillende kinderen met elkaar een nieuwsbrief over de lessen in de plusklas. Hieronder kunt u in de nieuwsbrieven van de verschillende groepen lezen welke activiteiten ze ondernomen hebben.</p>
3209	<h1>Schoolgids</h1>
3170	<p>Wij zijn een\ngroepje enthousiaste ouders, die helpt bij het organiseren van diverse\ngezellige activiteiten gedurende het hele jaar. Aan het begin van het jaar\nverdelen we de activiteiten onderling en zo neemt iedereen een bepaalde\nactiviteit onder zijn hoede en is daarvoor samen met iemand uit het team de\nkartrekker. Je hoeft dus niet het hele jaar actief te zijn op school, maar het\nis heel leuk om intensief bezig te zijn met één feestdag.</p>\n\n<p>Er is ieder\njaar een aantal vaste activiteiten zoals de kinderboekenweek, het\nSinterklaasfeest en de kerstviering met aansluitend een buffet, vuurkorven en livemuziek.\nWat later in het jaar het Paasfeest  en\nde sportdag. Ook is er een versiercommissie, die zorgt dat de school er steeds\nweer gezellig uitziet.</p>\n\n<p>Ieder jaar is\ner een aantal  eenmalige activiteiten,\nzoals een bruiloft of afscheid van een leerkracht. Of een project voor een goed\ndoel.</p>\n\n<p>U kunt u\nnaast kartrekker ook opgeven om mee te helpen bij zo’n activiteit. Want zoals\nhet spreekwoord al zegt: Vele handen maken licht werk!</p>
3196	<p>Hieronder vindt u de laatste 10 nieuwsbrieven van dit schooljaar. Voorlopig blijft de nieuwsbrief in de huidige vorm bestaan.</p>
