3166	<p style="margin: 0px; padding: 0px 0px 6px; border: 0px; font-size: 1.3em; vertical-align: baseline; background-color: transparent; line-height: 18px; color: rgb(68, 68, 68); font-family: MolengoRegular, arial, serif;"></p><p>Voor onderwerpen die verder gaan dan alleen de school is er een Gemeenschappelijke Medezeggenschapsraad (GMR). In deze raad zitten vertegenwoordigers uit de MR’s van de scholen. De GMR bestaat uit 17 leden en vergadert over onderwerpen op bestuursniveau.</p><p style="background-color: transparent; padding: 0px 0px 6px; margin: 0px; border: 0px; font-size: 1.3em; vertical-align: baseline;"></p><p>Het dagelijks bestuur van de GMR bestaat uit:</p><ul style="background-color: transparent; padding-right: 0px; padding-left: 0px; margin: 0px 0px 0px 1.8em; border: 0px; font-size: 13px; vertical-align: baseline; line-height: 16px;"><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background-color: transparent;"><em style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background-color: transparent;">Jerry van der Leur,</em>  <em style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background-color: transparent;">Marja Overkamp</em> \tvoorzitter</li></ul><ul style="background-color: transparent; padding-right: 0px; padding-left: 0px; margin: 0px 0px 0px 1.8em; border: 0px; font-size: 13px; vertical-align: baseline; line-height: 16px;"><li style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background-color: transparent;"><em style="margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background-color: transparent;">Vacature,</em> \tsecretaris</li></ul><p style="background-color: transparent; padding: 0px 0px 6px; margin: 0px; border: 0px; font-size: 1.3em; vertical-align: baseline;"></p><p></p>
