1766	<h1>Leerplicht / aanvraag extra verlof</h1>\n<h3>In geval van ziekte (art.12)</h3><p>Leerlingen zijn vanaf hun vijfde jaar leerplichtig. De verlaging van de leerplichtleeftijd is dus (nog) niet van start gegaan. Als uw kind door ziekte de lessen niet kan volgen, moet u de school hiervan zo spoedig mogelijk in kennis stellen. Dat kan telefonisch of met een briefje. Dit geldt ook voor een bezoek aan de huisarts, tandarts of specialist. Wilt u deze bezoeken zoveel mogelijk buiten schooltijd plannen?</p>\n<h3>Wegens godsdienst of levensovertuiging (art 13)</h3><p>In het geval dat verplichtingen op grond van levensovertuiging of godsdienst verzuim noodzakelijk maken, dient u dit tijdig op school aan te vragen.</p>\n<h3>Vanwege vakantie (art 13)</h3><p>Om het groeiend schoolverzuim in te perken zijn de regels voor verlof buiten de schoolvakanties in 1995 aangescherpt. <br>Controle op het schoolverzuim vindt plaats door de afdeling leerplicht van de gemeente Bodegraven. <br>De landelijke richtlijnen zijn als volgt:<br>Verzoeken om ‘vrijstelling schoolbezoek’ voor een periode buiten de schoolvakanties worden in principe niet toegestaan. Er zijn echter bijzondere omstandigheden waaronder ouders vrijstelling kunnen aanvragen voor hun kind. Daarvoor moet het formulier ‘vrijstelling schoolbezoek’ ingevuld worden. Dat formulier is op school verkrijgbaar.<br>Het aanvraagformulier dient bij de directeur van de school te worden ingeleverd en wel uiterlijk 6 weken voor de aanvang van het gewenste vrijstelling schoolbezoek (bijzondere omstandigheden uitgezonderd).<br>De bevoegdheid tot het verlenen van maximaal 10 dagen vrijstelling schoolbezoek per jaar, wegens bijzondere omstandigheden, ligt bij de directeur van de school. Aanvragen die betrekking hebben op een periode langer dan 10 dagen, dienen tevens goedgekeurd te worden door de leerplichtambtenaar van de Gemeente.<br>Een verzoek om direct voorafgaande aan een schoolvakantie extra vakantieverlof te verlenen, om bijvoorbeeld het land van herkomst te bezoeken, of in een goedkopere periode op vakantie te kunnen gaan, of verkeersdrukte in de vakantietijd te ontlopen, mag niet worden toegestaan.</p>\n<p>Er kan alleen toestemming voor extra vakantie buiten de schoolvakanties worden gegeven:<br>- Bij blijde en droeve gebeurtenissen in de familiekring. <br>- Als het gaat om een gezinsvakantie, die niet in de schoolvakantie kan worden opgenomen, in verband met de specifieke aard van het beroep van één van de ouders. U dient dan bij het vrijstelling schoolbezoek altijd een werkgeversverklaring te voegen, waaruit de noodzaak blijkt.<br>Ouders die een kind zonder de vereiste toestemming toch meenemen, maken zich schuldig aan een overtreding. De leerplichtambtenaar kan dan een proces-verbaal opmaken, wat kan leiden tot het opleggen van een boete. Hoewel de wetgeving niet is gewijzigd, willen wij u toch vragen de nodige zorgvuldigheid te betrachten bij het aanvragen van vrijstelling van schoolbezoek buiten de vakanties. De leerplichtambtenaar controleert het schoolverzuim regelmatig en geeft geen waarschuwingen meer. Zij laat direct een boete opleggen en dit kan om aanzienlijke bedragen gaan.</p><p>Hieronder kunt u de formulieren downloaden. De formulieren moeten volledig worden ingevuld. Het eerste en tweede formulier bestaan uit twee pagina's.</p>
