3212	<h1>Medezeggenschapsraad (MR)</h1>\n<p><br>De Medezeggenschapsraad (MR) is geregeld door de ‘Wet medezeggenschap’ op basisscholen (en voortgezet onderwijs). De nieuwe wet is in 2007 ingegaan en vervangt de oudere ‘Wet medezeggenschap onderwijs’ uit 1992.</p>\n<p>Wij van de MR zijn een vertegenwoordiging van het personeel, de ouders en daarmee ook van de kinderen. De raad houdt zich actief met het school- en bestuursbeleid bezig. Zij kan de schoolleiding en het bestuur gevraagd of ongevraagd adviseren. Het verschil met de Ouderraad (OR) is dat de Medezeggenschapsraad zich voornamelijk bezighoudt met het gevoerde beleid op school- of bestuursniveau. Dat klinkt saai, maar het gaat uiteindelijk om dat de vertegenwoordiging op de hoogte is wat er in en om de school gebeurt, zodat we als MR aan de bel kunnen trekken en invloed uitoefenen in het belang van de kinderen en het personeel van de school, waar nodig is. </p>\n<p>De Medezeggenschapsraad – de naam zegt het al – heeft instemmingsbevoegdheden bij verschillende schoolzaken. Hiervoor kunnen jullie als ouders en leerkrachten onderwerpen aandragen die men besproken wil hebben in de MR. De directeur van de school kan als adviseur van de Medezeggenschapsraad aanwezig zijn op de vergaderingen. De activiteiten van de MR worden gepubliceerd in een jaarverslag (die weer te vinden is op deze website.)</p>\n<p>De MR bestaat uit gekozen vertegenwoordigers van ouders (2 leden) en leerkrachten (2 leden). Een goed functionerende MR is van groot belang voor beleidszaken op school en zal een kritische raad zijn met de intentie om de CBS De Morgenster nog beter te laten functioneren. De MR vergadert een keer per twee maanden samen met de Schoolraad op onze school.</p>\n<p><strong>De oudergeleding bestaat uit:</strong><br>- Peter Tamerus (voorzitter), vader van Lisanne uit groep 2, sinds zomer 2011 in de MR, telefoonnummer 502210.<br>- Tijmen Zentveld (secretaris) vader van Thom (groep 7) en Marit (groep 5) sinds okt. 2013 in de MR, daarvoor een aantal jaar in de Schoolraad.</p>\n<p><strong>De personeelsgeleding bestaat uit:</strong><br>- Dita Verhoog<br>- Juliette Polman</p>\n<p>E-mail: mr.morgenster@d4w.nl</p>\n<p><strong>Waarom zitten wij in de MR?</strong></p>\n<p>Peter: vooral de betrokkenheid bij wat er op school allemaal speelt en mee kunnen denken en besluiten over onderwerpen die belangrijk zijn voor de kinderen en de ouders.</p>\n<h1><br>Gemeenschappelijke Medezeggenschapsraad (GMR)</h1>\n<p><strong><br>Wat doet de GMR?</strong></p>\n<p>De GMR bestaat uit afgevaardigden van alle scholen van De Vier Windstreken. Binnen de GMR worden onderwerpen besproken zoals de veranderingen met betrekking tot Passend Onderwijs, onderwerpen die alle scholen aangaan en niet alleen de Morgenster. </p>\n<p><strong>Waaruit bestaat de MR-vertegenwoordiging in de GMR?</strong></p>\n<p>De MR-vertegenwoordiging bestaat uit één vertegenwoordiger namens De Morgenster, dat kan een ouder, maar ook leerkracht zijn.</p>
1750	<h1>Het team</h1><p class="MsoBodyText">Het team bestaat uit ruim 50 medewerkers:\nleerkrachten, intern begeleiders, directie, onderwijsassistenten en onderwijs\nondersteunend personeel. </p>\n\n<p class="MsoBodyText">Er is op de Goejanverwelleschool,\nondanks de schoolomvang, een grote mate van eenheid van handelen. Er is veel\nonderlinge afstemming (vergaderingen en nascholing), zowel op pedagogisch als\nop het didactisch gebied. We vinden het belangrijk dat kinderen (en ouders) een\nduidelijke doorgaande lijn ervaren. </p>\n\n<p class="MsoBodyText">Behoudens calamiteiten zoals\nziekte, heeft Iedere groep maximaal twee leerkrachten. Leerkrachten worden\naangesproken met ‘juf’ of ‘meester’, gevolgd door de voornaam van de juf of meester. Enerzijds\nzorgt dit voor een zekere afstand tussen kinderen en leerkrachten, anderzijds\nmaakt het de afstand niet onnodig groot. </p>\n\n<p class="MsoBodyText">Er werken ook enkele\nonderwijsassistenten op onze school. Zij hebben veel ervaring in het werken met\nkinderen, voldoen aan de eisen die aan hen gesteld worden en doen hun werk in\nnauw overleg met de leerkrachten.    </p>\n\n<p class="MsoBodyText">Tot het onderwijsondersteunend\npersoneel behoren “meester” Ed, de conciërge;  Anja, de\nschoolschoonmaakster en Yolande, onze administratief medewerker.    </p>\n
334	<h1>Welkom op de website van Stichting P.C.P.O. De Vier Windstreken.</h1>\n<p><br>Stichting P.C.P.O. De Vier Windstreken stelt zich ten doel kwalitatief goed onderwijs te verzorgen, in de nabije woonomgeving van onze leerlingen. Zo is ons streven in elke wijk, of in elk dorp van ons voedingsgebied een protestant christelijke school in stand te houden. Onze scholen werken waar mogelijk samen met andere scholen en voorzieningen in de wijk, of het dorp, zodat onze leerlingen zich kunnen ontwikkelen tot evenwichtige en weldenkende leden van onze samenleving, gesteund en gevoed door een normbesef en waarden op basis van het protestant christelijke gedachtengoed. </p>\n<p>Klik op het tabblad scholen (of onderstaande link) om de websites van onze 16 scholen in het Groene Hart te bezoeken.</p>\n<p><img alt="Link - Tabblad scholen" id="plugin_obj_2054" src="http://www.d4w.nl/static/cms/images/plugins/link.png" title="Link - Tabblad scholen"></p>\n<p>Bezoeker, veel lees- en kijkplezier! </p>\n<p><br>In het blokje hieronder ziet u het meest recente bericht zoals dat door één van onze scholen is gepubliceerd.</p>
3284	<p>Wij zijn een open protestants christelijke basisschool in Reeuwijk-Brug. Onze school is gehuisvest in MFA De Oude Tol, een moderne accommodatie gebouwd in 2010.\nWij hebben (per 1 mei 2013) 192 leerlingen verdeeld over 8 groepen.\nKernwaarden die uit de ouderenquête van januari 2013 naar voren kwamen: prettige sfeer, leerkrachten stimuleren kinderen om samen te werken en een team van enthousiaste en positieve leerkrachten. De school kreeg van de ouders op een schaal van 1 t/m 4 een 3,31 en scoort daarmee goed.\nDe leerlingen gaven in de leerlingenvragenlijst aan dat er duidelijke regels gelden, dat er in de klas extra wordt uitgelegd als de leerlingen dat nodig hebben en de kinderen geven met een score van 3,59 aan de school een goede school te vinden. \n</p>
3310	<h1><strong>De medezeggenschapsraad van de Goejanverwelleschool.</strong></h1>
3309	<p>De medezeggenschapsraad (MR) is een wettelijk\nverplicht orgaan binnen de school en bestaat uit ouders en leerkrachten. De MR\nheeft adviesrecht en instemmingsrecht over onderwijsinhoudelijke onderwerpen,\nhet financieel beleid en organisatorische zaken. Voorbeelden hiervan zijn de\nkwaliteit van het onderwijs, de belangen van kinderen en medewerkers, de\nvoorzieningen in de gebouwen en de arbeidsomstandigheden.<br>Bij een deel van elke vergadering is de schoolleiding\naanwezig, zodat onderwerpen gelijk met elkaar besproken worden.<br>De MR heeft ook regelmatig gezamenlijke vergaderingen\nmet de schoolraad en de schoolleiding.</p>\n\n<h2><strong>Samenstelling\nvan de MR</strong></h2>\n\n<p>Momenteel bestaat de MR uit de ouders Anja Fasol, Lia\nHogendoorn, Linda Noordegraaf en Nienke van Wensveen en de leerkrachten Dorien\nGroen, René Huisjes, Lucia Liefaart en Jeanet van Sorge.</p>\n\n\n\n<p>De oudergeleding van de MR wordt gekozen door de\nouders. Alle ouders van de school die de uitgangspunten van de school\n(zoals omschreven in de schoolgids) onderschrijven of respecteren, kunnen zich\nbij vacatures kandidaat stellen voor de MR.</p>\n\n\n\n<h2><strong>Gemeenschappelijke\nmedezeggenschapsraad</strong></h2>\n\n<p>De Goejanverwelleschool is onderdeel van Stichting\nP.C.P.O. De Vier Windstreken.<br>Voor onderwerpen die verder gaan dan alleen de\nGoejanverwelleschool is er een Gemeenschappelijke Medezeggenschapsraad (GMR).\nIn de GMR zitten vertegenwoordigers uit alle MR’s. De GMR bestaat uit 17 leden\nen vergadert over onderwerpen op bestuursniveau.<br>Vanuit onze MR is Lucia Liefaart afgevaardigde naar\nde GMR.</p>\n\n\n\n<h2><strong>Contact</strong></h2>\n\n<p>De openbare vergaderingen van de MR worden\naangekondigd in de wekelijkse nieuwsbrief, de Goejanverwelle Express. U bent van\nharte welkom om een keer aan te schuiven bij een vergadering.<br>Mocht u iets willen bespreken met een van de leden\nvan de MR, dan mag u hen altijd aanspreken.</p>\n\n<p>Daarnaast is het mogelijk de MR te mailen via <a href="mailto:mr.goejanverwelleschool@d4w.nl">mr.goejanverwelleschool@d4w.nl</a>.</p>
3320	<h2>Gedrag en wat doen wij daaraan?</h2><p>Omdat wij als school het heel belangrijk vinden dat elk kind zich veilig en gerespecteerd voelt, besteden wij veel aandacht aan het creëren van een omgeving waarin dit mogelijk is. Iedere leerkracht probeert in zijn groep d.m.v. voorbeeldgedrag, gesprekjes en het maken van afspraken enz., de kinderen te leren hoe ze met elkaar om moeten gaan. Toch bleek dat deze aanpak niet voor elk kind voldoende was. Er zijn kinderen die een extra steuntje in de rug nodig hebben. Met individuele aandacht en hulp bij het oefenen van hun eigen hulpvraag kunnen zij veel sneller succes boeken. Sinds een aantal jaren biedt Ineke Swart, leerkracht en gedragsspecialist op onze school, deze kinderen extra ondersteuning.</p><h2>Welke hulp bieden wij op onze school?</h2><h2>Grote Sijs</h2><p>De letters in het woord Sijs staan voor 'Sterk in je Schoenen'. Sijs is een sociale vaardigheidstraining voor kinderen vanaf groep 4 t/m 7à8. De10 lessen worden 2x per jaar aangeboden. Ze vinden onder schooltijd plaats in een groepje van 6 kinderen en 2 vaste begeleiders. (Inkeke Swart en José Massar) De kinderen krijgen d.m.v. oefeningen, spelletjes en gesprekjes een extra steuntje in de rug wat betreft sociale vaardigheden en weerbaarheid. Na 10 lessen volgt een evaluatiegesprek met alle betrokkenen en krijgen de ouders een uitgebreid verslag.</p><h2>Kleine Sijs</h2><p>Voor de jonge kinderen van groep 2 t/m 3 wordt een voorbereidende sociale vaardigheidstraining gegeven. De 6 kinderen oefenen spelenderwijs met het herkennen en omgaan van de vier basisemoties: boos, bang, blij en verdrietig. Ook deze 10 lessen worden door Ineke en José M. 2x per jaar aangeboden onder schooltijd. De training wordt afgesloten met een evaluatiegesprek met zowel de leerkracht als de ouders. Daarna krijgen de ouders een verslag van al hun bevindingen met evt. tips en aanbevelingen.</p><h2><span style="line-height: 5px;">Sijs voor schoolverlaters</span></h2><p><span style="line-height: 5px;">Voor de schoolverlaters (groep8) is er een speciaal programma om hen voor te bereiden en begeleiden bij de overstap naar het voortgezet onderwijs. Meestal bestaat de groep uit ongeveer 12 à 13 kinderen. Er worden 10 lessen door Ineke en José M. onder schooltijd aangeboden.</span></p><h2><span style="line-height: 5px;">Kids'Skills</span></h2><p><span style="line-height: 5px;">Ineke werkt geregeld met individuele kinderen op de Kids'Skills manier. Deze methode gaat er niet van uit dat kinderen problemen hebben maar dat ze nog een vaardigheid moeten leren. Deze methode werkt volgens een vast stappenplan en is zeer effectief. Het mooie bij dit proces is dat het kind zelf keuzes leert maken, daardoor zich medeverantwoordelijk voelt, meer vertrouwen krijgt maar zich wel omringt voelt door mensen die hem/haar helpen en steunen.</span></p><h2><span style="line-height: 5px;">Kinderen tekenen op elkaars rug</span></h2><p><span style="line-height: 5px;">Deze methode bevordert een positief pedagogisch klimaat in de klas. Kinderen hebben van nature de neiging elkaar aan te raken. Wanneer je op het plein kinderen observeert, zie je kinderen geregeld stoeien en duwen. Dit gaat echter vaak te wild en kan dan ontaarden in ruzies. Het is een begrensde methode waarbij groepjes van 2 kinderen om de beurt bij elkaar figuren tekenen op de rug, armen en handen. Deze lessen zijn niet alleen ontspannend en rustgevend maar werken door op hoe kinderen zich gedragen. Want het kind wat je net op deze manier hebt aangeraakt, ga je daarna niet pesten. Het voelt juist alsof je elkaar "een cadeautje" hebt gegeven en bevordert een positief klimaat in de klas. Na 6 lessen die Ineke in de groep heeft gegeven zal de "eigen leerkracht"de rest van het jaar deze werkwijze kunnen toepassen.</span></p><h2>Individuele gesprekjes</h2><p>Ineke heeft geregeld individuele gesprekjes met kinderen; soms gewoon even om "stoom uit te blazen" of hun verhaal kwijt te kunnen. Het stellen van open vragen, doorvragen maar soms gewoon even stil zijn kan al voldoende zijn om te vertellen wat hem/haar dwars zit. Soms komen ze uit zichzelf maar het komt ook voor dat een leerkracht aan Ineke vraagt of zij met bepaalde kinderen wil praten omdat hij/zij zich zorgen maakt en het idee heeft dat er meer aan de hand is. Als dat zo is, kan het voorkomen dat Ineke contact zoekt met de ouders om samen te overleggen welke hulp het beste voor hun kind is. Meestal is het voldoende om een aantal keren bij haar voor ondersteuning te komen maar het komt ook voor dat zij doorverwijst naar onze school maatschappelijk werkster of andere hulp zoekt.</p><h2>Observaties</h2><p>Wanneer een kind bepaald storend gedrag in de klas vertoont, kan een leerkracht Ineke's hulp inroepen. Zij observeert het kind in verschillende klassensituaties en bespreekt daarna samen met de leerkracht welke hulp dit kind nodig heeft.</p><h2>Welkom</h2><p>Ineke is 2 dagen aanwezig voor gedragswerkzaamheden en werkt veelal in haar kamertje. Zij vindt het fijn te merken dat ook ouders geregeld bij haar binnen komen om even te praten over hun kind. Zorgen samen delen voelt fijn en kan al de nodige ruimte geven! Zij probeert soms net een andere kant te belichten die je als ouder even niet ziet; dat kan al heel verhelderend werken. De deur staat altijd open; wees welkom!</p>
1772	<p>In onze school wordt les gegeven met behulp van moderne lesmethoden die aan de kerndoelen voldoen. Regelmatig worden de lesmethoden daarom vernieuwd en vervangen. De overheid heeft voor alle vak- en ontwikkelingsgebieden kerndoelen geformuleerd; criteria waaraan de leerlingen bij het verlaten van de basisschool moeten voldoen. We letten er bij de aanschaf van methoden op dat ze voldoen aan de kerndoelen, dat kinderen er goed mee kunnen leren en dat het materiaal er aantrekkelijk uitziet. Ook is het belangrijk dat de methode ruimte biedt aan kinderen die extra moeilijk werk aankunnen of die extra oefenstof nodig hebben.\nTijdens de jaarlijkse informatieavond aan het begin van het schooljaar krijgt u uitgebreidere uitleg over de methoden en kunt u ze ook inzien.\n</p><p>Onze school is een omgeving waar kinderen zelfstandigheid leren en verantwoordelijkheid mogen dragen: </p><p>* De kinderen werken op eigen niveau.\n<br>Kinderen kunnen op hun niveau werken, waarbij ze leren om zelf hun taken te plannen en hun leerproces te sturen. Wie instructie nodig heeft, krijgt die. De opbouw van kiesbord naar dagtaak tot weektaak vormt de basis. \n\t</p><p>* De kinderen leren keuzes te maken.\n<br>Binnen de taken leren kinderen ook eigen keuzes te maken. Er is sprake van keuzes, maar wel binnen duidelijke afspraken en regels. Er zijn zowel verplichte taken als keuze taken. \nDe leerkrachten begeleiden en/of sturen dit proces, afhankelijk van de zelfsturing van het kind. Ze streven naar zo optimaal mogelijke resultaten van de kinderen. \n\t</p><p>* Het product en proces zijn beide belangrijk.\n<br>Niet alleen het eindproduct is belangrijk, maar ook de processen die plaatsvinden. \n\t</p><p>* Leerruimtes beperken zich niet tot het klaslokaal.\n<br>Alle geschikte ruimtes op school staan in dienst van de ontwikkeling en het leren van kinderen.\n</p><h2>Vooraf aan de basisschool: Voor- en Vroegschoolse Educatie</h2><p>VVE is erop gericht om de ontwikkelingsmogelijkheden van een kind zoveel mogelijk te benutten. Op dit gebied werken de peuterspeelzalen en de basisscholen in Bodegraven nauw samen. We gebruiken zowel op de peuterspeelzaal als op de basisschool de prentenboeken van Ik ben Bas.\nOp de peuterspeelzaal wordt het taalstimuleringsprogramma Puk en Ko gebruikt. Op de Da Costaschool gebruiken we o.a. Ik en Ko. Dit is een vervolg op Puk en Ko. Zodoende is er een doorgaande lijn van de peuterspeelzaal naar de basisschool.\nDe peuterspeelzaal gebruikt de formulieren van Peuterestafette. De leidsters van de peuterspeelzaal vullen hierop de ontwikkeling van de peuters in. Regelmatig is er een gezamenlijke bijeenkomst van peuterspeelzaalleidsters en leerkrachten van de kleutergroepen. \n\n</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n
3342	<h1>De vakken</h1><h2>Sociaal emotionele ontwikkeling\n</h2><p>In alle groepen gebruiken we het materiaal van de methode ‘Leefstijl’. Ontwikkelen van zelfvertrouwen en zelfinzicht, omgaan met andere kinderen en volwassenen, oplossen van conflicten, zorgen voor elkaar: dit is een aantal onderwerpen waar de kinderen op speelse wijze mee leren omgaan. Hiervoor heeft ‘Leefstijl’ een aantal werkvormen ontwikkeld: praten, schrijven, uitspelen, tekenen, voordoen. \n \n</p><h2>Bijbelse geschiedenis en Levensbeschouwing\n</h2><p>Dagelijks staat godsdienstonderwijs voor iedere groep op het rooster. In groep 1 en 2 wordt gebruik gemaakt van de verhalen-volgorde die de kinderbijbel aangeeft en als aanvulling de methode ‘Startpunt’. In groep 3-8 wordt de methode ‘Kind op Maandag’ gebruikt. De meest gehanteerde werkvorm is het vertellen van Bijbelverhalen. Daarnaast worden er verwerkingen gemaakt in de vorm van tekeningen of knutselwerk. Ook leren de kinderen liedjes. Vanaf groep 4 wordt hierbij onder andere het liedboek voor de kerken gebruikt. Vanaf groep 7 lezen de kinderen regelmatig ook zelf in de Bijbel. \n \n</p><h2>Taal/lezen\t\n</h2><p>In groep 1 en 2 wordt veel taal gebruikt bij het spelen en de kringactiviteiten. Kinderen leren spelenderwijs dat het handig is als je ook kunt lezen. We gebruiken hiervoor een groot aantal inspiratiebronnen, waaronder: de VVE-methode ‘Ik en Ko’, het computerprogramma ‘Schatkist met de muis’ en ‘Ik ben Bas’. Natuurlijk lezen we veel voor uit allerlei prenten– en verhalenboeken. Ook is in iedere kleutergroep een klankkastje te vinden, met activiteiten voor ontluikende geletterdheid en auditieve ontwikkeling. Ontluikende geletterdheid is het aanleren van voorwaarden om tot lezen te kunnen komen in groep 3. Auditieve waarneming is onder andere het leren onderscheiden van de verschillende klanken  van letters en rijmen.\n<br>In groep 3 wordt de methode ‘Veilig Leren Lezen’ gebruikt.  Deze methode is gedifferentieerd, dat betekent dat kinderen die bij de start in groep 3 al (een beetje) kunnen lezen, aangepaste stof krijgen aangeboden.\nVanaf groep 4 wordt de methode ‘Estafette’ gebruikt voor het technisch lezen. Voor het begrijpend lezen starten we in groep 4 met de methode ‘Goed Gelezen’, beide leesmethodes tot en met groep 8 gebruikt. De taalmethode die we in groep 4 t/m 8 gebruiken heet ‘Taal op Maat’.\nElke groep heeft een eigen groepsbibliotheek. Deze moet natuurlijk regelmatig ‘ververst’ worden. Om die reden heeft elke groep één of meerdere abonnementen op de Openbare Bibliotheek en worden de boeken geruild. De kleutergroepen gaan een aantal keren naar de bibliotheek onder begeleiding van ouders en de leerkracht. Daar kunnen ze in groepjes een boek uitkiezen, dat ter plekke aan hen wordt voorgelezen. Ouders kunnen zich hiervoor vooraf inschrijven. De leerlingen van groep 3 en groep 7 ontvangen tijdens een bezoek voorlichting over de bibliotheek. Tijdens de Kinderboekenweek organiseert de bibliotheek een aantal activiteiten voor de school. Groep 7 en 8 bezoeken de bibliotheek af en toe voor een workshop.\n</p><h2>Rekenen/wiskunde\n</h2><p>We gebruiken in groep 1 en 2 hiervoor de ideeënboeken van ‘de wereld in getallen’. Er worden veel rekenactiviteiten gedaan: tellen, wegen, meten. Begrippen als groot-klein, veel–weinig, meer-minder worden in het spel van de kinderen aangeleerd. \nIn groep 3 t/m 8 wordt de methode ‘De wereld in getallen’ gebruikt, hierbij wordt ook het computerprogramma ingezet. \n</p><h2>Schrijven\n</h2><p>Een goed leesbaar handschrift is een bezit voor het leven en dit willen we op school op alle mogelijke manieren stimuleren. Sinds vorig jaar werken wij met de schrijfmethode ‘Schrift’. Deze is nu ingevoerd in groep 3 en 4. Deze methode zal gefaseerd ingevoerd worden in de groepen 5, 6, 7 en 8.\nHet schrijven met een vulpen is één van de middelen om een goed handschrift te ontwikkelen. We hebben er voor gekozen om alle kinderen van de tweede helft groep 3 tot en met 8 te laten schrijven met een vulpen. Halverwege groep 3 krijgen alle leerlingen daarom een vulpen van de school. We hebben hiervoor een goede kwaliteit vulpen gekozen. Als de vulpen, om welke reden dan ook, kapot gaat of kwijtraakt, kunt u via de juf of meester van uw kind een nieuwe aanschaffen. Soms is het voldoende om alleen het voorstukje te vervangen. De school rekent voor de vervanging uiteraard de inkoopsprijs. Deze is als volgt: volledig nieuwe vulpen: € 10,- losse penpunt: € 4,50 en een losse dop: € 4,-.\n</p><h2>Engels\n</h2><p>In groep 7 en 8 wordt de methode ‘Bubbles’ gebruikt. Deze methode is vooral gericht op Engelse conversatie, maar we besteden ook aandacht aan het aanleren van woorden. </p><h2>\nWereldoriëntatie\n</h2><p>In de kleutergroepen worden allerlei thema’s uit de omgeving van de kinderen centraal gesteld: dieren, wonen, gezondheid, feesten, enz. We maken gebruik van allerlei bronnen– en ideeënboeken om deze thema’s voor te bereiden.  Ook maken we uitstapjes naar bijvoorbeeld de boerderij of komt iemand in de klas iets vertellen of laten zien. In groep 3 en 4 volgen we het televisieprogramma “Huisje, Boompje, Beestje”, waarin aandacht is voor allerlei onderwerpen uit de wereld om ons heen. In de groepen 5 tot en met 8 gebruiken we een aantal lesmethoden voor de vakken aardrijkskunde, geschiedenis en biologie. Voor aardrijkskunde gebruiken we de methode “Meander” en voor geschiedenis “Bij de tijd”. \nBij het vak natuur maken we gebruik van diverse materialen. In groep 5 en 6 bekijken we elke week een aflevering van “Nieuws uit de Natuur”. Met behulp van een verwerkingsboekje gaan we vervolgens nog wat dieper op het programma in. In groep 7 en 8 wordt vanaf dit schooljaar een nieuwe methode gebruikt: “Naut”. Deze sluit aan bij de aardrijkskundemethode “Meander”, die we vorig jaar nieuw hebben aangeschaft. Bij deze methode gebruiken we digitale software. Op het digibord kunnen we bij de lessen behorende filmpjes laten zien.  Groep 7 en 8 kijken regelmatig naar het SchoolTVWeekjournaal, waarin allerlei onderwerpen uit de actualiteit aan de orde komen. Ook zijn er, buiten de methoden om, vaak gedurende het jaar nog andere onderwerpen die interessant zijn om met de groep over te werken. Hiervoor staan allerlei lespakketten tot onze beschikking. Regelmatig gaan wij op excursie, georganiseerd door Milieudienst Midden-Holland te Gouda en het Natuureducatie-centrum ‘De Watersnip’ te Reeuwijk. Ook lenen wij ieder jaar een aantal leskisten van deze dienst.\n</p><h2>Techniek\n</h2><p>In het techniekkasteel, een serie kleurige kasten, staat een uitgebreide variatie aan materiaal en handleidingen waarmee alle leerkrachten de technieklessen geven.\n \n\n\n\n \n</p><h2>Verkeerseducatie\n</h2><p>Het is belangrijk dat kinderen op jonge leeftijd beginnen te leren hoe zij zich veilig in het verkeer kunnen gedragen. Hiervoor is, naast theoretische, ook praktische verkeerseducatie op de basisschool nodig. Voor deze praktijklessen wordt de methode School op Seef gebruikt. Voorbeelden van deze lessen zijn lessen oversteken, fietskunsten, motorische fietsvaardigheden en het circuit trapvaardig.\n</p><h2>\nExpressieve vakken\n</h2><p>Naast alle vakken, die een groot beroep doen op de cognitieve vaardigheden, zijn er ook vakken waarbij de kinderen hun creativiteit ontwikkelen. Hierbij valt te denken aan muziek, drama en tekenen. Deze vakken kunnen afzonderlijk gegeven worden, maar ook gecombineerd met andere vakken. Naast de “gewone” lessen in tekenen, muziek  en handenarbeid in ons lesprogramma nemen we ook deel aan de kunstactiviteiten. In samenwerking met de cultureel educatieve dienst “ HET KUNSTGEBOUW” komen  kinderen in aanraking met de diverse disciplines van kunstonderwijs: muziek/ toneel/ dans/ drama/  literatuur /film en beeldende kunst. Deze lessen worden gegeven door experts op hun gebied. Deze lessen vinden soms plaats in de theaterzaal van het Evertshuis maar ook wel in de eigen school. \n \n</p><h2>Bewegingsonderwijs\n</h2><p>Kinderen bewegen graag! De kleuterleerkrachten geven gymlessen in het speellokaal en laten de kinderen daarnaast ook veel buiten spelen. De lessen bewegingsonderwijs voor groep 3 tot en met 8 worden deels gegeven door een vakleerkracht, deels door de leerkrachten die een gymbevoegdheid hebben. De groepen krijgen 1 uur per week gym.\n \n</p><h2>ICT\n</h2><p>Onze school is de gelukkige bezitter van een computerlokaal vol met goed werkende computers. Vanaf groep 3 krijgen de kinderen les in het computerlokaal. Klassikaal of met de helft van de klas. Tijdens het werken op de computer leren de kinderen omgaan met de computer en een aantal basisprogramma's als Word en Paint. Daarnaast leren ze ook werken met e-mail en internet. Deze vaardigheden kunnen de kinderen gebruiken bij het maken van bijvoorbeeld werkstukken en spreekbeurten. Ook is er aandacht voor het veilig gebruiken van het internet. Ieder kind begint in groep 3 bij het programma dat hen leert om te gaan met de computer en doet dit op zijn eigen tempo.\n\n</p><h2>Burgerschapsvorming\n</h2><p>Leerlingen groeien op in een steeds complexere maatschappij met  veel verschillen tussen mensen, tradities, normen en waarden. Onze school vindt het van belang haar leerlingen op een goede manier hierop voor te bereiden. Vanuit onze christelijke identiteit vinden wij het van belang dat leerlingen op een zelfbewuste manier in het leven staan, waarbij ze niet alleen respect hebben voor anderen, maar ook naar anderen omzien. Wij willen leerlingen brede kennis over en verantwoordelijkheidsbesef voor de samenleving meegeven. In de school leren leerlingen samen te leven met anderen. Vanuit deze visie hebben we de volgende doelen en activiteiten opgesteld:\n \n</p><p>* Leerlingen leren praten over de manier waarop ze in het leven staan. Bij de lessen levensbeschouwing komen verschillende levensvragen aan de orde, meestal aan de hand van Bijbelverhalen. We gebruiken hiervoor in de groepen 3 t/m 8 de methode “Kind op Maandag”. \n\t</p><p>* In de school leven we – leerlingen en leerkrachten – met elkaar samen in een mini-samenleving. Leerlingen kunnen in de school oefenen in het leren samenleven met elkaar.  Zo worden leerlingen in de bovenbouw betrokken bij het opstellen van de klassenregels aan het begin van het schooljaar. Gedurende het jaar wordt gestimuleerd dat leerlingen elkaar op deze regels aanspreken. Daarnaast maakt de school gebruik van de methode “Leefstijl”. Leerlingen worden met behulp van deze methode geleerd hoe ze zelf conflicten kunnen oplossen. Wanneer de regels worden overtreden heeft de school een helder beleid over straffen en belonen, dat door elke leerkracht zo consequent mogelijk wordt uitgevoerd. Iedereen maakt fouten, maar iedereen mag ook weer opnieuw beginnen.\n\t</p><p>* Leerlingen participeren op een actieve manier in – en buiten – de school. Zo leren ze organisatorische vaardigheden aan en leren ze verantwoordelijkheid te nemen voor anderen. Zo organiseerden leerlingen bijvoorbeeld een klassenavond en een avond met presentaties over kerk en moskee. De leerlingen participeren in vieringen: viering opening schooljaar, kerst-, paas- of pinksterviering, de scholenzondag en de school doet elk jaar mee aan de Actie Schoenmaatjes.\n\t</p><p>* In de school oriënteren leerlingen zich op de samenleving en leren ze hun eigen mening over maatschappelijke thema’s te verwoorden. Dit gebeurt zowel in als buiten de school. Aanknopingspunten worden bijv. geboden door de lessen van het School TV Weekjournaal. Leerlingen discussiëren over thema’s die daarin naar voren komen. Soms biedt de actualiteit aanknopingspunten: verkiezingen, een krantenbericht, Prinsjesdag, een presentatie of gastles van het Bureau Halt of islamitische feestdagen.\n</p>
3545	<h1>"Vind je dit fijn?" "Nee"! </h1><p>(zie poster in de hal)</p><p>Vanuit mijn functie als vertrouwenspersoon zal ik deze en volgende week alle klassen weer bezoeken. Ik praat met de kinderen over hoe belangrijk het is dat je op een goede manier voor jezelf opkomt, wat je kunt doen als je gepest wordt of als je ziet dat een ander gepest wordt. Hoe reageer je als iemand je aanraakt en je wilt dat niet enz.</p><p>Bij de onder- en middenbouw neem ik een praatpop 'Conny' mee. Ik speel dat Conny een beetje verdrietig en ook bang is voor een kindje uit haar klas. Dit kindje wil namelijk telkens de baas over haar spelen. En als ze dan niet doet wat dit kindje wil, kan het zomaar stiekem knijpen of schoppen.</p><p>Dit vind Conny zo naar dat ze zelfs geen zin meer heeft om naar school te gaan.....</p><p>Gelukkig vertelt Conny wat haar dwars zit en samen met de kinderen ga ik oplossingen bedenken. Zo bespreken we spelenderwijs hoe belangrijk het is om erover te praten als je iets dwars zit en hoe je voor jezelf op een goede manier kunt opkomen.</p><p>In de bovenbouw neem ik de praatposter mee die in de hal hangt. Daar staan voorbeelden getekend van situaties waarin bijvoorbeeld gepest wordt, situaties waarin het belangrijk is om je eigen grenzen aan te geven maar ook het pesten en roddelen via internet en mobiel. Via een klassengesprek probeer ik vooral aan te sluiten bij wat er leeft onder de kinderen. Vanuit die voorbeelden praten we over wat je kunt doen, wie je zou kunnen helpen, hoe belangrijk je eigen houding is en op welke manier je je eigen grenzen aan moet geven.</p><p>Het is fijn om met iemand te praten die je vertrouwt, die naar je luistert en je kunt helpen. Op school is bij vervelende gebeurtenissen meestal de eigen leerkracht het eerste aanspreekpunt. Tòch wijs ik de kinderen erop dat wanneer ze om de één of andere reden iets liever niet met hun eigen juf of meester willen bespreken, ze ook altijd naar mij kunnen komen. </p><p>Ik ben elke maandag en dinsdag in mijn kamertje (hoofdingang, eerste verdieping) aan het werk. De deur staat voor alle kinderen en ouders altijd open.</p><p>Ineke Swart</p>
