dyText"> </p></td>\n<td valign="top">\n<p class="MsoBodyText"> </p></td></tr></tbody></table>\n<p class="MsoBodyText">  </p>\n<p class="MsoBodyText">In de groepen 1 t/m 4 hebben de kinderen gemiddeld 880 uur per jaar les. In de groepen 5 t/m 8 omvat het jaarrooster ruim 1000 lesuren. Daarmee voldoet de school aan de wettelijke normen.</p>\n<p class="MsoBodyText"> ‘s Morgens gaan de schooldeuren 10 minuten vóór schooltijd open. Dan kan iedereen alvast naar binnen gaan. Dat geeft ouders de gelegenheid om zo nodig nog iets aan de leerkracht mee te delen. Tijd voor een uitgebreid gesprek is er op dat moment niet, daar kunt u een afspraak voor maken. </p>\n<p>’s Middags kunnen de leerlingen van de groepen 1 en 2 tien minuten vóór schooltijd naar de lokalen worden gebracht. De leerlingen van de groepen 3 t/m 8 gaan op het belsignaal van 12.55 uur naar binnen. In de kleuterafdeling kennen we ook speciale “inlooptijden”. De kinderen kiezen dan direct een activiteit en de ouders kunnen dan een poosje met hun kind meespelen/werken. </p>\n<h1><br>Schoolvakanties 2013 - 2014</h1>\n<p><span style="BACKGROUND-COLOR: rgb(255,255,255);"><strong><br>Herfstvakantie: </strong><span class="Apple-tab-span" style="WHITE-SPACE: pre;"></span>21 t/m 25 oktober 2013</span></p>\n<p><strong>Kerstvakantie:</strong><span class="Apple-tab-span" style="WHITE-SPACE: pre;"> </span>23 dec. 2013 t/m 3 jan. 2014</p>\n<p><strong>Voorjaarsvakantie:<span class="Apple-tab-span" style="WHITE-SPACE: pre;"> </span></strong>17 t/m 21 februari 2014 </p>\n<p><strong>Goede vrijdag en Pasen: </strong>18 en 21 april 2014</p>\n<p><strong>Meivakantie:</strong><span class="Apple-tab-span" style="WHITE-SPACE: pre;"> </span>28 april 2014 t/m 9 mei 2014</p>\n<p><strong>Hemelvaart:</strong><span class="Apple-tab-span" style="WHITE-SPACE: pre;"> </span>29 en 30 mei 2014</p>\n<p><strong>Pinksteren:</strong><span class="Apple-tab-span" style="WHITE-SPACE: pre;"> </span>9 juni 2014</p>\n<p><strong>Zomervakantie:</strong><span class="Apple-tab-span" style="WHITE-SPACE: pre;"> </span>21 juli t/m 29 augustus 2014</p>
1159	<p><br>De medezeggenschapsraad (MR) vertegenwoordigt de ouders en het personeel richting de directie en het bestuur. </p>\n<p>De samenstelling van de MR in het schooljaar 2013-2014 is als volgt:<br>Oudergeleding:<br>Esther Brouwer (vicevoorzitter) <br>Marieke Jongebreur <br>Rob Scherpenzeel </p>\n<p>Personeelsgeleding:<br>Lenny Oosterom (voorzitter) <br>Patricia Mourik <br>Mineke Huisman </p>\n<p>Via deze website zullen wij informatie over en van de MR publiceren, zoals algemene informatie, de agenda's van de vergaderingen en informatie over adviezen die we aan de directie hebben gegeven. </p>\n<p>Als u (ouder of personeelslid) zaken hebt, waarvan u vindt dat die in het overleg tussen MR en directie besproken zouden moeten worden, schroom niet om met een van ons contact op te nemen. Alleen met uw input kunnen wij op een goede manier uw belangen behartigen! </p>
