814	<p><strong>Groep 1 en 2 </strong><br>Maandag 08.30-12.00 (inloop 08.30-8.45) en 13.15-15.15 <br>Dinsdag 08.30-12.00 en 13.15 – 15.15 <br>Woensdag 08.30-12.15 <br>Donderdag 08.30-12.00 en 13.15-15.15 <br>Vrijdag 08.30-12.00 </p><p><strong>Groep 3 en 4</strong><br>Maandag 08.30-12.00 en 13.15-15.15 <br>Dinsdag 08.30-12.00 en 13.15-15.15 <br>Woensdag 08.30-12.15 <br>Donderdag 08.30-12.00 en 13.15-15.15 <br>Vrijdag 08.30-12.00 (inloop groep 3: 08.30-8.45)</p>\n<p><strong>Groep 5 t/m 8</strong><br>Maandag 08.30-12.00 en 13.15-15.15 <br>Dinsdag 08.30-12.00 en 13.15-15.15 <br>Woensdag 08.30-12.15 <br>Donderdag 08.30-12.00 en 13.15-15.15 <br>Vrijdag 08.30-12.00 en 13.15-15.15 </p>\n<p>Op maandag is er inloop voor groep 1 en 2 van 08.30-08.45 uur.<br>Op vrijdag is er tot de herfstvakantie de mogelijkheid voor ouders van groep 3 om met hun kind om 08.30 in de klas mee te komen tot 08.45 uur. Dit geldt dus ook voor de groep 3-kinderen in de combinatiegroep. </p>\n<p>5 minuten voor aanvang van de lessen wordt de buitendeur opengezet, zodat iedereen rustig naar binnen kan komen.</p>\n<p>Een kwartier voor aanvang van de lessen en in de pauze is er pleinwacht op het grote plein voor de groepen 3 t/m 8. Wanneer kinderen te vroeg op school komen is er dus nog geen toezicht! Wilt u er op letten dat u uw kinderen niet te vroeg naar school laat komen?<br>Voor de veiligheid sluiten wij tijdens schooltijden het hek. Mocht u voor een dicht hek staan, wilt u dan aanbellen bij de voordeur?</p>
1762	<h1>TSO (Tussenschoolse Opvang)</h1>\n<p>De school biedt de mogelijkheid om uw kind tussen de middag te laten overblijven.</p>\n<h3>Inschrijven, aanmelden, afmelden</h3><p>Alle ouders die gebruik willen gaan maken van de overblijf (regelmatig of incidenteel) moeten een inschrijfformulier invullen. Dit formulier is verkrijgbaar bij de directeur. U kunt het inleveren bij de leerkracht van uw kind. <br>Het is van groot belang dat we weten welke kinderen er overblijven. We werken daarom met een aan- en afmeldsysteem: <br>Blijft uw kind altijd op dezelfde dag/dagen over? Dan hoeft u alleen uw kind af te melden als het een keer niet komt. Dit afmelden kunt u doen door de lijst in de hal van de school in te vullen. Kunt u zelf niet naar school komen? Mail Ria of geeft u uw kind een briefje mee, zodat de leerkracht uw kind op de lijst kan zetten. U kunt ook bellen naar de school. Als u vergeet om uw kind af te melden, zal de betaling toch doorgaan. <br>Blijft uw kind maar af en toe over? U kunt uw kind dan aanmelden op de lijst in de hal, via een briefje bij de leerkracht of telefonisch bij school. Als u uw kind niet aanmeldt, kan uw kind niet overblijven!</p>\n<h3>Kosten en betaling</h3><p>Als uw kind overblijft, kunt u een overblijfkaart kopen. Deze overblijfkaarten kosten:<br>17,50 euro voor 10 keer overblijven, <br>35 euro voor 20 keer overblijven. <br>50 euro voor 30 keer overblijven <br>Als uw kind bijna nooit overblijft, kunt u eventueel contant betalen. Het overblijven kost dan 2 euro per kind per keer. Wij geven echter de voorkeur aan het gebruik van een kaart. U kunt op school overblijfkaarten kopen: in de even weken op maandag van 8.30-9.00 uur. De data worden vermeld in de nieuwsbrief en bij de achteringang van de school.</p>\n<h3>Privacy</h3><p>In verband met de privacy rondom de gegevens van kinderen, geeft de school geen informatie over gedrag en/of gezondheid door aan de overblijfcoördinator. Mocht u het belangrijk vinden dat de coördinator op de hoogte is van bijvoorbeeld het dieet of gedragsproblematiek van uw kind, dan kunt u daarover zelf contact opnemen.</p>\n<h3>Informatie en contact</h3><p>Wilt u nog meer informatie? De overblijf wordt georganiseerd door overblijfcoördinator Ria Peek (tel: 611846 en e-mail: maria-pk@hotmail.com) in samenwerking met onze school. Contactpersonen namens de school: Iet Kleuver en Ilona Bukman.</p>
