3683	<p>Onze school is een Protestants Christelijke school. Dat is een vrij algemeen begrip. Toch hebben wij een eigen gezicht, een eigen karakter. Dat heeft met veel zaken te maken, zoals het bevoegd gezag (het bestuur), de ligging, de ouders, de kinderen en het personeel. Het protestants christelijke geloof speelt een grote rol in onze identiteit. Dit is wat ons dagelijks inspireert bij ons werk, in de omgang met de kinderen en met elkaar. Wij proberen het geloof in God de Vader en in Jezus Christus Zijn Zoon een plaats te geven in deze tijd en in deze cultuur. We willen onze identiteit niet alleen herkenbaar laten zijn uit wat we zeggen, maar vooral uit hetgeen we doen. Onze protestants christelijke identiteit komt onder andere tot uitdrukking in het dagelijks bidden en danken met de kinderen, in het godsdienstonderwijs dat we bieden, in de maandopeningen die we gezamenlijk houden en in de vieringen van de christelijke feesten. Om aan te geven waaraan we denken als we spreken over identiteit, noemen we een aantal grondwoorden, gerelateerd aan de Bijbel, die uitgangspunten vormen voor ons handelen: waardering, respect, zorg, vergevingsgezindheid, naastenliefde, aandacht, verdraagzaamheid, behulpzaamheid, eerlijkheid, rechtvaardigheid, vertrouwen, geloof, eerbied en dankbaarheid. Op een studiedag hebben we dit zo geformuleerd: ‘Wij willen vanuit de inspiratie die we putten uit Gods Woord, de Bijbel, in een respectvolle en veilige sfeer de kinderen leren samen te werken, op een zelfstandige manier basiskennis op te doen en leren vaardigheden te ontwikkelen, die nodig zijn om op te groeien tot een zelfverantwoordelijke volwassene’. Het onderwijs- en vormingsproces is op deze woorden gebaseerd. In de schooldoelen vindt u de kenmerken daarvan terug. </p>\n<p>Omgaan met elkaar </p>\n<p>Uitgangspunt: Wij willen een school zijn, waar ieder kind zich veilig voelt. Waar de kinderen met elkaar spelen, leren en samenwerken. Ook het schoolplein en de weg naar of van school moeten de kinderen als veilig ervaren. In alle groepen wordt gezorgd voor een goed pedagogisch klimaat. Dit wordt onder andere bereikt door de wekelijkse lessen sociaal-emotionele vorming; door actief reageren van de leerkracht op negatieve groepsprocessen en een algemeen positief reageren van de leerkracht op de leerlingen.</p>
