3713	Jaarplan en evaluatie
3718	<p class="MsoPlainText"><br>Onze school ligt in Waarder, een mooi dorp in\nZuid-Holland en tegen de grens van de provincie Utrecht. Het gebied waaruit wij\nonze leerlingen betrekken bevat naast de wijk waarin de school ligt, ook andere\ngebieden, zoals Driebruggen, Nieuwerbrug en Oudewater. De school is makkelijk\nte bereiken vanaf de A12. In het schoolgebouw is een peuterspeelzaal en\nbuitenschoolse opvang aanwezig.</p>\n\n<p class="MsoPlainText">Ons schoolgebouw is gebouwd in 2008 en is een prachtig\ngebouw met zeven klaslokalen en een grote speellokaal en aula. </p>
3720	<p class="MsoPlainText"><br>Een belangrijke taak voor de leden van de oudercommissie\nis het organiseren van allerlei activiteiten in de school.</p>\n\n<p class="MsoPlainText">De organisatie van activiteiten gebeurt in samenwerking\nmet de teamleden. De kerstviering, een sport- en speldag, het schoolreisje en\nde ouderavond zijn een paar voorbeelden hiervan. Bij al haar activiteiten kan\nde oudercommissie hulp inroepen van ouders in de school. De oudercommissie\nvergadert diverse malen per jaar. Bij de vergadering is altijd een teamlid\naanwezig.</p>
3721	<p class="MsoPlainText"><br>De Vier Windstreken heeft de schoolraad ingesteld om\ndatgene wat zich in relatie tot de school voordoet buiten de school in de\nschool bespreekbaar te maken. Kort samengevat: ‘van buiten naar binnen’. Omdat het\nbegrip schoolraad nog nieuw is, is de schoolraad in eerste instantie zoekende\nnaar de grenzen van haar functioneren. De primaire taak is om mee te denken met\nde school: een klankbord te zijn. Tijdens de vergaderingen is er intensief\ncontact met de schoolleiding en worden lopende zaken vanuit de schoolleiding\ntegen de schoolraad aangehouden voor advies.</p>\n\n<p class="MsoPlainText"><span style="background-color: rgb(255, 255, 255);">Daarnaast signaleert de schoolraad zaken van ouders en\nlegt dit op haar beurt aan de schoolleiding voor. De schoolraad is voornamelijk\neen bewaker van de identiteit van de school en het onderwijs en in het\nverlengde daarvan de kwaliteit van het onderwijs.</span></p>\n\n<p class="MsoPlainText">Uitgangspunt hiervoor is de grondslag van De Vier\nWindstreken en het identiteitsstatuut op schoolniveau. </p>\n\n<p class="MsoPlainText">De schoolraad is er van en voor ouders. Samen met de\nleerkrachten en de schoolleiding geven zij vorm aan de school in brede zin.</p>\n\n<p class="MsoPlainText"> </p>
3722	<p class="MsoPlainText"><br>Uitgangspunt van onze oudercontacten is, dat de relatie\ntussen de school en de ouders zo optimaal mogelijk is. Daardoor wordt de sfeer\nop een positieve manier beïnvloed. Wij zijn een school, waar we samen met\nouders het beste voor de kinderen willen.</p>\n\n<p class="MsoPlainText">Wij zijn een laagdrempelige school, waar ouders makkelijk\nbinnen kunnen lopen en contact met de leerkrachten kunnen opnemen. We hebben\ngeen speciaal spreekuur, maar men kan ‘s morgens altijd even binnenlopen om een\nafspraak te maken. Ook kunnen ouders via de telefoon of via de e-mail met ons\ncontact opnemen, eventueel om een langer gesprek af te spreken. Het e-mailadres\nvan de leerkrachten bestaat uit de roepnaam en achternaam gescheiden door een\npunt met toevoeging @d4w.nl.</p>\n\n<p class="MsoPlainText">We houden aan het begin van het schooljaar een\ninformatieavond per groep. Daarnaast zijn er individuele gespreksrondes na het\nuitreiken van het rapport: de rapportgesprekken. Ook de ouders van de jongste\nleerlingen die nog geen rapport ontvangen, worden hiervoor uitgenodigd. De\njongste kinderen ontvangen per schooljaar eenmaal een rapport. Dit is bij de\ntweede rapportronde. Hierbij geldt dat zij een rapport krijgen als zij voor 31\ndecember van dat jaar op school zitten.</p>\n\n<p class="MsoPlainText">Eén keer per twee weken verschijnt de “Informail”. Dit is\nactuele informatie die via de e-mail aan ouders wordt verstuurd. </p>\n\n<p class="MsoPlainText">Verder is er in groep 1 en 2 een inloopochtend. </p>\n\n<p class="MsoPlainText">Daar waar het noodzakelijk is, nemen wij contact op met\nouders en wachten we niet tot ouders naar ons toekomen. </p>\n\n<p class="MsoPlainText">Bovendien zijn er diverse werkgroepen waarin ouders\nparticiperen.</p>
