3730	<p><span style="font-family: Calibri, sans-serif;"><strong>Vakantierooster 2013-2014</strong></span></p><p><span style="font-family: Calibri, sans-serif;"><br>Herfstvakantie 21-10-13 t/m 25-10-13</span></p>\n\n<p><span style="font-family: Calibri, sans-serif;">Studiedag leerkrachten 30-10-2013</span></p>\n\n<p><span style="font-family: Calibri, sans-serif;">Dankdag 6-11-2013</span></p>\n\n<p><span style="font-family: Calibri, sans-serif;">Kerstvakantie 23-12-13 t/m 03-01-14</span></p>\n\n<p><span style="font-family: Calibri, sans-serif;">Voorjaarsvakantie 17-02-14 t/m 21-02-14</span></p>\n\n<p><span style="font-family: Calibri, sans-serif;">Biddag 12-03-2013</span></p>\n\n<p><span style="font-family: Calibri, sans-serif;">Goede vrijdag en Pasen 18-04-14 en 21-04-14</span></p>\n\n<p><span style="font-family: Calibri, sans-serif;">Meivakantie 28-04-14 t/m 09-05-14</span></p>\n\n<p><span style="font-family: Calibri, sans-serif;">Hemelvaart 29-05-14 en 30-05-14</span></p>\n\n<p><span style="font-family: Calibri, sans-serif;">Pinksteren 09-06-14 t/m 12-06-2013</span></p>\n\n<p><span style="font-family: Calibri, sans-serif;">Zomervakantie 21-07-14 t/m 29-08-14</span></p>
1105	<h2>De medezeggenschapsraad</h2>\n<p>De medezeggenschapsraad (MR) tracht de belangen van personeelsleden, ouders en leerlingen zo goed mogelijk te behartigen. </p>\n<p>De raad bestaat uit twee personeelsleden en twee ouders. </p>\n<p>Ouders:</p>\n<p>– Rejanne van Ingen</p>\n<p>– Esther Kruitwagen</p>\n<p>Personeelsleden:</p>\n<p>– Elsbeth Harthoorn</p>\n<p>– Hester Veldhuijzen</p>\n<p>De oudergeleding is gekozen uit en door de ouders en behartigt met name hun belangen. De personeelsgeleding wordt gekozen uit en door het personeel en behartigt met name hun belangen. Samen adviseren zij bestuur en directie en beoordelen ze belangrijke beleidsbeslissingen. </p>\n<p>Onderwerpen die aan de orde komen zijn bijvoorbeeld de huisvesting van de school, de groepsverdeling, het formatieplan, de vakantieregeling, ouderparticipatie en de algemene gang van zaken in en om de school. </p>\n<p>De raad komt regelmatig bijeen. Dit schooljaar 2012-2013 vergaderen wij op de volgende datums: dinsdag 12 november 2013, maandag 20 januari 2014, dinsdag 4 maart 2014, maandag 12 mei 2013 en maandag 30 juni 2013. </p>\n<p>Daarnaast heeft de MR contact met de oudercommissie, de Gemeenschappelijke MR, de schoolraad en de directie van de school. De directeur van de school is als adviseur van de raad regelmatig aanwezig.</p>\n<p>De MR brengt op de jaarlijkse ouderavond een jaarverslag van het voorgaande</p>\n<p>schooljaar uit. De notulen kunnen opgevraagd worden via de secretaris van de MR.</p>\n<p>Heeft u vragen of opmerkingen kunt u ons altijd mailen: <a href="mailto:mr.pwaschool@d4w.nl">mr.pwaschool@d4w.nl</a></p>
