3723	<p class="MsoPlainText"><br>Voor de aanmelding van nieuwe leerlingen kan contact\nworden opgenomen met de interim-directeur, Joke Pater. Wij vinden het prettig\nde inschrijving te doen onder schooltijd in het bijzijn van de nieuwe leerling.\nTijdens een rondleiding krijgen u en uw kind dan al vast een indruk van de\nnieuwe school. De inschrijving van jongste kleuters doen we bij voorkeur\nspoedig nadat ze 3 jaar zijn geworden. Ons inschrijfformulier is te vinden onder\nhet tabblad documenten.</p>\n\n<p class="MsoPlainText">Van ouders die voor onze school kiezen verwachten we dat\nze bewust kiezen voor christelijk onderwijs, dat ze instemmen met de vorm en\ninhoud van het onderwijs en de organisatorische afspraken zoals beschreven in\ndeze schoolgids. En dat ze in principe deelnemen aan alle schoolactiviteiten\ngedurende de hele schoolperiode.</p>\n\n<p class="MsoPlainText">Indien kinderen een specifieke begeleiding nodig hebben\nvan de school, of middels een zogenaamde LGF (leerling gebonden financiering)\nregeling worden aangemeld, dan worden hiervoor in het reglement specifieke\nrichtlijnen gegeven, welke met u zullen worden besproken.</p>\n\n<p class="MsoPlainText">Wanneer kinderen van een andere school komen, geldt als\nvoorwaarde voor eventuele toelating de toestemming van de oude school en het\nkunnen overleggen van een onderwijskundig rapport. Dit onderwijskundig rapport\nkan, evenals de groep waarin plaatsing gevraagd wordt, aanleiding zijn\nleerlingen niet toe te laten.</p>\n\n<p class="MsoPlainText">Als uw kind vier jaar wordt, mag het naar de basisschool.\nVanaf twee maanden voor de vierde verjaardag mag uw kind al twee dagdelen\nmeemaken en komen wennen op onze school. Hierover neemt de leerkracht van groep\n1 contact met u op om de wendagen af te spreken. De week na de verjaardag van u\nkind is zijn eerste schoolweek.</p>\n\n<p class="MsoPlainText">We kennen geen leerlingenstop, maar we laten de laatste\nvier schoolweken voor kerst- en zomervakantie geen leerlingen meer instromen.</p>
3755	<p><strong><br>In Memoriam</strong></p><p>Juf Siska, onze collega, is niet meer. <br>Als Siska had mogen meebeslissen dan zou ze vast hebben gezegd ‘niet nu al’. Want ze wilde nog zo graag.<br>....zo graag een bijdrage leveren aan de Goejanverwelleschool.<br>....zo graag een bijdrage leveren aan de feestweek van de school ter ere van het 25 jarig bestaan in dit jaar.<br>Maar ze is niet meer onder ons.</p><p>Siska was 25 jaar verbonden aan de school, waarvan zij 20 jaar deel heeft uitgemaakt van de directie. Hiervoor werkte zij aan de Westerschool in Korte Akkeren. <br>Zij heeft aan de wieg gestaan van de Goejanverwelleschool samen met Peter Kromhout. </p><p>Met tomeloze inzet heeft Siska zich gegeven voor de school en vele uren hier doorgebracht. Een 40 urige werkweek was er niet bij voor Siska.<br>Onderwijskundig gezien heeft zij zich hard gemaakt voor het Ontwikkelingsgericht Onderwijs-concept binnen de onderbouw. De sporen hiervan zijn nog zichtbaar.<br>Daarnaast zorgde Siska voor het bewaken van informatie: jubilarissen, rapportages, schoolplannen en kwaliteitskaarten. Dit hield zij allemaal bij. Ook haar taak, de leerlingen- en leerkrachtadministratie heeft zij lange tijd nauwgezet uitgevoerd. </p><p>Vele collega’s en ouders bood zij een luisterend oor en in de gesprekken was er een  gerichtheid op de ander. Wanneer je aan haar vroeg hoe het met haar ging, ook in haar periode van ziekte, wilde ze het liever over de ander hebben dan over zichzelf. Dit kenmerkte haar.<br>Wat Siska nog meer typeerde was het organiseren van gezamenlijke actviteiten, zoals een fancy fair, personeelsfeesten, werkavonden, projectweken etc.  Vaak zag je haar dan zorgen voor... en genoot zij zichtbaar van het samenzijn. </p><p>Haar periode van ziek zijn viel haar zeer zwaar, ook omdat zij zich nog zo graag had ingezet voor de school terwijl dit werk nu door anderen wordt gedaan. <br>In het jubileumjaar van de school is zij overleden.</p><p>Wij verliezen een collega, die met veel liefde en inzet zich hard heeft gemaakt voor de ontwikkeling van de Goejanverwelleschool. Wij zullen Siska herinneren als iemand<br>die zichzelf wegcijferde en tegelijkertijd goed wist wat ze wilde. Vooral haar warme<br>persoonlijkheid zullen we in onze herinnering met ons meedragen..</p>
2735	<h1>Lied van de maand</h1>\n<p>Op onze school is vorig jaar "het lied van de maand" geïntroduceerd. Iedere maand wordt naar aanleiding van de Bijbelvertellingen een nieuw lied aangeleerd. Meestal zal dat een lied zijn dat past bij de leeftijd van de kinderen, soms kan het ook voor alle kinderen van de school hetzelfde lied zijn. <br>Op onze site ziet u wat het lied van de maand is. Er staat er een link bij zodat uw kind thuis ook kan laten zien (en horen!) wat in de klas gezongen wordt. </p>\n<p><img alt="Afbeelding - 20121026_130451.jpg" id="plugin_obj_2887" src="http://d4w.nl/static/cms/images/plugins/image.png" title="Afbeelding - 20121026_130451.jpg">O<em>nder begeleiding van juf Marion op de piano wordt samen het nieuwe lied van de maand aangeleerd.</em></p>\n<h1>2013 - 2014</h1><h2><span style="background-color: rgb(255, 255, 255);">September</span></h2><p>Het lied van de maand september is 'Samen is veel leuker'.</p><p><img alt="Link - Samen is veel leuker" id="plugin_obj_3622" src="/static/1.5.4/cms/images/plugins/link.png" title="Link - Samen is veel leuker"></p><h2>Oktober</h2><p>Het lied van de maand oktober is 'Vergeven'. De kinderen uit groep 7b hebben de tekeningen die in de video voorkomen gemaakt. </p><p><img alt="Link - Vergeven" id="plugin_obj_3689" src="/static/1.5.4/cms/images/plugins/link.png" title="Link - Vergeven"></p><h2>November</h2><p>De liederen van de maand november zijn "Je bent veilig in Jezus' armen" en "Abba Vader"</p><p><img alt="Link - Je bent veilig in Jezus&amp;#39; armen" id="plugin_obj_3765" src="/static/1.5.4/cms/images/plugins/link.png" title="Link - Je bent veilig in Jezus&amp;#39; armen"></p><p><img alt="Link - Abba Vader" id="plugin_obj_3766" src="/static/1.5.4/cms/images/plugins/link.png" title="Link - Abba Vader"></p><p><span style="background-color: rgb(255, 255, 255);">___________________________________________________<br>___________________________________________________</span></p><h1>2012 -2013</h1><h2>September</h2>\n<p>Het eerste lied van de maand wordt in alle groepen aangeleerd: 'Samen in de naam van Jezus' (opwekking 167). </p>\n<p><img alt="Link - Samen in de naam van Jezus" id="plugin_obj_2756" src="http://d4w.nl/static/cms/images/plugins/link.png" title="Link - Samen in de naam van Jezus"></p>\n<h2>November</h2>\n<p>Het lied van de maand november is 'Een lamp voor je voeten'.</p>\n<p><img alt="Link - Een lamp voor je voeten" id="plugin_obj_2886" src="http://d4w.nl/static/cms/images/plugins/link.png" title="Link - Een lamp voor je voeten"></p>\n<h2>December</h2>\n<p>Het lied van de maand november is "Nu zijt wellekome"</p>\n<p><img alt="Link - Nu zijt wellekome" id="plugin_obj_2985" src="http://d4w.nl/static/cms/images/plugins/link.png" title="Link - Nu zijt wellekome"></p>\n<h2>Januari</h2>\n<p>Het lied van de maand januari is Psalm 139 "Heer die mij ziet zoals ik ben".</p>\n<p><img alt="Link - Psalm 139 " id="plugin_obj_3012" src="http://d4w.nl/static/cms/images/plugins/link.png" title="Link - Psalm 139 "></p>\n<h2>Februari</h2>\n<p>Het lied van de maand februari is "Hou van alle mensen".</p>\n<p><img alt="Link - Hou van alle mensen" id="plugin_obj_3111" src="http://d4w.nl/static/cms/images/plugins/link.png" title="Link - Hou van alle mensen"></p>\n<h2>Maart</h2>\n<p>In maart is er zowel voor de onder- als bovenbouw een lied van de maand. Voor de onderbouw is gekozen voor "Een parel in Gods hand".</p>\n<p><img alt="Link - Een parel in Gods hand" id="plugin_obj_3143" src="http://d4w.nl/static/cms/images/plugins/link.png" title="Link - Een parel in Gods hand"></p>\n<p>Voor de bovenbouw is gekozen voor "Langs de Via Dolorosa".</p>\n<p><img alt="Link - Langs de Via Dolorosa" id="plugin_obj_3144" src="http://d4w.nl/static/cms/images/plugins/link.png" title="Link - Langs de Via Dolorosa"></p>\n<h2>April</h2>\n<p>In de bovenbouw is Psalm 121 van The Psalm Project het lied van de maand.</p>\n<p><img alt="Link - The Psalm Project - Psalm 121" id="plugin_obj_3235" src="http://d4w.nl/static/1.5.3/cms/images/plugins/link.png" title="Link - The Psalm Project - Psalm 121"></p>\n<p>In de onderbouw is dit 'Weet je dat de lente komt?' van Elly en Rikkert.</p>\n<p><img alt="Link - Elly en Rikkert - Weet je dat de lente komt?" id="plugin_obj_3236" src="http://d4w.nl/static/1.5.3/cms/images/plugins/link.png" title="Link - Elly en Rikkert - Weet je dat de lente komt?"></p>\n<h2>Mei / juni</h2>\n<p><span style="BACKGROUND-COLOR: rgb(255,255,255);">Het lied van de maand mei / juni is "De kracht van Uw liefde" (Opwekking 488).</span></p>\n<p><span style="BACKGROUND-COLOR: rgb(255,255,255);"><img alt="Link - De kracht van Uw liefde (Opwekking 488)" id="plugin_obj_3331" src="http://d4w.nl/static/1.5.3/cms/images/plugins/link.png" title="Link - De kracht van Uw liefde (Opwekking 488)"></span></p>\n<h2><span style="BACKGROUND-COLOR: rgb(255,255,255);">Juli</span></h2>\n<p><span style="BACKGROUND-COLOR: rgb(255,255,255);">Het lied van de maand juli is "Onze vader" (Opwekking 436).</span></p><p><span style="BACKGROUND-COLOR: rgb(255,255,255);"><img alt="Link - Onze Vader in de hemel" id="plugin_obj_3406" src="/static/1.5.4/cms/images/plugins/link.png" title="Link - Onze Vader in de hemel"></span></p>
3783	<p>Op de Morgenster is er een mogelijkheid om tussen de middag op school te blijven eten.</p>\n<p>Onze overblijfcoordinator Linda Rullens-Ligterink, regelt met een aantal moeders het overblijven op school op maandag, dinsdag, donderdag en vrijdag.</p>\n<p>De onderbouw (groep 1 t/m 4) eet gezamenlijk in het lokaal van groep 1/2. De bovenbouw (groep 5 t/m 8) eet samen in het splitslokaal boven.</p>\n<p>Overblijfkaarten kosten €45,00 voor 20 keer overblijven. Incidenteel overblijven kan ook, maar moet vantevoren doorgegeven worden aan Linda. tel. 06-42255560</p>
3786	<p>Hieronder kunt u de uitslag van de Ouderenquête 2013 aanklikken.</p>\n<p>Op pagina 5 wordt uitgelegd welk percentage heeft gereageerd. Respondenten is 110. Hiermee worden de aangeschreven mailadressen bedoeld. Op het moment van afname van de enquête had onze school 65 gezinnen (met meestal dubbele mailadressen) De afgeronde enquetes waren 42. Dat betekent dat er een respons van ongeveer 65% was. Dat is heel erg veel!! Daar zijn we blij mee. </p>\n<p>Trots zijn we op onze school als we de uitslagen bekijken. Punten waar we nog aan gaan werken komen in het Schoolontwikkelplan naar voren. Ook dat doen we weer samen: kinderen, leerkrachten en ouders! </p>
3725	<p class="MsoPlainText"><br>Buitenschoolse Opvang (BSO)</p>\n\n<p class="MsoPlainText">Per 1 augustus 2007 hebben basisscholen de taak om\nbuitenschoolse opvang te regelen. Om hieraan te kunnen voldoen heeft onze\nschool samen met Kindercentrum Waarder afspraken gemaakt om voor onze school de\nbuitenschoolse opvang (BSO) te verzorgen. Onder buitenschoolse opvang valt\nzowel de voor- als de naschoolse opvang. Verder vindt de opvang plaats tijdens\nde schoolvakanties en een groot deel van vrije dagen/dagdelen.</p>\n\n<p class="MsoPlainText">De kosten voor de voorziening zijn gelijk aan de\nreguliere kosten voor kinderopvang.</p>\n\n<p class="MsoPlainText">De opvangtijden en contactgegevens zijn terug te vinden\nop de website: <a href="http://www.kindercentrumwaarder.nl">www.kindercentrumwaarder.nl</a>\nGezien de groeiende vraag om buitenschoolse opvang is tijdig inschrijven\nbelangrijk en kan er voor sommige dagen sprake zijn van een wachtlijst.</p>
3762	<p>Het lied dat in de maand november wordt aangeleerd, vindt u in de bestandjes hieronder.</p><p>We hebben het de komende weken over Jozef, de liederen gaan hier ook over.</p>
3827	<h2>December</h2>
3790	<h1><span style="background-color: rgb(255, 255, 255);"><br>Informatie</span></h1>\n\n<p><br>Klik\nbovenaan deze pagina op het betreffende (sub)tabblad over welk onderwerp u meer\ninformatie wilt vinden.</p>
3724	<h1><span style="background-color: rgb(255, 255, 255);"><br>Tussenschoolse Opvang (TSO)</span></h1>\n\n<p class="MsoPlainText"><br>De kinderen kunnen tussen de middag overblijven. Dit\nwordt ook wel tussenschoolse opvang of TSO genoemd. De overblijf wordt verzorgd\ndoor vaste overblijfouders en de TSO-coördinator, die geregeld cursussen\nvolgen. Samen zorgen zij voor een goede, veilige en vertrouwde omgeving voor de\nkinderen. De kinderen nemen van thuis eten en drinken mee.</p>\n\n<p class="MsoPlainText">Bij de TSO-coördinator (<a href="https://mail.google.com/mail/?view=cm&amp;fs=1&amp;tf=1&amp;to=tineke.griffioen@d4w.nl">tineke.griffioen@d4w.nl</a>) kunt ook het\nreglement opvragen, waarin de formele zaken geregeld zijn. Ook de afspraken\nover verantwoordelijkheden zijn hierin uitgewerkt. Zo wordt er om 12.00 uur\ngezamenlijk met (stil) gebed begonnen. Er wordt aan tafel gegeten. Daarna wordt\ner geëindigd. Bij slecht weer zijn er binnen het gebouw speelmogelijkheden.\nNormaal gesproken gaan de kinderen naar buiten waarbij de regel geldt dat ze op\nhet plein onder toezicht van de overblijfouder spelen. Ze blijven tot 13.00 uur\nonder toezicht van de TSO. Daarna neemt een leerkracht het over en mogen de\nandere leerlingen ook weer het schoolplein op. </p>
3833	<p>Op de site van scholen op de kaart kunt u basisscholen met elkaar vergelijken op het gebied van in- en uitstroom gegevens en de cito eindtoetsen. Via de onderstaande link komt u op de pagina met deze informatie van de Immanuelschool.</p>\n
\.
